INSERT INTO notes VALUES ('GB010',1,'kinship links with Fortescue, Annals p15.\r\nMother is sister of Catherine Fortescue');
INSERT INTO notes VALUES ('GB018',1,'moved to Brussels permanently in 1661');
INSERT INTO notes VALUES ('GB035',1,'moved to Boulogne 1652: father murdered 1665. Also known under the surname Car[r]ington');
INSERT INTO notes VALUES ('DB032',1,'Nursed by the Bruges Augustinians, she died whilst on her way home from Aix. Because of her long term ill health her father obtained permission to take her to the baths at Aix in July 1729 and negotiated additional time before re-entering the convent in order to recover: see I annals 444.');
INSERT INTO notes VALUES ('BB190',1,'Listed as pupil with Mary Ward Sisters Hammersmith 1705. See Bar Convent C44.');
INSERT INTO notes VALUES ('BB055',1,'Signed her clothing enquiry with a cross, but signed her name for her profession, indicating that she had learnt to write in the interval.');
INSERT INTO notes VALUES ('GB071',1,'Her father assisted with foundation of Boulogne.');
INSERT INTO notes VALUES ('RP185',1,'Lived for some years with some French Ursulines nr St Malo then went to English Benedictines in Paris where she took the little habit.');
INSERT INTO notes VALUES ('GB074',1,'Descended from martyr Sir Adrian Fortescue executed 1539: annals p15');
INSERT INTO notes VALUES ('GB074',2,'Kinship link to Aloysia Beaumont [GB 010]');
INSERT INTO notes VALUES ('GB075',1,'descended from martyr Sir Adrian Fortescue executed 1539 [great-great-granddaughter]: Annals p15');
INSERT INTO notes VALUES ('RP043',1,'Notes in Chron typescript suggest parents as John and Lucy Cary of Melford, Suff and sister of Edward Cary');
INSERT INTO notes VALUES ('GB140',1,'Moved to Boulogne 1652: convent moved to Pontoise 1658.');
INSERT INTO notes VALUES ('GB174',1,'convent moved to Pontoise 1658. ');
INSERT INTO notes VALUES ('LS052',1,'According to Foley, vii, 183, Tristram was probably the family name and Cross an alias.');
INSERT INTO notes VALUES ('LS172',1,'sister to 2 Jesuits');
INSERT INTO notes VALUES ('GB199',1,'Rocksavage or Rock Savage is now a ruined country house in Clifton near Runcorn, Cheshire.Mother in ODNB.');
INSERT INTO notes VALUES ('PA018',1,'Died during her noviciate.');
INSERT INTO notes VALUES ('PA019',1,'Her royalist father died fighting in Oxford during the English Civil War.');
INSERT INTO notes VALUES ('GB118',1,'Was responsible for the foundation of daughter houses at Boulogne in 1653,(moved to Pontoise 1658)in Dunkirk in 1662 and Ypres in 1665');
INSERT INTO notes VALUES ('GB177',1,'3 Jesuit brothers including Edward Petre alleged confessor to James II. Father also known as Thomas.');
INSERT INTO notes VALUES ('AC124',1,'Her body was found to be incorrupt almost forty years later, prompting locals to venerate her as a possible saint (Hallett 165-9).');
INSERT INTO notes VALUES ('LA059',1,'Her nephew, Henry, was married to Mary Thimelby, who entered the same convent after her husband\'s death.');
INSERT INTO notes VALUES ('BB063',1,'Sister of the Gunpowder plotter Sir Everard Digby. Aunt of Sir Kenelm Digby.');
INSERT INTO notes VALUES ('AC041',1,'She directed the foundations in Bois le Duc (Bulducke) and Alost & Cologne.\r\nMentioned in Hardman (1937), p. 84, 128.');
INSERT INTO notes VALUES ('GB128',1,'Sister of Francis Lawson OSB.  Aunt of Thomas Lawson SJ and William Lawson OSB.');
INSERT INTO notes VALUES ('GB127',1,'Aunt of Francis Lawson OSB.');
INSERT INTO notes VALUES ('GB126',1,'Aunt of Francis Lawson OSB.');
INSERT INTO notes VALUES ('LA164',1,'Aunt of Francis Lawson OSB.');
INSERT INTO notes VALUES ('GB172',1,'Father was steward to William 2nd baron Petre.');
INSERT INTO notes VALUES ('GB065',1,'according to the Rouen Chronicle Ursula Fermor was a scholar at Rouen but was considered too infirm to enter there, she returned to England c. 1667 and from there joined Ghent, maintaining a cordial correspondence with Rouen. Rouen Chronicle Chapter 16.  ');
INSERT INTO notes VALUES ('DB181',1,'Had been Maid of Honour to one of the Stuart Queens: chose to be lay sister out of humility. No other details known');
INSERT INTO notes VALUES ('DB064',1,'No other details known of her convent career.');
INSERT INTO notes VALUES ('BA122',1,'Uncle Jesuit: [SJ]');
INSERT INTO notes VALUES ('BA119',1,'Enter text\r\nniece in Pontoise');
INSERT INTO notes VALUES ('LA301',1,'Father executed for role in Gunpowder Plot: Petre connections');
INSERT INTO notes VALUES ('GP095',1,'');
INSERT INTO notes VALUES ('GP096',1,'');
INSERT INTO notes VALUES ('GB126',2,'Great-aunt of four Mary Ward sisters and Mary Laurentia of Pontoise.');
INSERT INTO notes VALUES ('GB040',2,'Her brother was created a Jacobite peer by James II. Father benefactor of community: Dunkirk History 7, 14-5, 18-9. Brother visitor to convent and designer of buildings: Dunkirk History 13-4.');
INSERT INTO notes VALUES ('GP166',1,'convert: obituary refers to her call to the Catholic faith. ');
INSERT INTO notes VALUES ('GB104',2,'Her great-uncle was William Howard, viscount Stafford, who was executed in 1680.  His daughter was Mary Delphina Howard OSD (BD041)');
INSERT INTO notes VALUES ('BD037',1,'Her great-uncle was William Howard, viscount Stafford, who was executed in 1678.  His daughter was Mary Delphina Howard OSD (BD041)');
INSERT INTO notes VALUES ('BD038',1,'Her great-uncle was William Howard, viscount Stafford, who was executed in 1678.  His daughter was Mary Delphina Howard OSD (BD041)');
INSERT INTO notes VALUES ('BD040',1,'Her great-uncle was William Howard, viscount Stafford, who was executed in 1680.  His daughter was Mary Delphina Howard OSD (BD041)');
INSERT INTO notes VALUES ('GP188',1,'Entered novitiate at Aire, but left being unhappy at being governed by the Friars: Forster Rouen II, p 167.');
INSERT INTO notes VALUES ('BD041',1,'Her father was beheaded in 1680.');
INSERT INTO notes VALUES ('DP093',1,'Born 1718 accordig to Foley, based on Surtees\' _History of Durham_, vol. i., p. 52.');
INSERT INTO notes VALUES ('BB201',3,'Her father was cousin of Joanna Waldegrave, a nun at the Brussels Benedictine convent.');
INSERT INTO notes VALUES ('LA196',1,'Foley 973 Tried out in Benedictine convent Brussels but was never well and decided to leave.');
INSERT INTO notes VALUES ('BB182',1,'Her father died in the Tower having been drawn into the Gunpowder Plot.');
INSERT INTO notes VALUES ('LA113',1,'Elizabeth converted to Catholicism: see Chronicles 241-51. After her father\'s death her mother who was Catholic endeavoured to bring her children into the Catholic faith: \'her daughter Elizabeth was the first that entred into the Church by reason that a Catholick maid who loved her dearly did often & earnestly desire her to think upon the state of her soul...\' ');
INSERT INTO notes VALUES ('BF263',3,'Mother was Mary Stanley-Massey-Stanley.');
INSERT INTO notes VALUES ('BB034',1,'Jesuit brother, Father Brian Cansfield');
INSERT INTO notes VALUES ('GB077',1,'Enter text\r\nLay Title: Lady');
INSERT INTO notes VALUES ('LC006',1,'Hallett Chap 32 206; ...planned originally to join Benedictines in Paris because she was already familiar with them from her education with the Ursulines in Paris; however was delayed and decided to go to Lierre which her mother supported.\r\n\r\n');
INSERT INTO notes VALUES ('BB033',1,'CRS Misc Vol 13, p7 She had two sisters nuns, one in the convent of Berlaymont, contiguous to the English convent at Brussels, and the other professed in the convent of La Cambre.\'');
INSERT INTO notes VALUES ('GP029',1,'translation credited to both Bentley and Evelinge');
INSERT INTO notes VALUES ('OB043',1,'In the ODNB article on Barbara Palmer, duchess of Cleveland, Susan Wynne writes that the father of Barbara Fitzroy was probably John Churchill and was never acknowledged by the king as his daughter. The duchess\' children took the surname Fitzroy in 1672 and were granted royal arms in February 1673. She left England to go abroad in order to economise in March 1676 taking her daughters with her. They were educated by the Conceptionists (Blue Nuns)in Paris, to which the duchess donated 1000 for new buildings. The compiler of the notes for the Diary of the Conceptionists (q.v) confirms Barbara Fitzroy\'s presence with the nuns from 1675 and gives the total gifts by the duchess as 15,630 livres: see 338-339. ');
INSERT INTO notes VALUES ('GP025',1,'She was a Benedictine candidate in abbey Nonnebosch near Ypres; later at Ypres and arrived in Gravelines in 1678');
INSERT INTO notes VALUES ('GP008',1,'Sent in 1652 to found the convent in Dunkirk. Her father ran a secret printing press from home');
INSERT INTO notes VALUES ('GP010',1,'Her father ran a secret printing press from home.\r\nJubilarian');
INSERT INTO notes VALUES ('GP012',1,'Her father ran a secret printing press from home');
INSERT INTO notes VALUES ('GP019',1,'Her father had accompanied James II into exile and was an officer at his court, and died at Bruges in 1712.  Her paternal grandfather was Colonel Walter Bagenal, born 1614, who was executed by Cromwell at Kilkenny in 1652.  Her paternal grandmother was Elizabeth, daughter of Christopher Roper, 2nd Lord Teynham.  Her elder sister, Ann, married Sir Gervase Clifton, 4th bart, of Clifton, Notts, and after his death in 1731, she married William Blackburne Esq (CRS 14, pp. 114-15).');
INSERT INTO notes VALUES ('GP016',1,'Data given in Gravelines Chronicle pp 243-6 varies substantially on dates. It gives death as 1690 23 Nov aged 35 after 20 years of profession. At present there is no means of verifying either version of data.\r\nCB Aug 2009');
INSERT INTO notes VALUES ('GP020',2,'Her father had accompanied James II into exile and was an officer at his court, and died at Bruges in 1712.  Her paternal grandfather was Colonel Walter Bagenal, born 1614, who was executed by Cromwell at Kilkenny in 1652.  Her paternal grandmother was Elizabeth, daughter of Christopher Roper, 2nd Lord Teynham.  Her elder sister, Ann, married Sir Gervase Clifton, 4th bart, of Clifton, Notts, and after his death in 1731, she married William Blackburne Esq (CRS 14, pp. 114-15).');
INSERT INTO notes VALUES ('GP032',1,'Her maternal grandfather was Richard Goodman, chief-yeoman of the buttery to Queen Elizabeth (CRS 14, p 57).');
INSERT INTO notes VALUES ('PC013',1,'Had been educated in the convent school.\r\nFrancis Talbot and his sister Lady Aston were guardians for her since childhood. Her parentage was kept secret but she was supposed to have been a natural daughter of George earl of Shrewsbury: see note in CRS vol. p331. Her unknown relations paid some of her dowry; the rest came from Lucy Talbot\'s fund: see p140.');
INSERT INTO notes VALUES ('LS202',1,'Left with Trevor Warner and Elizabeth Warner to be  Poor Clare');
INSERT INTO notes VALUES ('GP055',1,'Father was knighted by James II in exile at St. Germains.  Paternal grandfather was Sir Richard Bulstrode, knight, envoy of Charles II and James II at Brussels.  (CRS 14, p 152).');
INSERT INTO notes VALUES ('GP083',1,'According to a footnote in CRS 14, p. 92, her nephew, George Collingwood of Eslington Hall, married Catherine, daughter of Henry Browne, 5th viscount Montagu, and was executed in Liverpool on 25 February 1716, for having joined the Chevalier de St George. This is an error for great-nephew, son of her nephew William and his wife Mary Forster (see ODNB).');
INSERT INTO notes VALUES ('GP085',1,'Sisters: Alexia and Mary, Dunkirk/ Related to Cecily Weston, OSB Pontoise/ half-niece to Helen and Mary, Aug Louvain/ related to Hellen Gage, OFM Bruges/ Her father was a lodger at Aug Louvain (cfr APs)');
INSERT INTO notes VALUES ('GP090',1,'Related to Joanna Crane, PC Dunkirk and Elizabeth, Francis, & Jane, (Bens Cambrai)');
INSERT INTO notes VALUES ('GP103',1,'Father was of Painsley Hall, in the parish of Draycot-in-the-Moors, Staffs (S. Lewis ed., A Topographical Dictionary of England [1848], p. 88) and obtained his Christian name after being born in St Alban\'s prison, where his father spent much time for his faith.  Many of the family were secular priests, Benedictines, Jesuits and nuns, some of them using the alias of Parker (CRS 14, p. 70).');
INSERT INTO notes VALUES ('GP119',1,'Her niece, Mary, born in 1719 to Richard Fletcher of Denton\'s Green, was allegedly cured from a serious disease in 1768 after the application of the relic of the hand of the martyr Edward Arrowsmith SJ (CRS 14, p. 119)');
INSERT INTO notes VALUES ('GP120',1,'A near relative to Catholic printer and exile, John Fowler, whose wife, Alice, was daughter of John Harris, secretary to Sir Thomas More (CRS p.32)\r\nJubilarian');
INSERT INTO notes VALUES ('GP127',1,'confined to room for 21 years');
INSERT INTO notes VALUES ('GP147',1,'two years as a novice');
INSERT INTO notes VALUES ('GP261',1,'Footnote to Gravelines text gives Ann as cousin to Mary Harrington; as a result also cousin to her sister Margaret Harrington, OSB Cambrai. However, the word cousin is elastic in our texts and amongst commentators. Although establishing the family descent is challenging, it passed through heiresses of the main Aigburgh line, which would exclude a first cousinship. ');
INSERT INTO notes VALUES ('GP148',1,'');
