INSERT INTO notes VALUES ('PT008',2,'Notes: A descendant of Major (or Captain) William Boarman, from a family of Devon and Somerset who occurs in 1645 in Maryland; he died in 1709. Elisabeth and her cousin Matilda PT008 were his great-great-granddaughters. A descendant of Major (or Captain) William Boarman, from a family of Devon and Somerset who occurs in 1645 in Maryland; he died in 1709. Elisabeth and her cousin Matilda PT008 were his great-great-granddaughters. See Cornelius Francis Thomas, The Genealogy of the Boarman Family (Baltimore, 1897); http://ia600401.us.archive.org/27/items/genealogyofboarm00thom/genealogyofboarm00thom.pdf (accessed 09.05.11).');
