INSERT INTO notes VALUES ('BB170',1,'In 1671, she was given permission to go to the Ypres Benedictines for health reasons, though it is unknown if she went there for a short period of time.');
INSERT INTO notes VALUES ('PA074',1,'Her mother was the granddaughter of Sir Francis Windebank, secretary of state to Charles I.  Following the Glorious Revolution, her father was imprisoned in the Tower of London, before joining James II in exile.  He attempted to persuade his daughter not to become a nun. (ODNB)');
