INSERT INTO notes VALUES ('BB093',1,'A convert to Catholicism.');
INSERT INTO notes VALUES ('BB104',1,'Her father became Protestant for a time but returned to Catholic faith and was held in prison for a long period for refusing to swear the Oath of Allegiance.');
INSERT INTO notes VALUES ('LA146',1,'Her father became Protestant for a time but returned to the Catholic faith and was held in prison for a long period for refusing to swear the Oath of Allegiance. Initially indispute with his wife about the CAtholic upbringing of their daughters, she became a convert and brought them up as Catholics during his imprisonment. Three of them became nuns. She is said to have been sister to Lady Cary. Given the date this could refer to Catherine Knyvett, wife of Sir Edward Cary of Aldenham (d.1618).');
INSERT INTO notes VALUES ('LA145',1,'Stirnet has Katherine Ireland a nun daughter of Lawrence Ireland of Lydiate and Ann Scarisbrick (d.1664)');
INSERT INTO notes VALUES ('CB078',1,'Left the convent but returned and professed. see Bantoft.');
INSERT INTO notes VALUES ('GP265',1,'According to Stirnet, Stephen Tempest\'s first wife Susan Oglethorpe died in 1628. His second wife was Frances Gargrave, died 1662. Rec Hist notes Vol 7, 1963-4 p264 identifies problem with parentage and has Elizabeth Tempest dau Stephen and Susan Oglethorpe in Fran Brussels');
INSERT INTO notes VALUES ('BB157',1,'Clothed twice, indicating that she left and then re-entered.');
INSERT INTO notes VALUES ('BB197',2,'Recipient of a miraculous cure.');
INSERT INTO notes VALUES ('LA272',1,'Her cousin, Richard Tremayne, was father to Sisters Catherine and Margaret Tremayne of the Louvain Augustinians. Problem with relationship since Hamilton\'s pedigree does not agree with notes on pp44-5 of Chronicle vol 1.');
INSERT INTO notes VALUES ('LA262',1,'Her brother, Herbert Aston, married Catherine Thimelby, sister to the nuns, Frances and Mary Thimelby, as well as to her own husband.');
INSERT INTO notes VALUES ('LA005',2,'Joined as a scholar aged 12.');
INSERT INTO notes VALUES ('LS051',1,'Grandmother at the time of her profession');
INSERT INTO notes VALUES ('LS165',1,'She temprarily left the habit, returning to England on 1772 12 Jul, but being convinced it was just a temptation, she returned to the convent on 23 Nov.  Having already completed her novitiate, she was allowed to progress as normal.');
INSERT INTO notes VALUES ('BA100',1,'Probably the same as the Elizabeth Heath who joined the Sepulchrines.');
INSERT INTO notes VALUES ('LA014',1,'Lady Yeats paid her portion.');
INSERT INTO notes VALUES ('LA025',1,'On her death her portion was used to build a brew house. According to Gillow and Trappes-Lomax, CRS vol 8, p. 322, she was a daughter of Sir Henry Bedingfield  and his second wife Elizabeth Houghton.  This identification appears to be incorrect.');
INSERT INTO notes VALUES ('LA039',1,'Her brother, Dennis, secured the place of Sister Mary Barney at the convent. (Chr 366)');
INSERT INTO notes VALUES ('LA016',1,'Her place at the convent was secured by Dennis, brother of Sister Helen Brittain (Chr 366).');
INSERT INTO notes VALUES ('LA040',1,'Received a grant of 10 a year from Lady Petre.');
INSERT INTO notes VALUES ('LA040',2,'As a widow, her non-Catholic mother was made mother of the maids-honour at court of Elizabeth I (MS Chron p114, Gerard p260). Increasingly unhappy at court, Anne was sent by her mother into the country where she met a Catholic gentleman who eventually introduced her to Father John Gerard SJ, who was responsible for her conversion. After his arrest he asked Fr Garret to facilitate her entry into St Ursula\'s (Hamilton, Chron. I, p86, 107-9). For text of MS Chron. see next Note.');
INSERT INTO notes VALUES ('LA070',2,'Originally joined as a scholar.');
INSERT INTO notes VALUES ('LA214',1,'She had been servant to Lady Kemp, sister of Sister Susan Brooke.');
INSERT INTO notes VALUES ('LA041',1,'She had written to her sister, Lady Kemp, to secure the release of Frances Rogers to join the convent. (Chr 532)');
INSERT INTO notes VALUES ('LA042',1,'The chronicle suggests that she never fully professed as she was incapable of any settled state of life. \'...it was agreed that she should remain hole pensioner for life (or rather scholar) wearing always a kercher and a scholars habit & all the money which could be obtained out of her father\'s broken estate being paid was received as her pension.\' She was allowed to continue living in the convent, as she had since childhood, as a pensioner or scholar. She is shown there in 1636. The chronicle says she was sister of Agatha Brooke, BA033, who went to Bruges (Hamilton, ii, 163). This means that her mother was Sir Basil\'s first wife Etheldreda. ');
INSERT INTO notes VALUES ('LA046',1,'Her grandfather was first Lord Vaux of Harrowden. The MS Chronicle p88 says she was \'neece to the Lord Vaux whose cosin Mrs Brooskbey that had brought her up promised ten pound a year for her, but performed it only 2 or 3 year.');
INSERT INTO notes VALUES ('LA085',1,'She was blind for a year before having a cataract operation. Sponsored by Lady Mary Percy for her place in the convent: see Brussels annals 125.');
INSERT INTO notes VALUES ('LA060',1,'Her mother was martyred for her faith in York.');
INSERT INTO notes VALUES ('LA058',3,'Her sister, Dorothy, was a Poor Clare in Louvain (not an English convent).');
INSERT INTO notes VALUES ('LA072',1,'The chronicle claims that she was niece to Margaret Clement.');
INSERT INTO notes VALUES ('LA073',1,'The chronicle claims that she was niece to Margaret Clement.');
INSERT INTO notes VALUES ('LA058',5,'The chronicle claims that she was aunt to Mary and Helen Copley. (Chr 120)');
INSERT INTO notes VALUES ('LS216',1,'described as infirm in Chapter Book');
INSERT INTO notes VALUES ('LA082',1,'She was professed on her deathbed, having been a scholar at the convent.');
INSERT INTO notes VALUES ('LA088',1,'Decided to become a nun after discussions with Agnes Watson, who also entered the convent.');
INSERT INTO notes VALUES ('LA290',1,'While in England she encouraged Anne Evans to become a nun.');
INSERT INTO notes VALUES ('AC090',1,'Her uncorrupt body was found when her bones were moved to Antwerp.');
INSERT INTO notes VALUES ('LA290',2,'She looked after Sister Elizabeth Shirley.');
INSERT INTO notes VALUES ('LA229',1,'She was cared for by a lay sister, Agnes Watson, in her old age.');
INSERT INTO notes VALUES ('LA312',1,'Sister Frances probably attended Louvain as scholar, left 1673: Hamilton pedigree');
INSERT INTO notes VALUES ('LA103',1,'Her nephew, Thomas, was martyred, as well as her brother, Henry, who was the Jesuit provincial.');
INSERT INTO notes VALUES ('LA104',1,'Her nephew, Thomas, was martyred, as well as her brother, Henry, who was the Jesuit provincial. Father was master of the Free Grammar School, Nottingham.');
INSERT INTO notes VALUES ('AC025',1,'Some sources have 1682 2 Nov for profession which must be an error: CB');
INSERT INTO notes VALUES ('AC031',1,'Very interested in the foundation in Baltimore.');
INSERT INTO notes VALUES ('LA133',1,'Looked after old Mr Bolt for many years.  This was the convent organist, Fr John Bolt, a famous musician who had previously lived with the Petres and the Wisemans. (JEK)');
INSERT INTO notes VALUES ('LA123',1,'Her parents \'having ten children, this was the yongest and both her parents and all their children being protestants it pleased the divine goodnes to call yongest of all unto him\': See Chronicle p131');
INSERT INTO notes VALUES ('LA169',1,'Received a grant from the countess of Arundel.');
INSERT INTO notes VALUES ('LA169',2,'Her father was martyred in Lancaster on 1582 22 Mar.\r\nDid he marry Bridget Norton nee Bulmer of Wilton in Cleveland? see bib dict vol 4 p228.');
INSERT INTO notes VALUES ('LA172',1,'Niece to Lady Lovell (nee Roper) founder of Carmelites, Antwerp , who lived with her grandmother, Lady Cross, in Flanders. She spoke Flemish. Had been engaged to a gentleman of quality by the affair ended when he quarrelled with her grandmother. Her decision to become a nun was a difficult one and continued to be difficult for her after profession, though she persevered (I ann, under year 1634).');
INSERT INTO notes VALUES ('LA158',1,'Her father John Kempe of Pentlow\'s wife Lucy, was sister of Sir Robert Brook, brother of Alice BB027 and Susan Brook LA041. ');
INSERT INTO notes VALUES ('LA173',1,'Lived for 8 years as a servant with the Countess of Rutland, a Catholic.');
INSERT INTO notes VALUES ('AC065',1,'Before entering Carmelites spent time with the Benedictines Cambrai and Ursulines in Antwerp. (Hall. p119)');
INSERT INTO notes VALUES ('AC081',1,'left Antwerp to go to a Carmel at Douai.');
INSERT INTO notes VALUES ('AC085',1,'This sister joined as an oblate and did not take vows. Hallett p129');
INSERT INTO notes VALUES ('AC087',1,'Invited to enter as a choir nun but decided to enter as a lay sister. Hallett p109');
INSERT INTO notes VALUES ('AC093',1,'Mary of Jesus\' father was brother to Lioba Morgan of Augustinians: see Hamilton V II p4');
INSERT INTO notes VALUES ('AC098',1,'Her mother was a convert. Hallett 94.');
INSERT INTO notes VALUES ('AC100',1,'described as a convert Hallett 89');
INSERT INTO notes VALUES ('AC112',1,'Another sister was a Poor Clare in Portugal (Hallett 127).\r\nFather\'s status given as \'Esq\'');
INSERT INTO notes VALUES ('AC132',1,'Spent some time in Carmel in Cracow where she was sub-Prioress.');
INSERT INTO notes VALUES ('LA179',1,'She cared for Sister Cornelia Farmer.');
INSERT INTO notes VALUES ('LA192',1,'She cared for Father Fen in his old age.');
INSERT INTO notes VALUES ('LA209',1,'Her nephew, James Radcliffe, 3rd earl of Derwentwater, was executed following the 1715 Jacobite rebellion.');
INSERT INTO notes VALUES ('LA209',2,'Her sister-in-law was Mary Tudor, daughter of Charles II and sister of King James II.\r\n\r\nParents in Foster Visitation Pedigrees, pp98-9');
INSERT INTO notes VALUES ('LA208',1,'Her nephew, James Radcliffe, 3rd earl of Derwentwater, was executed following the 1715 Jacobite rebellion.');
INSERT INTO notes VALUES ('LA208',2,'Her sister-in-law was Mary Tudor, daughter of Charles II and sister of King James II.\r\n\r\nParents in Parents in Foster Visitation Pedigrees, pp98-9');
INSERT INTO notes VALUES ('LA188',1,'Mother Protestant and cousin to the lay martyr Swithin Wells.');
INSERT INTO notes VALUES ('LA034',1,'She was fetched from St Ursula\'s to St Monica\'s with special permission from the archbishop by Sister Catherine Noe.');
INSERT INTO notes VALUES ('LA191',1,'She fetched Sister Frances Blase from St U to join the convent.');
INSERT INTO notes VALUES ('LA191',2,'She cared for the sick.');
INSERT INTO notes VALUES ('LA199',1,'Died during her noviceship.');
INSERT INTO notes VALUES ('LA233',1,'Her grandfather had been lord mayor of London.');
INSERT INTO notes VALUES ('LA235',1,'A boarder, died whilst a convictress.');
INSERT INTO notes VALUES ('LA247',1,'She had previouslty attempted to enter a Poor Clare convent.');
INSERT INTO notes VALUES ('LA249',1,'Previously served Lady Ann Ingleby and Lady Babthorpe.');
INSERT INTO notes VALUES ('LC032',1,'Father became a Jesuit laybrother after death of his wife.');
INSERT INTO notes VALUES ('LC031',1,'Father became a Jesuit laybrother after the death of his wife.\r\nMentioned in Hardman (1937), p. 63.');
INSERT INTO notes VALUES ('LC087',1,'connections with slave owning, Hallett 123');
INSERT INTO notes VALUES ('AC104',1,'slave owning connections Hallett 123');
INSERT INTO notes VALUES ('LS008',2,'Her grandfather was the lord treasurer of England.');
INSERT INTO notes VALUES ('LS196',1,'Her great-grandfather had been lord treasurer of England.');
INSERT INTO notes VALUES ('LS197',1,'Her great-grandfather had been lord treasurer of England.');
INSERT INTO notes VALUES ('LA196',2,'According to a letter from Elizabeth Southcote of July 13 1622, there had initially been problems with securing Francis Parker\'s dowry. However, with this sorted, the community desires to recommend her for profession but need a dispensation because she is very sickly and their constitutions forbid them from proceeding in such a manner.');
INSERT INTO notes VALUES ('LC014',1,'Taken on the Somerset portion (see Wyke below). Protestant');
INSERT INTO notes VALUES ('LC015',1,'Her father followed the King in exile to the Low Countries. She had been a pensioner at Rouen, Couvent de la Visitation');
INSERT INTO notes VALUES ('LC017',1,'Cousin of Bishop Hornyold.  Also received a legacy from Dr Berington');
INSERT INTO notes VALUES ('LC018',1,'Hallett Chap 32 204; clothed at the Paris Augustinians, where she had been educated, but decided to leave because she felt that there was too much conversing with the secular world and, more importantly, she could not bear the music so returned to her parents in England. Her uncle, Fr Edmund Bedingfield, visited the family home and suggested convents in Flanders. ');
INSERT INTO notes VALUES ('LC019',1,'Sent to the Augustinian nuns at Paris with her sister, where she was a school pupil. Her vocation to the Lierre Carmelites was due to Fr Edmund Bedingfield, her uncle.');
INSERT INTO notes VALUES ('LC091',1,'Professed in Bruges; to Paris, rue Chapon in 1783; back to Bruges in 1792 and in 1794 to Lierre. ');
INSERT INTO notes VALUES ('BB179',1,'Daughter of Nicholas Tichborne, Sheriff of Hampshire before 1553 and his first wife Juliana Fenrother, daughter of Robert Fenrother of London.');
INSERT INTO notes VALUES ('LC029',1,'She was placed during her youth in a Dutch Convent in Antwerp. She made her profession as a Carmelite in Ypres, stayed 14 years and was then transferred to Lierre. See also De Gelder DSC09256, 9206, 9250, 9253, 9257, 9258, 9261, 9263, 9265, 9275, 9278');
INSERT INTO notes VALUES ('BA218',1,'Celebrated jubilee in Bruges 1795: III ann 185');
INSERT INTO notes VALUES ('LC038',1,'A pensioner in the Carmel in her youth (pm).');
INSERT INTO notes VALUES ('AC083',1,'She had been in England between 1634 and 1640 for medical reasons.\r\nMentioned in Hardman (1937), p.42.');
INSERT INTO notes VALUES ('LC043',1,'Protestant at birth: converted by her catholic mistress when she was a servant in London pm ');
INSERT INTO notes VALUES ('LC045',1,'Her mother was Mary Mostyn, daughter of Sir Pierce Mostyn 2nd bart, who was the nephew of Margaret and Ursula Mostyn');
INSERT INTO notes VALUES ('LC048',1,'Cousin of Fr Denitt, Provincial of the Jesuits');
INSERT INTO notes VALUES ('AC122',1,'Her father first sent her over to the English Benedictines at Ghent, believing that their order and manner of living would best agree with the constitution of her natural tenderness.\r\nMentioned in Hardman (1937), pp. 39.');
INSERT INTO notes VALUES ('LC056',1,'Aunt of Sister Catherine Giffard.  Portion shared. Hall Chap 34 215-');
INSERT INTO notes VALUES ('LC058',1,'converse nun, formerly a servant to the Donckers family in Antwerp, DSC09297 kdg ');
INSERT INTO notes VALUES ('LC062',1,'She was obliged to take service and being the eldest of her family she enter\'d Lady Petre\'s service in quality of under chamber maid. She became intimate with the family and joined them in a trip. She got small pox in Antwerp and was left in the Hospital. She was sent to Lierre for a change of air and boarded with a respectful surgean named De Baths, whose wife was English... Lives vol 2 p. 31 ');
INSERT INTO notes VALUES ('LC063',1,'Sent to Paris to be educated by the English Canonesses, then Ursulines; Hallett Chap 31 193-4 Her grandmother Mrs Petre, also her godmother who brought her up on the death of her mother. Went to Paris with her sister to be educated by the Augustinians. From there sent to the Ursulines to perfect her French.');
INSERT INTO notes VALUES ('LC078',1,'Educated by Augustinians in Bruges (pm) ');
INSERT INTO notes VALUES ('LC007',1,'Professed in Flemish convent; sent to France in 1780; moved back to Bruges in 1792 and to the English commnity in 1794.  ');
INSERT INTO notes VALUES ('LS008',1,'...joining first the English Sepulchrines but was not happy and could not learn Latin (...) she went back to England after a year and met there a Carmelite father who taught her to pray mentally and advised her to read good books and after a pilgrimage to Montaigu decided to join the Carmelites');
INSERT INTO notes VALUES ('LC082',1,'When she was travelling with her father from place to place, she at Sheffield in Yorkshire chanced to meet with a young woman (Miss Marchall) who formaly had been novice at Lier and speaking very advantageously of our community she conceived an earnest desire to become a member of the same... On her way to Lier, she travelled with Joseph Marchall who was joining the Dominicans at Bornem (pm) ');
INSERT INTO notes VALUES ('LC084',1,'Educated by the Canonesses of Bruges; she had many relations in the convent:  Her brother was confessor of the Poor Clares of Gravelines (pm)\r\nNo portion, but for good character and perfect Dutch taken into community 1660 benbk cb\r\n');
INSERT INTO notes VALUES ('LC092',1,'Professed the same time as Mary Somerset.  Her father, Henry Somerset, paid both the portions. Protestant at birth (pm)');
INSERT INTO notes VALUES ('BF131',1,'Sent to England to assist in setting up a seminary of young gentlewomen for the benefit of the convent at Nieuport. BC p23');
INSERT INTO notes VALUES ('LA231',1,'A scholar in Louvain before being clothed in Amesbury.Her surname is more usually written as Sherliker,from a known Recusant family in Lancashire:see CRS Occasional Paper 1 (1767 papist returns for the Diocese of Chester), pp. 46 and 47, where the name is spelled \'Shorlicar\' (p.46) and \'Shurlicar\' (p.47).  They lived at Formby, just north of Liverpool. (MW)');
INSERT INTO notes VALUES ('LA207',1,'Her mother was cousin to Sisters Bridget and Anne Gifford.');
INSERT INTO notes VALUES ('LA213',1,'She had tried to enter the convent before, but had been deemed unfit.');
INSERT INTO notes VALUES ('LA273',1,'Her father was cousin to Sister Anne Tremaine of the Louvain Augustinians.');
INSERT INTO notes VALUES ('LA274',1,'Her father was cousin to Sister Anne Tremaine of the Louvain Augustinians. Family tree gives her parents as Henry Tremayne and Mary Prideaux and her brother as Richard Tremayne married to Jane/Joan Coffyn.');
INSERT INTO notes VALUES ('LA269',1,'The earl of Portland paid paid for her clothing (CB 4).');
INSERT INTO notes VALUES ('LA303',1,'Her father was cousin to Sister Penelope Wiseman\'s father.');
INSERT INTO notes VALUES ('LA302',1,'Her father was cousin to Sister Penelope Wiseman\'s father.');
INSERT INTO notes VALUES ('LA304',1,'Her father was cousin to the father of Sisters Mary and Bridget Wiseman.');
INSERT INTO notes VALUES ('LA303',2,'Two of her sisters became Brigittines, whilst her mother was imprisoned for her faith.');
INSERT INTO notes VALUES ('LA302',2,'Two of her sisters became Brigittines, whilst her mother was imprisoned for her faith.');
INSERT INTO notes VALUES ('LA304',2,'She had a cataract operation in 1664.');
INSERT INTO notes VALUES ('LA307',1,'Her father had been godson to Sister Grace Babthorpe\'s husband.');
INSERT INTO notes VALUES ('GP267',1,'Her father was the cousin of Sister Mary Woolascott, an Augustinian at Louvain.');
INSERT INTO notes VALUES ('LA311',1,'She suffered from a stammer and had been a scholar in the convent.');
INSERT INTO notes VALUES ('LA296',1,'Her grandfather Richard Langley was martyred for his faith in 1586.');
INSERT INTO notes VALUES ('BA065',1,'She became melancolic and lived in a house in the garden carefully locked at night. She killed herself by throwing herself down a well in the garden.');
INSERT INTO notes VALUES ('BA079',1,'Ran away to the convent as a child.Arrived at the convent alone and when asked whether she was a Catholic, replied @I must be a Catholic, God will have me and you must hide me from Father and Mother that they may not find me out\'.(Annals III p190) The nuns decided to protect her. They sent her to a private school and at the age of 15 she requested to be admitted as a servant.  Remained at Bruges when the rest of the community came to England. Both parents Scottish and her father was a soldier in the English service. Sponsored by Lady Montague when her parents left Flanders: Annals II 124. Negotiated to separate from the community in Brussels in 1799 with an allowance of 20 louis d\'or for her maintenance: she lived in a private house. See III ann 171 & 193-4.');
INSERT INTO notes VALUES ('BA101',1,'Her mother was with the Jacobite court in exile, was governess to the future James III and companion to Mary of Modena. Brought to the convent by Lewis Sabrand SJ, Henrietta Maria\'s chaplain.');
INSERT INTO notes VALUES ('BA119',2,'Skilled at music and tried to simplify plainsong. Pupil at school.');
INSERT INTO notes VALUES ('BA122',2,'Boarder at Bruges school then spent 18 months with French Ursulines as a scholar.');
INSERT INTO notes VALUES ('BA070',1,'Arrived as convictress aged 12 in February 1749 (II ann 111). elected arcaria in 1787. Remained in Bruges to look after sisters remaining behind and the convent\'s property: was responsible from 1795 till her death. Negotiated with the authorities for the return of the buildings and contents.\r\n');
INSERT INTO notes VALUES ('BA079',2,'See Nuns of the Jerningham Letters (Rec Hist, May 1995) p357');
INSERT INTO notes VALUES ('BF013',1,'Died in 30th year of her profession. Possibly the same person as Anne Harper BF117, whose details closely mirror hers and was also a lay sister with the unusual name Anne Didacus. BF013\'s obit is given as 4 Apr 1696 aged 66 and of 30 years profession (BD: 200). This would accord with a birth date of c.1630 for BF013 and BF117. However, the clothing entry for BF117 lists her under 1654 (which gives a birth date c 1630), but the text says 1664, which would fit better with 30 years professed for BF013.');
INSERT INTO notes VALUES ('BF016',1,'Father was John Bacon of the Inner Temple; mother was Elizabeth Paynell, daughter of Henry Paynell of Belaugh.');
INSERT INTO notes VALUES ('BA072',1,'Lived for several years in the family of the duke of Powis. Lady Lucy sent for her from England.');
INSERT INTO notes VALUES ('BA074',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA073',1,'Pupil at school. Clothed privately because of Imperial edict requiring candidates to be 25 before profession: see ann II 226.');
INSERT INTO notes VALUES ('BA077',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA078',1,'Pupil at school with her sister Lucy. Described as of Irish parents born in the West Indies (Chron Bruges 2, 115, for Nov 1751, when she was aged 13).');
INSERT INTO notes VALUES ('BA080',1,'Pupil at school then went to Ursulines, Lille before joining the convent.');
INSERT INTO notes VALUES ('BA082',1,'Educated by the Poor Clares, Gravelines.');
INSERT INTO notes VALUES ('BA083',1,'Recommended by Miss Blundell of Ince.\r\n\r\nFormer convent servant.');
INSERT INTO notes VALUES ('BA085',1,'Maternal grandfather Sir Thomas Bond was controller of the household to Queen Henrietta Maria. In 1711 had to visit England to secure her portion: returned with her kinswoman Charlotte Bond who entered the convent: (Annals 294-5).');
INSERT INTO notes VALUES ('BA087',1,'A servant to Mrs Skyes.');
INSERT INTO notes VALUES ('BA088',1,'Her name is crossed in her profession enquiry. Did she leave or die? Unclear.');
INSERT INTO notes VALUES ('DB133',1,'Sent to assist in foundation at Ypres in 1682.');
INSERT INTO notes VALUES ('CB051',1,'Died as a novice.');
INSERT INTO notes VALUES ('BA092',1,'Two sisters postulant in 1692, received the scholar\'s habit but left in May 1693.');
INSERT INTO notes VALUES ('BA095',1,'Pupil at school from 1648.');
INSERT INTO notes VALUES ('BA097',1,'Recommended by Miss Blundell of Ince.');
INSERT INTO notes VALUES ('BA099',1,'Pupil at school. Left for a Dutch Augustinian convent in Brussels, 1710 27 Dec for reasons known only to the Vicars. Had to return to Bruges 1712 Dec as they would not keep her in Brussels.');
INSERT INTO notes VALUES ('BA102',1,'Did her novitiate with Theresians of Antwerp, but joined the Augustinians instead. (not listed there)');
INSERT INTO notes VALUES ('BA109',1,'Pupil at school: like Augustina Webster and Gonzaga Wharton was unsettled by the journeys and was required to spend another 6 months as a novice.');
INSERT INTO notes VALUES ('BA112',1,'Pupil at school: Jubilee 1745');
INSERT INTO notes VALUES ('BA113',1,'Pupil at school from 7 July 1722.\r\n\r\nSmall and deformed; several times Novice Mistress, her obituary in II ann 303-4, describes significant character defects.\r\nChosen Arcaria on death of Aunt Angela (1756)');
INSERT INTO notes VALUES ('BA114',1,'Pupil at school from 7 July 1722. In June 1737 sent to Spa for a cure because she had been spitting blood for a year. She returned in Oct not as well as had been hoped. It was decided she should not sing and should remain in the infirmary until the Spring. Made another journey to Spa in May 1739 in search of a cure with Sister Margaret Linny. They returned at the end of October with hopes of a cure.');
INSERT INTO notes VALUES ('BA116',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA117',1,'Pupil at school. Taught drawing to the pensioners at Hengrave to earn money for the community: III ann 78');
INSERT INTO notes VALUES ('BA118',1,'Pupil at school. Sent to Aix la Chapelle 1710  to take the waters in an attempt to cure her stone: Annals record a significant improvement.');
INSERT INTO notes VALUES ('BA121',1,'Pupil at school. Taught harpsichord to the pensioners at Hengrave to earn money for the community: III ann 78');
INSERT INTO notes VALUES ('BA125',1,'Pupil at school. Portion given by grandfather Sir Garret Kempe.');
INSERT INTO notes VALUES ('BA126',1,'Baptised 1676 14 Feb. Relation of  Alexander Keynes SJ.');
INSERT INTO notes VALUES ('BA129',1,'Pupil at school from 1 Dec 1720.Her father was dead and the family in distress. Her mother approached Lady Petre of Ingatestone who agreed to pay her expenses for 4 years: see Annals Vol I p377');
INSERT INTO notes VALUES ('BA130',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA134',2,'Pupil at school. Gave a painting \'Vierge au parfum de violettes\'.');
INSERT INTO notes VALUES ('BA135',2,'Pupil at school.');
INSERT INTO notes VALUES ('BA136',2,'Pupil at school.');
INSERT INTO notes VALUES ('BA137',2,'Pupil at school. Jubilarian 1737.');
INSERT INTO notes VALUES ('BA138',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA144',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA145',1,'Pupil at school. Jubilee 1803: however celebrations muted because of her ill-health: see III ann 239');
INSERT INTO notes VALUES ('BA151',1,'Both parents Protestant. Educated by Ursulines in St Omer. Converted by Rev Butler c. 1770');
INSERT INTO notes VALUES ('BA153',1,'Pupil at school. Sister Catherine also tried out, but did not persevere and left in 1667: see I ann 99, 103, 106.');
INSERT INTO notes VALUES ('BA156',1,'Pupil at school. In 1762 her young cousins Mary Anne (aged 12) and Teresa Greniers (aged 11), from Lisbon, were pupils at the school (II ann 155).');
INSERT INTO notes VALUES ('BA155',1,'Pupil at school. Musician: \'She was a perfect mistress at the\r\norgan which she had learned from 7 or 8 years old, and had so \r\nfine a hand that the greatest massters had a pleasure to hear \r\nher play (II ann 127).\r\n');
INSERT INTO notes VALUES ('BA158',1,'Pupil at school. Jubilarian 1797. Annals claim she was a branch of the same family as Cardinal Poole: see III ann 124. This was probably a mistake: see http://www.tim.ukpub.net/visitation/pooles.html');
INSERT INTO notes VALUES ('BA159',1,'Recommended by her aunt Mrs Lauronson, formerly serant to Lady Montague.');
INSERT INTO notes VALUES ('BA161',1,'Pupil at school. Jubilarian 1721 Had been sickly for many years');
INSERT INTO notes VALUES ('BA163',1,'Her mother was a fervent convert who resided a few years in Bruges.');
INSERT INTO notes VALUES ('BA166',1,'Pupil at school. Cousin of Margaret and Mary Barker.\r\n');
INSERT INTO notes VALUES ('BA167',1,'Pupil at school. Cousin of Margaret and Mary Barker.');
INSERT INTO notes VALUES ('BA171',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA175',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA176',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA177',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA178',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA185',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA182',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA184',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA186',1,'Pupil at school. Skilled in music, both singing and organ (II ann 88).');
INSERT INTO notes VALUES ('BA183',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA187',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA188',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA189',1,'Pupil at school.  She had been received a convictress on 30 June 1713 before returning to England on 24 June 1714.');
INSERT INTO notes VALUES ('BA190',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA193',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA191',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA194',1,'Pupil at school. Not able to learn Latin and chose to be lay sister at Bruges rather than find a convent which did not require Latin for choir nuns. Of substantial parents able to give her a [choir] nun\'s portion.');
INSERT INTO notes VALUES ('BA195',1,'Pupil at school. Also known under baptismal name of Dolly');
INSERT INTO notes VALUES ('BA196',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA197',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA201',1,'Not found fit to join the religious life.');
INSERT INTO notes VALUES ('BA208',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA212',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA211',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA216',1,'Pupil at school. In 1710, she was sent to Aix la Chapelle to take the waters in an attempt to cure her rheumatick humour: Annals I 284. She returned for a second season in 1711 (p290) and returned in much better health. The treatment cost 30.');
INSERT INTO notes VALUES ('BA215',1,'Pupil at school.');
INSERT INTO notes VALUES ('BA220',1,'Pupil at school. She told the nuns that she was very happy and wanted to profess. However when her brother arrived and spent time at the convent to learn about the religious life, she changed and became sullen. She discussed her situation with the Prioress who advised her to put off her habit and return to being a scholar until she should get permission from her parents for profession. This seemed to displease her and she decided to leave the convent with the person her parents sent for her never to return: see II ann 122-3');
INSERT INTO notes VALUES ('BA231',1,'annuities paid by earl of Worcester and Mr Swanson.');
INSERT INTO notes VALUES ('BD076',1,'Came to Dominicans after trying out Augustinians Bruges. She did not have enough dowry to join them.');
INSERT INTO notes VALUES ('BF063',1,'Half-aunt of BF057 and BF059, who were daughters of her half-brother.');
INSERT INTO notes VALUES ('BF057',1,'Half-niece of BF060, LS067 and BF063, who were half-sisters of her father.');
INSERT INTO notes VALUES ('BF059',1,'Half-neice of BF060, LS067 and BF063, who were half-sisters of her father.\r\nJubilarian 23 Sept 1792.');
INSERT INTO notes VALUES ('BF060',1,'Half-aunt of BF057 and BF059, daughters of her half-brother John. ');
INSERT INTO notes VALUES ('BF129',1,'The next known abbess took up her charge in 1830.');
INSERT INTO notes VALUES ('BF167',1,'Her father was eldest son of Sir Henry Moore 2nd bart and died before his father so did not inherit the title.');
INSERT INTO notes VALUES ('BF245',1,'Her obit reveals that she died a few days after her clothing from an illness she contracted during her journey to the convent. This may indicate that either the year of her clothing or of her death is wrong. ');
INSERT INTO notes VALUES ('GP302',1,'She went to the Poor Clares with her sister-in-law, Trevor Hanmer, as well as Ursula Skilton.');
INSERT INTO notes VALUES ('PC062',1,'note with Bridgettines: she went to England and professed with them in 1806 became Prioress and died in Lisbon 1831 14 Jan. See Fletcher lists.\r\nMovement confirmed in Intro to Conceptionists\' Diary xv');
INSERT INTO notes VALUES ('BA101',2,'Spent some time with the Benedictines, Pontoise before professing at Bruges.');
INSERT INTO notes VALUES ('GP034',1,'link with Winifred Thornton Bens Dunkirk for payment of portion.');
INSERT INTO notes VALUES ('GP109',1,'Probably sisters, Elizabeth, Mary and Rose Evelinge (GP109-111) all professed 1620-21 at slightly different ages. Grace Evele, perhaps Evel[ing]e was possibly a fourth.');
INSERT INTO notes VALUES ('LA301',2,'She had a disability.');
INSERT INTO notes VALUES ('LA308',1,'Her convent of Burnham, Essex, was suppressed in 1539. She took refuge in Louvain and became tutor of the two daughters of the Hellenist John Clement and  Margaret Giggs, step-daughter of Thomas More.  Mary Giggs\' daughter, Margaret Clement, became an Augustinian at Louvain.');
INSERT INTO notes VALUES ('LA169',3,'Said by the Chronicle to have been a kinswoman of the convent\'s benefactor Mr Thomas Worthington (brother-in-law of Helen Allen (LA003) and Catherine Allen (LA002).');
INSERT INTO notes VALUES ('BD020',2,'Mother was Grace Fowler, daughter of Edward Fowler of St Thomas.');
INSERT INTO notes VALUES ('BD020',3,'Related to the Draycotts and Giffards through her grandfather Edward Fowler, brother of Anne Draycott and Frances Giffard.');
INSERT INTO notes VALUES ('BD046',1,'Probably sister of Sarah (BD047). Death date supplied by J Chapman, PCC Hartpury, Gloucs, May 2011');
INSERT INTO notes VALUES ('BD047',1,'Probably sister of Elizabeth (BD046)and Mary (BF142).');
INSERT INTO notes VALUES ('BD049',1,'Her grandmother was secondly the first wife of Matthew Bedingfield of Redlingfield and by him mother of AC010, GB017 and GB108.');
INSERT INTO notes VALUES ('BA141',1,'Mother\'s surname supplied from records relating to her two sisters (see VCH Oxon 5, 15-30, s.v. Ambrosden). Her grandmother Helena Lacon, appears to have been first the wife of Walter Mildmay and secondly of Matthew Bedingfield and by him the mother of three nuns, AC010, GB017 and GB018.');
INSERT INTO notes VALUES ('BD050',1,'Her grandmother was secondly the first wife of Matthew Bedingfield of Redlingfield and by him mother of AC010, GB017 and GB108.');
INSERT INTO notes VALUES ('BD065',1,'Professed on deathbed.');
INSERT INTO notes VALUES ('LA235',2,'Her father was murdered in 1655.\r\n');
INSERT INTO notes VALUES ('AC101',1,'Her father was a poor labourer of the Marquis of Worcester: he paid her portion (benefactors\' book). She was educated by Lady Somerset, who brought her to Antwerp.\r\nMentioned in Hardman (1937), pp. 39.');
INSERT INTO notes VALUES ('LC093',1,'An alternative death date is given as 1789 6 Mar.');
INSERT INTO notes VALUES ('AC036',1,'No further details available.');
INSERT INTO notes VALUES ('GP003',1,'Chose to be lay sister Order of St Francis out of humility: professed in that capacity 1611 2 Jul. chr 33.\r\nGrand-daughter of John Gage co-founder of convent: CRS p55');
INSERT INTO notes VALUES ('GP050',1,'Cousin german of Mary Gough chr 69');
INSERT INTO notes VALUES ('GP026',1,'Gravelines chr gives death as 1704: chr 226');
