INSERT INTO notes VALUES ('MW171',1,'One of the closest of Mary Ward\'s companions: frequently acted as her secretary. Travelled to Italy in 1623 with Mary and Barbara Ward and assisted in the foundation of the Naples house in 1623. Considered a very reliable subordinate but lacked leadership qualities. She travelled north in 1627-8 and met Mary Ward again in Munich in the Autumn of 1628. Although Mary Ward was very ill, she journeyed to Rome taking with her Winefrid Wigmore and Elizabeth Cotton. ');
INSERT INTO notes VALUES ('GP289',1,'There are major conflicts in the various accounts of this family with the details of parentage given here. Looking at the details provided by Stirnet, one possibility is that she was daughter of Mary Widdrington (b.c. 1632, d. 1703), daughter of Sir Edward Widdrington of Cartington (d. 1671) and wife of Sir Edward Charleton of Hesleyside (d. 1674/5) (who were parents of four daughters, Mary, Catherine, Elizabeth and Christian, who married, according to the Register of the Estates of Roman Catholics in Northumberland in the 18th Century, p.3). The same source mentions the Will of Sir Edward Widdrington 1st bart of of Cartington\'s wife Christian Stuart, proved in 1684. Edward died without male issue and in her Will Christian mentions her daughters Mary Charlton and Catherine Hammond. However, Skeet, Life of Sir Edward Widdrington,p139, credits him with two wives. Burke\'s Extinct Peerage,p. 564, gives him a wife who was daughter of a Charlton of Hesleyside, assigning Mary wife of Sir Edward Charlton to the marriage (their daughter also marriage a Charlton cousin). Whoever Mary Charlton\'s mother was, Skeet and Burke between them would account for the data given for this nun, GP289. Further investigation is required but provisionally it would be reasonable to assume a brief first marriage for Sir Edward to a Charlton, before his subsequent much longer union with Christian Stuart. This would mean she was half-sister of Catherine LA036 and (half) great-aunt of Catherine Talbot HC061. KKR');
INSERT INTO notes VALUES ('PA192',1,'According to Stirnet (& family history) she was daughter of William Widdrington, 3rd Lord of Blankney (d. 1694/5) and Alathea Fairfax. Hence aunt of CB202 and niece of CB204, GP290 and OB143.');
INSERT INTO notes VALUES ('DB194',1,'Daughter of a junior line of Yate of Lyford. Her father, a known Papist then dead, was father of a son and heir Charles also dead in in 1715, when one of his sisters was a nun at Dunkirk and the other married to William Dunn, who had taken over the estate (Records of the Catholic non-jurors of 1715, p. 354-5). The same source shows that Ralph Piggott of Clements Inn deposed that he saw Winifred Yate execute deeds at a  religious house in Dunkirk and that she was then in the habit of a nun (18 Dec 1717, p. 357).');
INSERT INTO notes VALUES ('BA072',4,'On 11 Feb 1720, Lady Charlotte Herbert, niece to Lucy Herbert, was placed under her care when returning to England.  However, the two were forced to return to the convent on 14 Feb because of bad storms at sea.  The journey was again attempted on 28 April 1720, Barbara Devery returning on 23 June with a recent convert, Rebecca Severn, who was interested in the religious life.  She  subsequently entered the Ghent Benedictines, Devery conducting her, leaving the Bruges Augustinians on 21 July 1720.');
