INSERT INTO notes VALUES ('PB038',1,'Her father was a royalist during the civil war and suffered much for his Catholic faith.  Following her mother\'s death, she was brought up by an aunt before entering service to several gentlewomen, the last being Alathea Fairfax, daughter to Charles Fairfax, 5th visc of Elmley, who inspired her vocation along with the 5th visc Fairfax\'s wife, Abigail Yates.  These two women paid part of her portion (ob 372-6).  Alathea Fairfax later married William Widdrington, 3rd lord of Blankney, three of whose sisters were nuns: Dorothy with the Cambrai Benedictines, Jane with the Gravelines Poor Clares and Elizabeth with the Pontoise Benedictines.');
