INSERT INTO notes VALUES ('LA059',2,'Had 9 children: one of these was William Clifford (d1670), who after education and ordination at Douai,went on the English mission. Attached to the English College, Lisbon, and became superior of Tournay College (Paris), assigned by Cardinal Richelieu to the English clergy. Writer and theologian.');
