INSERT INTO notes VALUES ('BB181',1,'Named in the Will of her father, dated 1619 (he died 1626), Lichfield Record Office, Catalogue Index B/C/11 (available at http://www.oxford-shakespeare.com/, accessed 26/2/2011), who left her one thousand pounds. Also named in the Will of her aunt and godmother Elizabeth de Vere (d. by February 1613)), widow of the 17th earl of Oxford, TNA PROB 11/121,to whom she left a red enamelled jewel set with diamonds.');
INSERT INTO notes VALUES ('AC120',1,'Named in the Will of her father (d. 1626), Lichfield Record Office, Catalogue Index B/C/11 (available at http://www.oxford-shakespeare.com/, accessed 26/2/2011), who left her five hundred pounds. Also named in the Will of her aunt Elizabeth de Vere (d. by February 1613)), widow of the 17th earl of Oxford, TNA PROB 11/121,who hoped to educate and train her up (for service at court) and who left her five hundred pounds towards a marriage portion.');
INSERT INTO notes VALUES ('GP110',1,'Probably sisters, Elizabeth, Mary and Rose Evelinge (GP109-111) all professed 1620-21 at slightly different ages. Grace Evele, perhaps Evel[ing]e was possibly a fourth.');
INSERT INTO notes VALUES ('GP111',1,'Probably sisters, Elizabeth, Mary and Rose Evelinge (GP109-111) all professed 1620-21 at slightly different ages. Grace Evele, perhaps Evel[ing]e was possibly a fourth.');
INSERT INTO notes VALUES ('GP108',1,'Likely to have been another Evel[ing]e, perhaps one of four close relatives, probably, sisters who became Poor Clares during 1620-21.');
INSERT INTO notes VALUES ('PC002',1,'A skilled watchmaker. Became temporarily insane during 1704 and was cared for by her sister.');
INSERT INTO notes VALUES ('PC003',1,'Skilled at studding the cases for the watches made by her sister.');
INSERT INTO notes VALUES ('PC005',1,'Elected second mistress of the scholars in 1789. Mason (1998) pp96-7 records that she left the community on its release from prison in 1795 and returned to England to live. By 1800 she was living with Lord Petre at: rejoined the community in the Autumn of 1800. ');
INSERT INTO notes VALUES ('GP303',1,'_The life of the lady Warner of Parham in Suffolk, in religion call\'d Sister Clare of Jesus_, by Scarisbricke, Edward, 1691, Thos Hales, London ');
INSERT INTO notes VALUES ('PC014',1,'Temporarily insane during 1731.');
INSERT INTO notes VALUES ('PC027',1,'Mason (1998) pp96-7 records that she left the community on its release from prison in 1795 and returned to England to live. By 1800 she was living with Lord Petre at: rejoined the community in the Autumn of 1800. She claimed the Diary from the Dowager Lady Jerningham about 1816. ');
INSERT INTO notes VALUES ('PC029',1,'Permitted to take the waters at Bourbon for health reasons in 1698.');
INSERT INTO notes VALUES ('BF091',1,'After her mother\'s death her father became a Carthusian in the English monastery at Nieuport, where he died 1631. He was present when she took the veil from Ven. Arthur Francis Bell.');
INSERT INTO notes VALUES ('BF091',2,'Was part of the founding party of the Conceptionist convent, Paris: see BC p15 and Conceptionist Diary, intro viii. She accompanied abbess to England on business in 1665. She was greatly mourned at her death still in office as vicaress in 1674.\r\n\r\nAccording to bib dict she was sister or near relation of John Lloyd the Welsh priest martyred in July 1679. Dorothy Floyd was also a relation.');
INSERT INTO notes VALUES ('PC040',1,'Several times elected abbess, served from 1767-1773, 1779-88, and 1791-97. Was Novice Mistress in 1790');
INSERT INTO notes VALUES ('PC040',2,'Had been educated in the convent school.');
INSERT INTO notes VALUES ('PC045',1,'Abbess first from June 1686 to 1689; again from 1692 to 1695; 1704-1711. She  was appointed to govern in the absence of the abbess and was acting abbess at her death in 1719.');
INSERT INTO notes VALUES ('PC046',1,'Subject of a brief and affectionate obituary note by her confessor Rev Henry Browne, who said that she had died in the office of Infirmarian. This does not appear in the Diary, which gives very sketchy details of the elections of 1677, which must have been the year she was elected. If she had been re-elected the start date would be 1674, for which details are equally sketchy (Ann 24, 27).');
INSERT INTO notes VALUES ('PC049',1,'She began the Diary account and kept the records.\r\nHer nephew left her a considerable sum in 1717 but the nuns had great difficulty obtaining the money.');
INSERT INTO notes VALUES ('PC051',2,'Died in the confessor\'s apartment when they were imprisoned and buried at the Abbaye St Antoine: see Margaret Mason, The Blue Nuns in Norwich 1800-1805, Recusant History, No 24, 1998-9 104');
INSERT INTO notes VALUES ('PC052',1,'Apparently daughter of Caryll Hawarden of Upton Hall, in Widness-cum-Appleton, Lancs, and Catherine Crosby. Three of four of her brothers were educated at Douai College (Ann 365).');
INSERT INTO notes VALUES ('PC087',1,'From prolific and very committed family of Poultons of Desborough. She used the alias of Jackson at her admittance. Nothing is known of her after her dismissal.');
INSERT INTO notes VALUES ('PC056',1,'Footnotes in the Conceptionist Diary claim Monica and Margaret as sisters of Anne Ursula: however the dates for entry and profession in conventual sources from Cambrai do not agree with the dates given in the notes. Anne Ursula was in fact their niece, daughter their brother John and his wife, as is shown in the pedigree in \'Parish of Heighington\', in The History and Antiquities of the County Palatine of Durham: volume 3: Stockton and Darlington wards (1823), pp. 303-324. URL: http://www.british-history.ac.uk/report.aspx?compid=76362&strquery=walworth castle jenison Date accessed: 06 April 2011.');
INSERT INTO notes VALUES ('PC061',1,'Described as \'dispenciere\' for election of 1760.');
INSERT INTO notes VALUES ('PC064',1,'Educated in the convent school, sent and paid for by Mary Blount, Duchess of Norfolk, who did much to patronize the school.  Her uncle, William 16th lord Stourton, married Winifred Howard, niece of Edward Howard, 9th duke of Norfolk and his wife, the said Mary Blount.');
INSERT INTO notes VALUES ('PC064',2,'Dowager Lady Petre paid her dowry: see p113. Died of smallpox: see p133');
INSERT INTO notes VALUES ('PC081',1,'See Ann 395 for possible identification with Frances Maria, only daughter of Captain Peter Osborne (son of John, 2nd Bart of Chicksand Priory).');
INSERT INTO notes VALUES ('PC066',1,'Her own title Lady Frances Lee');
INSERT INTO notes VALUES ('PC070',1,'Educated by Augustinians at Bruges: First mistress of the school 1757. Father\'s occupation and place of origin given in Bruges Annals.');
INSERT INTO notes VALUES ('PC079',1,'Ann 392 says she had been a novice at the Benedictine Convent in Paris. P152 reports that her health and other talents did not match her references and she was only accepted by one third of the community.');
INSERT INTO notes VALUES ('PC124',1,'Buried next to her sister Catherine, who died as a pensioner of the convent in 1717 (Ann. 433).');
INSERT INTO notes VALUES ('PC092',1,'Came to be a choir sister but was found better suited to state of laysister.');
INSERT INTO notes VALUES ('PC100',1,'Elected Refectarian in 1792. Living in Wolverhampton in 1816: see Mason 1998 p118.');
INSERT INTO notes VALUES ('BF228',1,'Letter to Charles Eyston at Hendred dated Nov 19 1694 refers to \'the new Abbess\'.\r\nQuery on mother: although it is taken directly from nuns\' sources, other pedigrees give other names.');
INSERT INTO notes VALUES ('BF229',1,'Outstandingly skilled in music: BC p37 \'she hath a most delicat Voice, and Excellent skill to teach, for which reasons we took er to help our quire, at the age of 16\'. Examination gives father\'s origin as Lancashire.');
INSERT INTO notes VALUES ('BF171',1,'Musically gifted. Choir mistress for 18 years. Grate sister 1728 (BC : 65).');
INSERT INTO notes VALUES ('LS098',1,'Makes numerous appearances in the nuns\' Benfactors Book (p35, 42-5, 47, 49, 51-2, 57).');
INSERT INTO notes VALUES ('LS070',1,'Occurs under name Freeman in the Lige documents.');
INSERT INTO notes VALUES ('BF068',1,'Chief organist for 25 years.');
INSERT INTO notes VALUES ('BF070',1,'Musician in her youth and played the violin in the High Choir: see BD p232.\r\nJubilarian 2 July 1777.');
INSERT INTO notes VALUES ('BF221',1,'Organist for many years.');
INSERT INTO notes VALUES ('BF263',1,'Chief support of choir (which she accompanied self-taught on the viol) for many years.');
INSERT INTO notes VALUES ('BF188',1,'Chief organist for many years. Six years mistress of the school.');
INSERT INTO notes VALUES ('BF215',1,'Excellent organist.');
INSERT INTO notes VALUES ('GP091',1,'Several years dispencer from 1629 at Aire.');
INSERT INTO notes VALUES ('RP208',1,'According to the Chronicle had served as thourier for 12 years outside the enclosure before she was clothed as a nun.');
INSERT INTO notes VALUES ('GP023',2,'Apothecary for 20 years; pb 83');
INSERT INTO notes VALUES ('GP238',1,'Alo dispencer.');
INSERT INTO notes VALUES ('GP208',1,'Her (half) aunts were the issue of her grandmother\'s first marriage.');
INSERT INTO notes VALUES ('GP058',1,'Also dispencer, depository: Jubilarian');
INSERT INTO notes VALUES ('PC102',1,'Probably daughter of Richard Singleton of Shingle Hall in Whittingham, Lancs (Ann 412), and aunt of Bridget.');
INSERT INTO notes VALUES ('PC101',1,'Probably niece of Elizabeth (Ann 412).');
INSERT INTO notes VALUES ('PC103',1,'For father see Ann 413. reputed to be natural daughter of Sir Thomas Pope.');
INSERT INTO notes VALUES ('PC113',2,'Lucy Talbot specified that having paid her dowry of 400 from the rest a charity should be established to provide a dowry for one or two girls at 400 each plus 50 for expenses. The money should be used as the convent saw fit to make up incomplete dowries or pay the whole sum for two girls without. Particularly wanted to help Sister Bernard Green whose brother had failed to supply the whole sum promised for her. See Diary 130-1');
INSERT INTO notes VALUES ('BB108',1,'Stirnet genealogy suggests that this Joyce was the youngest daughter of William Langdale of Easthorpe and Lanthorpe (b.c. 1578) and his first wife Elizabeth Constable of Everingham (d. 1624).');
INSERT INTO notes VALUES ('DP082',1,'Perhaps the daughter Bridget of Marmaduke Langdale 2nd lord of Holme (d. 1703) and Elizabeth Savage.');
INSERT INTO notes VALUES ('GP232',1,'7 daus listed as unmarried in family tree Ellis Genealogy ... 1302 m. 16');
INSERT INTO notes VALUES ('PA179',5,'Her patron was St Paul.');
INSERT INTO notes VALUES ('CB114',1,'Her widowed grandmother retired to the convent in 1693 her two granddaughters, Dorothy aged 16, and Joan aged 14, a pensioner who afterwards left.');
INSERT INTO notes VALUES ('OB111',1,'Three sisters schooled by the Pontoise Benedictines, Mary Anne, Clare and Rachel: Paris ob 398.');
INSERT INTO notes VALUES ('OB111',2,'After the dissolution of the Pontoise convent, she joined the Liege Sepulchrines for a few months before the Paris Benedictines.');
INSERT INTO notes VALUES ('PB076',1,'? parents');
INSERT INTO notes VALUES ('LA193',1,'Scottish: father an officer in French army according to examinations. Had been brought up at the convent since the age of six and a half and was considered as daughter of the convent. Must be sister of Henrietta Ogilvy.');
INSERT INTO notes VALUES ('PB074',1,'? parents');
INSERT INTO notes VALUES ('BB113',1,'She subsequently founded the Carmelite convent at Antwerp. See ODNB entry.');
INSERT INTO notes VALUES ('PB088',1,'Died whilst still a postulant.');
