INSERT INTO notes VALUES ('BF095',1,'Her mother was arrested at the house of Anne Line c.1600 during a Mass at the Jesuit safe-house. (Gillow, Bio Dic 4, 250)');
INSERT INTO notes VALUES ('BF095',2,'Her half-brother, Fr Francis Gage, is thought to have edited \'The Spiritual Exercises of Gertrude More\', a Benedictine nun at Cambrai, published at Paris in 1658, though the attribution is not certain. (ODNB)');
INSERT INTO notes VALUES ('BF095',3,'Her brother, Sir Henry Gage, was killed during the English Civil War.');
INSERT INTO notes VALUES ('LA071',1,'Her father was involved in the Bye Plot. (ODNB)');
INSERT INTO notes VALUES ('BF095',4,'Her uncle was the apostate priest, John Copley. (ODNB John Copley)');
