INSERT INTO notes VALUES ('DB047',1,'She was the secretary in 1685.');
INSERT INTO notes VALUES ('PC107',1,'Sent to convent at Hammersmith in 1725 and then to school with Poor Clares, Rouen: see CRS vol p414.');
INSERT INTO notes VALUES ('PC111',1,'Described as being of very small capacity, full of halucinations, and very weak both in body and mind: see CRS vol p417.');
INSERT INTO notes VALUES ('DB048',1,'She was a lay sister through humility. No other details known');
INSERT INTO notes VALUES ('PC120',1,'Only French choir member of the community: CRS vol p428. Given permission to move to Rouen being unhappy with the community in Paris: see Diary p58.');
INSERT INTO notes VALUES ('PC121',1,'Her father was probably John Vinn of Otterbourne, co Southampton. CRS vol p429');
INSERT INTO notes VALUES ('PC123',1,'Spent noviceship in England where it was intended that she should bring up scholars for the convent: see CRS vol p431.');
INSERT INTO notes VALUES ('MW058',1,'Registered as an early member of the York community.  Returned to Munich in 1699 but was sent to make visitations at Hammersmith and York in 1713.');
INSERT INTO notes VALUES ('DB055',1,'Her father was an apothecary and she was skilled at making medicines.');
INSERT INTO notes VALUES ('PC130',1,'Probably from Yaxley Hall, Suffolk: see CRS vol p440.');
INSERT INTO notes VALUES ('OB002',1,'Her father was an Irish banker with operations in London and Paris.');
INSERT INTO notes VALUES ('LC006',2,'According to Conceptionists CRS Vol p323 went to school at Conceptionists Paris before becoming Carmelite.');
INSERT INTO notes VALUES ('DB060',1,'She was a fine musician.');
INSERT INTO notes VALUES ('CB069',1,'She subsequently married Thomas Barnesfield of Wolverhampton.');
