INSERT INTO notes VALUES ('DB088',1,'Her profession was delayed by non-payment of her dowry.');
INSERT INTO notes VALUES ('BB140',2,'Received four nuns from Montargis when they had to leave their convent (2 English and 2 Belgians see p84): History Princethorpe Priory p90. ');
INSERT INTO notes VALUES ('OB053',1,'Her father was cousin to Clare and Mary Blundell of the Rouen Poor Clares, Alice Blundell of the Gravelines Poor Clares and Joan Selby of the Lige Sepulchrines.');
INSERT INTO notes VALUES ('OB051',1,'Her father was cousin to Clare and Mary Blundell of the Rouen Poor Clares, Alice Blundell of the Gravelines Poor Clares and Joan Selby of the Liege Sepulchrines.');
