INSERT INTO notes VALUES ('GP146',1,'The data relating to parents is derived from Raine, History of North Durham, pp224-5 which corrects the fn in CRS Vol pp150-1.');
INSERT INTO notes VALUES ('PA002',1,'Father was cousin to Dorothy, Ann, Elizabeth and Mary Anderton, and Ellen, Ann and Elizabeth Bradshaigh, and Elizabeth Tildesley, all nuns at the Gravelines Poor Clares.');
INSERT INTO notes VALUES ('DB043',2,'Arrived at the age of 8 as a schoolgirl.\r\nFather described as of Canterbury, Kent');
INSERT INTO notes VALUES ('GB040',3,'Bonvarlet 165 cites another text dedicated to Mary Caryll \'Devotions to St Francis Xavier\' Ghent Annals 42 explains this was the result of the miraculous cure from cancer effected by a novena to him in 1669.');
INSERT INTO notes VALUES ('PA169',2,'She suffered from poor health and had been touched for the King\'s Evil at Saint-Germain in 1704 by the Pretender.  She devised antiphonal menumonics in her psalter, which is now held at Coughton. (Throckmortons, pp. 190-1)');
INSERT INTO notes VALUES ('GP170',1,'ref to Jump family in CRS vol vi p101');
INSERT INTO notes VALUES ('AC077',1,'Her brothers were Revs John and George Keynes SJ, both in ODNB.');
INSERT INTO notes VALUES ('GB140',3,'In 1687 sent to begin a new house in Dublin, which soon failed. Later spent a brief spell at Ypres (1700-1702), where she professed several nuns.');
INSERT INTO notes VALUES ('GP260',1,'According to the Fortescue website Mary Fortescue was married to John Talbot not Gilbert as in CRS p118.');
INSERT INTO notes VALUES ('OB019',1,'Source gives arrival at Ypres as 1682 or 1683.');
INSERT INTO notes VALUES ('PB040',1,'Was a Protestant, employed as a stage player or actor at court of Charles II at the time of her conversion.');
INSERT INTO notes VALUES ('BA140',1,'Father wrote Diary pub. CRS 1956. First Prioress to be elected for three year term. Educated by the Mary Ward Institute school at Hammersmith with her sisters.');
INSERT INTO notes VALUES ('OB057',1,'Sent to Paris convent for recovery from dropsy by Right Honourable the Lord Abbott Corker, her near relation.');
INSERT INTO notes VALUES ('OB093',1,'The convent had problems obtaining the promised dowry payment: the account book records the payment of more than 49 to lawyers for their attempts to chase up payments.');
INSERT INTO notes VALUES ('AP028',1,'educated Cambrai with her sister: see CRS Coghlan p79');
INSERT INTO notes VALUES ('BB058',2,'Prioress for ten years before onset of her final illness; continued in office until death.');
INSERT INTO notes VALUES ('CB161',1,'Professed on her deathbed.');
INSERT INTO notes VALUES ('GP222',1,'Member of Pigott family who were Catholic conveyancers.');
INSERT INTO notes VALUES ('DP092',2,'Peter Maire confessor to nuns at York');
INSERT INTO notes VALUES ('CB149',1,'Transcribed Grace More\'s translation of \'A Treatise of the Ruin of Poper Love\'.');
INSERT INTO notes VALUES ('GP247',1,'Probably sister of ELizabeth Seacome.');
INSERT INTO notes VALUES ('GP248',1,'Probably sister of Hanna Seacome.');
INSERT INTO notes VALUES ('BF272',1,'Subsequently the wife of Robert Hornyold of Blackmore Park (b.c. 1658, died 1712) (Stirnet).\r\n\'Very ladudably performed her year of probation, but being very sickly was forced to return to England for her health\': see BC p38');
INSERT INTO notes VALUES ('GP083',2,'Mother taken from Foster, Visitation Pedigrees, Northd., p32');
