INSERT INTO notes VALUES ('GB109',1,'Parents from Stirnet: alternative mother given in Pedigree of Ingleby as Jane Lambert of Killinghall, Yorks. gives father as steward for Henry Percy, 9th earl of Northumberland.See Pedigrees of County Families of Yorkshire.');
INSERT INTO notes VALUES ('BB100',2,'parents stirnet: mother dau 6th earl westmorland');
INSERT INTO notes VALUES ('RP001',2,'She taught at the school.');
INSERT INTO notes VALUES ('RP055',1,'Acted as convent scrivener for fifty years and translated documents.');
INSERT INTO notes VALUES ('RP009',1,'She was \'weak of head\' so could not enter the religious life but the sisters agreed to let her remain as a pensioner for life.  When she died, she was buried in the same habit as the nuns, with the same prayers said.  She was sent to the convent by her aunt, \'Lady Burlacy\', a Catholic convert.');
INSERT INTO notes VALUES ('RP002',3,'Had been brought up in the convent from the age of 11 or 12, entering on 1645 20 Sep, her father paying a 20 a year pension in support.  After four or five years, she was moved to another convent before going to England, eventually returning to become a nun after an unsuitable admirer started to court her. He even turned up at the convent in 1662 claiming she was his wife.');
INSERT INTO notes VALUES ('PA062',1,'Parents supplied from family tree (MQ) and from Stirnet');
INSERT INTO notes VALUES ('LC051',2,'sisters Hoogstraten');
INSERT INTO notes VALUES ('RP011',1,'She was brought from Ireland by her uncle, Fr Netterville.');
INSERT INTO notes VALUES ('RP011',2,'Followed her vocation dutifully until Sister Clare Ludovic Tuite, also from Ireland, arrived at the convent following the break up of her one at Dieppe.  She greatly unsettled Sister Bridget with talk of Ireland, resulting in Sister Bridget becoming lax in her observance.  Thus, on 1685 31 Mar after 19 years professed, she went to live with her brother in Dublin.  After her uncle, Fr Neutrevill was imprisoned following the Glorious Revolution, she went about the streets begging food for him.  A few years later, she grew ill and entered a religious house in Ireland, having written to the Poor Clares at Rouen to mend their relationship and begging for books, beads and medals.');
INSERT INTO notes VALUES ('RP011',3,'Bonaventure Giffard, the future vicar apostolic of London, made great efforts to reconcile her to her vocation during his visit to the convent.');
INSERT INTO notes VALUES ('CB175',1,'Professed on her deathbed. Illegitimate daughter of an English baronet and lived with the family; sent to the convent when the eldest son of the family fell in love with her. Took to religion and lived very edifyingly. Died as a result of an accident: see crs 74-5.');
INSERT INTO notes VALUES ('GB062',1,'Her sister Mary tried out at Ghent, receiving the scholar\'s habit before returning home to Hassop. She later married a Blundell: see Rec Hist Vol 8 1955-6 p56.');
