INSERT INTO notes VALUES ('LA025',2,' This Mary does not occur amongst the issue recorded in Bedingfield Memorials for the alleged parentage, which seems doubtful on chronological grounds since this one was born about 1641. More likely is that she was the Mary, younger daughter of Edmund Bedingfield of Kirby Bedon and Elizabeth Tasburgh (Memorials, Table B), who was living on 19 July 1654 (before the entry of this nun into religion), and whose elder sister was born in 1633. Mary was said to have been 30 at her death in 1671, which may mean that her mother, whose death is given in Memorials op cit as 11 Feb 1640, died in childbirth. This Mary is said by the Chronicle of St Monica\'s Louvain to have been niece of Agnes Tasburgh, who was daughter of Sir John and his wife Lettice Cressie; her sister Elizabeth was wife of Edmund Bedingfield of Kirby Bedon. Edmund was cousin of Sir Henry Bedingfield of Oxburgh \'the Cavalier\'.');
