INSERT INTO notes VALUES ('BA147',1,'Brought to convent by Lady Mary Caryll dau Ly Seaforth. Tayler, p15. Forced to return by her Protestant parents, it was another six years before, disguised under the name Smith, she made her way back to the convent, where two years later she was clothed. In September 1742 her sister Mary arrived at the convent at her invitation. She returned home a few weeks later having been received into the Catholic church. (I and II ann).');
