INSERT INTO notes VALUES ('CB161',2,'There is a problem with her parentage. The Cambrai source does not name her parents or indicate any relationship with a Mary Roper who was briefly at the convent in May 1648 aged 14, Cambrai crs p47. Gillow supplies her father as Anthony Roper of Eltham (Well Hall), asserting that she was sister of the aforementioned Mary and says she was fourth cousin of Christopher 4th Lord Teynham. The problem with this is that the daughters Mary and Elizabeth of Anthony of Well Hall, by two different marriages, are well attested as Franciscans. The four women were certainly close contemparies and may well have been closely related, but on the evidence of the Cambrai text nothing definitive can be said of the parentage of CB161 at present.');
