INSERT INTO notes VALUES ('MW088',1,'Clothed with the Benedictines at Woolton (formerly Cambrai) on 1805 15 Jan, professed there 1806 8 Sep (Birt 1913, p234).');
INSERT INTO notes VALUES ('MW017',2,'Accompanied Mary Ward to London in 1639, to Hutton Rudby, Yorks, in 1642 and Heworth, just outside York, in 1644.  She probably then went with the community to Paris in 1650, then Munich, before being sent to Hammersmith in 1669 with Mary Portington, Isabella Layton and Christina Hastings. Credited with the foundation of the Hammersmith Community and school. In 1686 founded the Bar Convent in York.  She returned to Munich in 1699 where she was made Superior.');
INSERT INTO notes VALUES ('MW017',3,'She was arrested three times: London 1674; York 1679; York 1694. Used the alias of \'Long\'.');
INSERT INTO notes VALUES ('MW100',1,'Assisted in the foundation of a house at Augsburg in 1662 and in 1669 went with Frances Bedingfield to Hammersmith and then to York.Involved with fund-raising.  In 1699 she was recalled to Munich.');
INSERT INTO notes VALUES ('MW154',1,'Had attended the Institute\'s school in Paris and was certainly there in 1653 before travelling to Munich with Mary Poyntz. Helen Thwing and three other Paris girls entered in Munich. She was one of the five that settled at Dolebank, Yorks, on 1677 29 Sep and in 1678 seems to have been in charge of the house at Heworth Manor.');
INSERT INTO notes VALUES ('MW154',2,'She was at the house in York when her brother, Fr Thomas Thwing, was martyred in the same city on 1678 23 Oct.');
INSERT INTO notes VALUES ('LB156',1,'Stirnet has Constance Blount married to Sir Thomas Tyrell of Heron Hall');
INSERT INTO notes VALUES ('BB099',1,'Likely to be daughter of Anthony Hyde of Woodhouse and his wife Mary James, daughter of Sir Henry James of Smarden, Kent. A daughter Anne figures amongst their issue, which included a son James born c 1634 and a daughter Frances born c 1630 (Stirnet)');
