INSERT INTO notes VALUES ('MW017',4,'Rouen Chronicle I p62 records Frances Bedingfield as a procurer of alms for the Rouen convent after she entreated Father Monaco to visit her sister Margaret who was Vicaress at Rouen.');
INSERT INTO notes VALUES ('MW153',1,'She came from Germany to found the Dolebank community in 1677.  She was arrested in 1678 and not released until 1685. She was almost certainly a founder member of the bar Convent in 1686. She was at the house in York when her brother, Fr Thomas Thwing, was martyred in the same city on 1678 23 Oct.\r\n');
