INSERT INTO notes VALUES ('MW152',3,'Sent from Germany to to assist in foundation at Dolebank, 1677 29 Sep.');
INSERT INTO notes VALUES ('LS042',1,'Charlotte is not mentioned by Macgrath, 1960 (p15)for these parents who have 3 daus born in 1750s. Hugh and Lady Ann Lee married Dec 1749. This raises questions re the data provided by the Chapter Book.\r\nNB Charlotte does appear in Cliffordiana p51 born one year after the youngest son. This version of the family is supported by Mason 1996 p35');
INSERT INTO notes VALUES ('BF144',1,'Ref to Knight family of Cannington in MacGrath 1960 p10.');
INSERT INTO notes VALUES ('LS040',1,'Mother\'s property also spelled Terndriech');
INSERT INTO notes VALUES ('BF210',1,'MacGrath 1960 p22 explains that John Rowe son of Austin in 1788 inherited Marnhull, Dorset from his uncle Giles Hussey on condition he changed his name to Hussey and went to live there. He sold Beaston.');
INSERT INTO notes VALUES ('MW031',1,'She was one of the five sent from Germany to settle at Dolebank, Yorks, on 1677 29 Sep.');
INSERT INTO notes VALUES ('MW133',1,'She was one of the five sent from Germany to settle at Dolebank, Yorks, on 1677 29 Sep.');
INSERT INTO notes VALUES ('MW081',1,'According to biog dict 2nd edn. she was daughter of Henry Anderton, a small landowner, and was born in Ashby, Leicestershire. She used the alias Hastings, and occasionally used the alias Cornwallis, being distantly related to Cecily Cornwallis. Recent convent research has given her date of death as 1717 rather than 1711 as it appears in this source.');
INSERT INTO notes VALUES ('MW081',2,'Educated at Munich. She was sent to Augsburg as a pupil in 1662 and entered the community there before travelling to London in 1669 with Frances Bedingfield and to Dolebank in May 1678.  ');
INSERT INTO notes VALUES ('PB038',2,'MacGrath 1960 p32 has some Hanne connections with Lanherne. Charles Hanne joined Jesuits.');
INSERT INTO notes VALUES ('MW081',3,'In 1678 she was arrested and committed to York Castle, becoming an out-prisoner before being granted full release in 1685. She was probably a founder member of the Bar Convent in 1686. She returned to Augsburg in 1699. (CK-B)');
INSERT INTO notes VALUES ('MW113',1,'She was arrested at Dolbank in 1678 and died in York Castle the following year. biog dic records that she and her sister were direct descendants of St Thomas More through Cresacre More.');
INSERT INTO notes VALUES ('MW114',1,'Imprisoned in York Castle in 1678 and released in 1685.');
INSERT INTO notes VALUES ('BB126',1,'Parents from http://www.thomasmorestudies.org/Descendants_John.pdf');
INSERT INTO notes VALUES ('GB047',2,'Father known as Hugh in Cliffordiana.');
INSERT INTO notes VALUES ('LS041',1,'Sir Thomas was son of Hugh, third Lord Clifford. For discussion of mother\'s ancestry see Collecteana Cliffordiana 1817, p97.');
INSERT INTO notes VALUES ('MW055',1,'Was a member of the Hammersmith community before being sent to find suitable accomodation in the North.  After Frances Bedingfield became superior in York, she filled the same role at Hammersmith. She placed Hammersmith under the authority of Bishop Giffard in 1703 because of her anxiety about its ecclesiastical status. This was a step she later regretted. From 1715 until her death she lived in York. (CK-B)');
INSERT INTO notes VALUES ('MW055',2,'c1677/78 she was sent north to find suitable accommodation. She was arrested at Dolebank (near York) and imprisoned in 1678, probably being released after the accession of James II.');
INSERT INTO notes VALUES ('LS042',2,'Her older sisters Anne b1754 and Mary b1755 both died at Montargis. See Cliffordiana p51.');
INSERT INTO notes VALUES ('AP026',1,'Some Charnocks at Astley nr Wigan Lancs');
INSERT INTO notes VALUES ('LA109',1,'1642: \'This year also Mr Gillibrand sent us aforehand half of his 2 daughters portion, 4 hundred pound.  They were then novices, & the rest was, according to our agreement, to have sum upon rent there untill he should pay in the full portion, which was as much more 4 hundred pound, but this rent failed afterwards like the rest for som 12 years til tims were more quiet, he paid in the rest in the year 1655\': see Chronicle 481.  Having promised 400 father was struck by English law and unable to pay. Blundell Ol Cath Lancs p97.');
INSERT INTO notes VALUES ('GP160',1,'Father described as coming from Alston and from a junior branch of the family in Old Cath Lancs p178.');
INSERT INTO notes VALUES ('LA125',1,'Haydock pedigree in Hamilton, Vol II');
INSERT INTO notes VALUES ('BB126',2,'Her brother was the historian and Jesuit provincial, Rev Henry More SJ.');
INSERT INTO notes VALUES ('CB136',2,'Her brother was the historian and Jesuit provincial, Rev Henry More SJ.Parents given in crs p40');
INSERT INTO notes VALUES ('CB134',1,'Her brother was the historian and Jesuit provincial, Rev Henry More SJ.');
INSERT INTO notes VALUES ('LB147',1,'Her brother was Fr William Smith who became Confessor af the death of her Uncle, Father Joseph Foster in May 1628. Her Uncle was Confessor-General to the nuns when they first arrived in Lisbon and played a significant role in attracting recruits while they were in Rouen.');
INSERT INTO notes VALUES ('LB147',2,'Niece of Fr Seth Foster of Syon.');
INSERT INTO notes VALUES ('LB049',2,'Also known as Anne Foster.');
INSERT INTO notes VALUES ('GB071',2,'Her father went with the royal court into exile during the civil war, serving as treasurer-general to the queen and later keeper of the king\'s privy purse (ODNB on her father).');
INSERT INTO notes VALUES ('HC034',1,'Her brother, Rev Thomas Hunter SJ, gave the community relics of the Cross, St Barbara, St Catherine, St Anthony of Padua and St Teresa (Ann 38).');
INSERT INTO notes VALUES ('HC035',1,'In the annals, her mother is referred to as as being a \'Falkinbridge of the family of Lord Falkinbridge\'.  This was the title of the viscounts Fauconberg or Falkinbridge, held by the Belasyse family. Her mother was probably a daughter of Rowland Belasyse and Anne Davenport, parents of Mary OB008 and Anne OB004. Rowland was son of the 2nd Viscount and predeceased his childless elder brother the third viscount in 1699, one of his own sons succeeding to the title.');
INSERT INTO notes VALUES ('HC035',2,'She had to leave her Carmelite convent in Ghent after Emperor Joseph II suppressed the convents in the Low Countries.  She sought refuge in Hoogstraten.');
INSERT INTO notes VALUES ('BB019',1,'Probably daughter of Miles Blount of Orleton (probably the one in Herefordshire), d. 1663, and Anne Bustard of Addlebury (Stirnet).');
INSERT INTO notes VALUES ('MW015',1,'Used the alias of Paston.');
INSERT INTO notes VALUES ('MW015',2,'She was imprisoned in York in 1694 with her great-aunt, the first superior, Frances Bedingfield.');
INSERT INTO notes VALUES ('MW109',1,'Came from Germany to join the York community. biog dic suggests her father was possibly Sir William Maynard of Walthamstow, Essex. ');
INSERT INTO notes VALUES ('MW150',1,'She left about 100 to Esther Conyers in her will.');
INSERT INTO notes VALUES ('MW047',1,'The first member recived into the order in York.');
INSERT INTO notes VALUES ('MW047',2,'Niece of Rev John Hawker SJ. He was confessor to the Bruges Augustinians and left her most of what he had. She had been a convictress at Bruges: see Bruges Annals Vol I p239.');
INSERT INTO notes VALUES ('MW164',1,'Date of entry given in CRS 4 as 1699 15 Aug.');
INSERT INTO notes VALUES ('MW101',1,'She suffered from mental and physical senility.');
INSERT INTO notes VALUES ('MW101',2,'Her death was the result of her clothes catching alight in the absence of her attendant Frances Audas on the previous day.');
INSERT INTO notes VALUES ('MW007',1,'Entrusted with the duty of collecting the rents for Elizabeth Stanfield\'s property in Holderness, East Yorks. Later she attended on Dorothy Lodge, who was physically and mentally senile. (CK-B)');
INSERT INTO notes VALUES ('MW085',1,'Having been widowed, her mother then married Mr Hay, who was a benefactor of the York convent, giving 150. In 1715 her mother occurs as a recusant widow with one son and three daughters under age: Catholic non jurors 1715 p46.');
INSERT INTO notes VALUES ('MW085',2,'She entered the York convent school in 1712.');
INSERT INTO notes VALUES ('CB177',1,'Quosque Hall was the dower house of the Stapleton family. The martyr Thomas Thwing, a cousin of the Stapletons, started a school there c. 1668 (Catholic Encyclopedia, 1913, under Ven. Thomas Thwing).');
INSERT INTO notes VALUES ('MW028',1,'Hadland says Sir George Brown of Shefford and Caversham: see Thames Valley Papists; http://www.users.globalnet.co.uk/~hadland/tvp/tvpcontents.htm.  Stirnet has him as that given - JK');
INSERT INTO notes VALUES ('BF275',1,'Her birthplace appears to have been River Park, which survives as a farmhouse a mile from Lodsworth, near Petworth, Sussex.');
INSERT INTO notes VALUES ('BB025',1,'Probably the daughter of this name of William Bond of Highgate (knighted 23 July 1608) and his wife Catherine Povey. Sir William was son of Sir George Bond, Lord Mayor of London 1587 (died 1592). Alternatively, her father may have been cousin of Sir William, a William Bond of London, haberdasher, who died 1608/9 leaving issue by his wife Margaret Gore, though no daughter of this name is known. See Stirnet Bond03, based upon the Vistitation of London 1664.');
INSERT INTO notes VALUES ('AC015',2,'Parents probably those occurring in the Ingilby history of Ripley, http://ingilbyhistory.ripleycastle.co.uk/,\r\nas Thomas Bond of Bury St Edmunds (d. 1732) and Henrietta Jermyn, daughter and coheiress of Lord Jermyn of Bury St Edmunds. The Will of Thomas Bond of Bury St Edmunds was proved by his son Henry Jermyn Bond in 1732 (Rec. English Catholics 1715, 35).');
INSERT INTO notes VALUES ('LB043',1,'An Everell Constable, daughter of Robert Constable of Everingham, married Thomas Crathorne in the mid-sixteenth century. Their daughter Mary Crathorne married Joseph Constable of Burton and Upsall, father of Averilla Constable who married Thomas Smith in 1610. Everilda, daughter of Sir Marmaduke Constable of Everingham (d. 1574), married William Constable of Drax. ');
INSERT INTO notes VALUES ('DB094',1,'Father became deputy Governor of Jersey');
INSERT INTO notes VALUES ('DB092',1,'Received at request of the Governor of Dunkirk, although without dowry.');
INSERT INTO notes VALUES ('DB119',1,'Father a soldier killed in Tangier.');
INSERT INTO notes VALUES ('DB180',1,'With sister Susan sent to Sepulchrines for schooling, then to Ursulines until 1667 when they went to Benedictines Ghent briefly before moving to Poor Clares Gravelines to be near their mother. Entered convict at Dunkirk 1671 with sister.');
