INSERT INTO notes VALUES ('OB049',2,'She was daughter of her father\'s third marriage, his fourth being to a former mistress of Charles II, Catherine Pegge. Her father died in 1676, aged 72, in Flanders (Lord Braybrooke, Notes and Queries, no. 13, 1850).');
INSERT INTO notes VALUES ('OB050',1,'There is reliable evidence that her mother was Catherine Pegge, daughter of Thomas Pegge of Yeldersley, Derbs, and Catherine Kniveton. Catherine was a former mistress of Charles II, by whom she had a son. She was Sir Edward\'s fourth wife. Her father died in 1676, aged 72,in Flanders. See Lord Braybrooke, Notes and Queries, no. 13, 1850.');
INSERT INTO notes VALUES ('DB083',2,'Another source gives Hungate\'s property as Saxton, Yorks.');
INSERT INTO notes VALUES ('LA116',1,'Entered as a scholar 1658 but had to return to Northd first to accompany Margaret Errington who had decided to leave the convent after 11 months: see Life of Edward Widdrington, 1923, p12. ');
INSERT INTO notes VALUES ('LA306',1,'Mother grand-daughter of Francis, 1st earl of Bothwell. Father died in the convent\'s house for boarders in 1670. He had intended to join Carthusians: his wife intended to end her days in religion: see Sir Edward Widdrington, 1923 p15.');
INSERT INTO notes VALUES ('OB030',2,'Grandmother a Widdrington');
INSERT INTO notes VALUES ('CB202',1,'educated at the Bar Convent, York.');
INSERT INTO notes VALUES ('LA306',2,'History Families Skeet etc p 139 has Edward Widdrington with two wives and it is the second who entered the Benedictine enclosure at Bruges 1670. CB According to Burke\'s Extinct Peerage, p. 564, he married a Charlton of Hesleyside. Burke does not mention Christian Stuart, but a Charlton first marriage would match the data we have for Elizabeth Widdrington GP289.');
