INSERT INTO notes VALUES ('DB125',1,'History gives father as John Green.');
INSERT INTO notes VALUES ('DB121',1,'Had a very fine voice');
INSERT INTO notes VALUES ('DB086',1,'Did not persevere as a religious as she found it impossible to keep silent: became a devoted servant of the convent for many years.');
INSERT INTO notes VALUES ('DB018',1,'Had been servant to Lady Molineux (Abbess Prujean\'s cousin)At the time of her profession, the ceremony was deemed illegal so she assumed the habit of Sister Austin Jackson: thus the convent was not increased in number.');
INSERT INTO notes VALUES ('DB145',1,'Because of her nationality not permitted to remain with other members of the convent after they were expelled by the revolutionaries in 1793: said to have died of a broken heart.');
INSERT INTO notes VALUES ('DB174',1,'Guarded remaining money in her dustpan during imprisonment in order to pay for the nuns\' passage back to England');
INSERT INTO notes VALUES ('MW122',1,'One of last 3 members at Hammersmith: died one month after the arrival of the Benedictines of Dunkirk.');
INSERT INTO notes VALUES ('MW064',1,'One of last 3 members at Hammersmith: received the Benedictine nuns of Dunkirk into their property. ');
INSERT INTO notes VALUES ('MW174',1,'One of last 3 members at Hammersmith: became an oblate of Benedictines.');
INSERT INTO notes VALUES ('MW120',1,'Could \'Palmer Park\' be slip for Parham House, the seat of one branch of the Sussex family of Palmer; cf. http://www.angmeringvillage.co.uk/history/Palmer_tree1.pdf');
INSERT INTO notes VALUES ('BD008',1,'p198 refers to her being a widow of Mr Piney: is this the mother\'s husband? Her age is given in convent sources as 94 but it is impossible to reconcile this age with the dates given.');
