INSERT INTO notes VALUES ('BD038',2,'Additional funds were sent by Lord Cardinal Howard soon after the clothing of his two neices to make each of their portions 400 and 40 for their noviceship year. p207.');
INSERT INTO notes VALUES ('BD040',2,'Additional funds were sent by Lord Cardinal Howard soon after the clothing of his two neices to make each of their portions 400 and 40 for their noviceship year. p207.');
INSERT INTO notes VALUES ('GP240',1,'Her grandfather Ambrose Rookwood was executed for his part in the Gunpowder Plot.');
INSERT INTO notes VALUES ('LA239',1,'According to Stirnet she was daughter of Sir Hugh Smithson of Stanwick and Elizabeth Langdale, and sister to BA177, BA178 and GP252.');
INSERT INTO notes VALUES ('MW051',1,'Her father was governor of Hainault.');
INSERT INTO notes VALUES ('MW084',1,'She entered the York convent school in 1712.');
INSERT INTO notes VALUES ('MW084',2,'Having been widowed, her mother then married Mr Hay, who was a benefactor of the York convent, giving 150. In 1715 her mother occurs as a recusant widow with one son and three daughters under age: Catholic non jurors 1715 p46.');
INSERT INTO notes VALUES ('MW046',1,'She entered the York convent school in 1718.');
INSERT INTO notes VALUES ('BD033',1,'115 of dowry paid by her brother Mr Ralph Hansby: 5 added by the Abbess: OA p206');
INSERT INTO notes VALUES ('BD040',3,'Editorial in CRS vol pp208-9 emphasises the role played by Sister Mary Rose Howard in acting as a conduit between the Pretender and his friends and supporters in England see Lockhart papers eg vol ii p341. The editorial says all trace of the letters between Sister Mary Rose and James has been lost.');
INSERT INTO notes VALUES ('BD066',1,'Additional money left by her father on his death OA 210');
INSERT INTO notes VALUES ('MW110',1,'Her mother boarded at the York convent for many years and died there in 1742 Jan.');
INSERT INTO notes VALUES ('MW006',1,'She entered the York convent school in 1737.');
INSERT INTO notes VALUES ('MW108',1,'She entered the York convent school in 1741.');
INSERT INTO notes VALUES ('MW060',1,'Information on family and father\'s marriages: http://www.thurnhamchurch.net/history.html and http://web.thurnhamhall.com/Pages/history/longer_history.php');
INSERT INTO notes VALUES ('MW033',1,'She entered the York convent school in 1760.');
INSERT INTO notes VALUES ('MW136',1,'While she was Superior some toleration was granted to Catholics, meaning the community adopted religious dress for the first time in 120 years. During the French Revolution she gave hospitality to three communities of nuns until they found new homes and she helped many emigr priests to find lodgings and employment. (CK-B) ');
INSERT INTO notes VALUES ('MW086',1,'She was received into the Church whilst completing her education in Paris. Mother Protestant.');
INSERT INTO notes VALUES ('MW057',1,'Joined the convent school as a pupil in 1770. Was in fact Head Mistress of the school in York, being described in convent documents as Mistress of Schools. ');
INSERT INTO notes VALUES ('MW119',1,'She was educated at the Hammersmith convent.');
INSERT INTO notes VALUES ('MW148',1,'She entered the York convent school in 1782.');
INSERT INTO notes VALUES ('MW148',2,'Her father was lord of the manor of Wheelton.');
INSERT INTO notes VALUES ('MW066',1,'She entered the York convent school in 1772.');
INSERT INTO notes VALUES ('BD069',1,'As a result of lawsuits on death of father convent only received 130ll of promised dowry; see OA 213');
INSERT INTO notes VALUES ('BD054',1,'Only organist for many years; OA 213');
INSERT INTO notes VALUES ('MW024',1,'Arrived in England in 1789 and entered the York convent school with her sister Volsci in 1790.');
INSERT INTO notes VALUES ('MW038',1,'She entered the York convent school in 1777.');
INSERT INTO notes VALUES ('MW038',2,'Her father was a portrait painter.  Her grandfather, John Alexander, and uncle, Cosmo Alexander, were painters and were both ardent Jacobites (ODNB Sir George Chalmers).');
INSERT INTO notes VALUES ('BD071',1,'Her profession document is signed with  a mark (sign of cross). ');
INSERT INTO notes VALUES ('CB164',1,'Mother probably an Errington of Walwick Grange, Northumberland.');
INSERT INTO notes VALUES ('PA163',1,'Of the Talbot family of Thornton, Yorks. Possibly daughter of John Talbot of Thornton (d. 1638) and Jane Crosland of Harum, whose daughter Jane died unmaried (Stirnet).');
INSERT INTO notes VALUES ('BB132',1,'Daughter of Edward Paston of Appleton, Norfolk (died before 6 May 1630) and his wife Margaret Berney (born c. 1566); named as one of two unmarried daughters in a manuscript genealogy of c. 1635 published by Francis Worship in 1852 (Norfolk Rec. Office MC 662/23 and BL/ AD/3/9). Thorpe Old Hall, in Thorpe St Andrew, Broadland, Norfolk, was the town house of Sir Edward Paston (d. 1630), http://homepage.mac.com/philipdavis/English%20sites/4057.html (scheduled sites and monuments, with photograph).');
INSERT INTO notes VALUES ('BB133',1,'Daughter of Edward Paston of Appleton, Norfolk (died before 6 May 1630) and his wife Margaret Berney (born c. 1566); named as one of two unmarried daughters in a manuscript genealogy of c. 1635 published by Francis Worship in 1852 (Norfol Rec. Office MC 662/23 and BL/ AD/3/9). Thorpe Old Hall, in Thorpe St Andrew, Broadland, Norfolk, was the town house of Sir Edward Paston (d. 1630), http://homepage.mac.com/philipdavis/English%20sites/4057.html (scheduled sites and monuments, with photograph).');
INSERT INTO notes VALUES ('LA270',1,'Towneley Hall, near Burley, Lancs, is today a museum. A large chart of the family tree is displayed in the Towneley Room: www.towneley.org/info/23/towneley_family.');
INSERT INTO notes VALUES ('BF098',1,'Birthplace perhaps Trelouth, Trelowth, Cornwall.');
INSERT INTO notes VALUES ('BA170',1,'Her will (written in 1731) was proved at Durham (probate 1741 T80); it confirms that she was due one thousand pounds at Ralph Salvin\'s death (d. 1729) under the terms of her mother\'s marriage settlement, but did not inherit her father\'s lands.');
INSERT INTO notes VALUES ('HC036',1,'Hardman wrongly gives her date of birth as 1837 21 Jan; the annal states 1846 21 Jan.');
INSERT INTO notes VALUES ('HC036',2,'She suffered from slight attacks of paralysis which weakened her mind and body.');
INSERT INTO notes VALUES ('BA170',2,'Her mother was daughter of Henry Browne, 5th visc Montague.');
INSERT INTO notes VALUES ('HC037',1,'She was the last surviving nun of Hoogstraten to die.');
INSERT INTO notes VALUES ('AC037',1,'Valenciennes was not an English Carmel and was suppressed by the authorities.');
INSERT INTO notes VALUES ('AC145',1,'When French convents were suppressed and dispersed by the authorities decided to live in an English convent.');
INSERT INTO notes VALUES ('AC146',1,'When the French convents were suppressed and dispersed went first to the English Benedictines and then to the Antwerp Carmelites in England.');
INSERT INTO notes VALUES ('HC004',1,'She had consumption when she arrived at Hoogstraten due to the flight from the siege of Valenciennes.');
INSERT INTO notes VALUES ('HC007',1,'Her health was very bad which led to difficulties finding a new convent, though her sister refused to enter without her.');
INSERT INTO notes VALUES ('HC006',1,'She refused to enter a new convent without her sister, whose health was very bad.');
INSERT INTO notes VALUES ('HC007',2,'She was so ill that she could not follow community duties.');
INSERT INTO notes VALUES ('OB121',1,'for biog of this branch of the family see Baker\'s Northants & Nichols Literary \r\nAnecdotes vol ix p251');
INSERT INTO notes VALUES ('AC079',1,'Her brothers were Revs John and George Keynes SJ, both in ODNB.');
INSERT INTO notes VALUES ('AC084',1,'Moved to Dusseldorf, then to Munsterfelt  returned to Dusseldorf in 1659. In 1661 at the request of the local ruler went to Newburgh to found a Carmel taking with her others from Antwerp; see Hallett, 74-5. See also account in Hoogstraten archives image 489');
INSERT INTO notes VALUES ('AC030',1,'Duchess of Newcastle led her to her clothing: annals 515.');
INSERT INTO notes VALUES ('HC059',1,'Their Aunt was Suzanna van Dyck a beguin in Antwerpen. Dutch article p 29');
INSERT INTO notes VALUES ('HC058',1,'Their Aunt was Suzanna van Dyck a beguin in Antwerpen. Dutch article p 29');
INSERT INTO notes VALUES ('GP278',1,'Had been a scholar for a year with the Benedictines at Brussels when she joined the Poor Clares (Chron, 14)');
INSERT INTO notes VALUES ('HC047',1,'She died of sunstroke.');
INSERT INTO notes VALUES ('PA111',1,'William Middleton of Stockeld (d. 1658) and his wife Catherine Constable, whose children, born in the 1650s, included an Elizabeth (Stirnet). William\'s son Peter was father of Mary, PA112.');
INSERT INTO notes VALUES ('GP164',1,'Mother\'s name given in Ruvigny, Jacobite Peerage, and ingilbyhistory.ripleycastle.co.uk/');
INSERT INTO notes VALUES ('GP165',1,'Mother\'s name given in Ruvigny, Jacobite Peerage, and ingilbyhistory.ripleycastle.co.uk/t');
INSERT INTO notes VALUES ('GB109',2,'No data given. Would be half sister of BF135.\r\nShe appears on the list only with a ?');
INSERT INTO notes VALUES ('MW032',1,'She entered the York convent school in 1775.');
INSERT INTO notes VALUES ('MW079',1,'She was baptized 1773 16 Jan in the York convent chapel, the day after her birth. She was the Aunt of Joseph Aloysius Hansom, architect. Several members of the Hansom family lived in the Micklegate area and received sacraments in the York convent chapel. (CK-B)');
INSERT INTO notes VALUES ('MW132',1,'She migrated to England because of the French Revolution.');
INSERT INTO notes VALUES ('MW076',1,'Her father was said to have possessed large estates in France. He was executed during the French Revolution. The family escaped to England, but her mother and siblings returned to France and all died on the guillotine. \r\nIn 1815 the Abb Gilbert asked that Sister Chantal should return to Paris to found a religious house. (CK-B)');
INSERT INTO notes VALUES ('MW034',1,'Campian was an alias.');
INSERT INTO notes VALUES ('MW040',1,'She was briefly at York.');
INSERT INTO notes VALUES ('MW065',1,'She worked on the English Mission and was certainly there from 1621 to 1623. Her real identity was kept secret and we do not know her name. In c. 1623 she wrote for her Superior (probably Frances Brooksby) a full account of her work on the English Mission. She was supported and protected by Lady Timperley of Hintlesham Hall, Suffolk, but she also lived in poor households. Her service extended to both rich and poor. (CK-B)');
INSERT INTO notes VALUES ('MW093',1,'She was in England in 1627.');
INSERT INTO notes VALUES ('MW096',1,'Her contacts in Rome were important during Mary Ward\'s imprisonment. She was sent from Flanders to Rome in 1623 and spent the rest of her life there. Many letters to her from Mary Ward and Elizabeth Cotton survive in the _Mary Ward Texts_. They show the important part she played in the safeguarding of the Institute\'s Roman house. (CK-B)');
INSERT INTO notes VALUES ('MW116',1,'She is recorded at St Omer in 1623 and was in Munich from 1627 onwards. The family is said to be related to the Venerable Edward Morgan, martyred at Tyburn in 1642. (CK-B)');
INSERT INTO notes VALUES ('MW125',1,'Educated by the Mary Ward sisters in Paris. She went to Augsburg in 1662.  She was in Hammersmith in 1669 before residing at St Martin\'s Lane, where she was Superior until the house was closed by the 1688 Revolution. (CK-B)');
INSERT INTO notes VALUES ('MW130',1,'She was in Cologne in 1627.');
INSERT INTO notes VALUES ('DP116',1,'Her brother, Ambrose, was a Jacobite.  Other brothers became priests, including a Jesuit (ODNB).');
INSERT INTO notes VALUES ('DP117',1,'Her brother, Ambrose, was a Jacobite.  Other brothers became priests, including a Jesuit (ODNB).');
INSERT INTO notes VALUES ('DP118',1,'Her brother, Ambrose, was a Jacobite.  Other brothers became priests, including a Jesuit (ODNB).');
INSERT INTO notes VALUES ('GP241',1,'Her grandfather Ambrose Rookwood was executed for his part in the Gunpowder Plot.');
INSERT INTO notes VALUES ('LA216',1,'Her brother, Ambrose Rookwood, was executed for his role in the Gunpowder Plot.  Another brother, Henry, became a Franciscan, living in Rouen and Lisbon (ODNB).');
INSERT INTO notes VALUES ('LA216',2,'She was sent to become a nun by Rev John Gerard SJ, who recorded a short account of her life as a nun (Gerard autobiography, pp.33, 226, 261).');
INSERT INTO notes VALUES ('LA215',1,'Her brother, Ambrose Rookwood, was executed for his role in the Gunpowder Plot. Another brother, Henry, became a Franciscan, living in Rouen and Lisbon (ODNB).');
INSERT INTO notes VALUES ('MW138',1,'She was in Flanders until 1623 when she joined the group of eight sisters who were called to Rome. She was in Naples from 1624-1628 when the house was closed. She seems to have stayed in Naples and Rome for some time after 1628 but not as a member of the Institute. (CK-B) ');
INSERT INTO notes VALUES ('MW140',1,'One of the original companions. Pictured in the Painted Life as one of the companions leaving England for Flanders in 1609. Was one of the members who remained at Lige after the suppression in 1630. Travelled to Rome with Winifred Wigmore in 1632 to join Mary Ward, remaining there until 1637. Followed the group to England. She was present at Mary Ward\'s deathbed.');
INSERT INTO notes VALUES ('MW158',1,'She accompanied Mary Ward on all her journeys and was imprisoned with her. Almost certainly at Mary Ward\'s death bed and is thought to have returned to Germany before 1650: see Companions p114.');
INSERT INTO notes VALUES ('OB003',1,'Judith Swarbrook has her as a lay sister');
INSERT INTO notes VALUES ('OB006',1,'According to Grimbert (1998) p301, she transferred to Pontoise Ursulines in 1786. ');
INSERT INTO notes VALUES ('OB008',1,'Judith Swarbrook says she was a lay sister: obit makes her a choir sister.');
INSERT INTO notes VALUES ('OB012',1,'check dob: age at death given as 77 which would make a dob of 1618 possible');
INSERT INTO notes VALUES ('OB013',1,'Judith Swarbrook says her sister Margaret was also a boarder.');
INSERT INTO notes VALUES ('OB107',1,'Judith Swarbrook says transferred to Rouen 1786');
INSERT INTO notes VALUES ('OB021',1,'Judith Swarbrook says disagreement about parentage: alternative father Richard Calvert of Cockerham Hall, Lancs and sister of Charles Calvert SJ.');
INSERT INTO notes VALUES ('OB039',1,'Judith Swarbrook says mother was wet-nurse to James II\r\n68H10 gives permission 1684 to travel to England for treatment to eyes.');
INSERT INTO notes VALUES ('GB071',3,'According to the Pontoise register she died at Paris where she had been sent for her health on 16 December 1661 and was buried there. She was brought from thence in her lead coffin and re-interred in the church of the Pontoise convent on 10 July 1671. Discussed by Judith Swarbrook.');
INSERT INTO notes VALUES ('OB046',1,'According to Grimbert (1998) p301 she joined Pontoise Ursulines. ');
INSERT INTO notes VALUES ('OB054',1,'Judith Swarbrook says brothers Peter and Henry were SJ');
INSERT INTO notes VALUES ('OB056',1,'Judith Swarbrook says brothers Peter and Henry were SJ');
INSERT INTO notes VALUES ('OB066',1,'Judith Swarbrook says boarder with sisters Catherine and Charlotte');
INSERT INTO notes VALUES ('OB069',1,'According to Grimbert (1998) p301 she transferred to Hotel Dieu, Pontoise on closure of convent: still there in 1793. ');
INSERT INTO notes VALUES ('OB072',1,'Nolan p170 sent to Dublin mentioned by name in patent of James II, returned to Pontoise and later sent to Ypres for short time to assist in the revival of the Ypres convent. Ypres Nolan 218-9: Named in a letter from the Abbess of Pontoise (1700) as one of four nuns having permission to go to Ypres ');
INSERT INTO notes VALUES ('GB168',1,'Sent to England on convent business 1657 and 1661: returned to Pontoise where elected 3rd abbess. Returned to England 1668.');
INSERT INTO notes VALUES ('OB088',1,'Her father became a Jesuit lay brother on death of wife: see obit.');
INSERT INTO notes VALUES ('OB089',1,'Trans to Ypres, to Ireland, to Ypres (abbess) then to Pontoise: see obit.');
INSERT INTO notes VALUES ('OB090',1,'Transferred to Dublin then returned to Pontoise when new community failed to prosper: see obit.');
INSERT INTO notes VALUES ('LS193',1,'check no of sisters');
INSERT INTO notes VALUES ('OB113',1,'In 1668 visited Hoywell with Anne Neville: see Judith Swarbrick');
INSERT INTO notes VALUES ('OB125',1,'Judith Swarbrick says entered Ghent and transferred to Pontoise');
INSERT INTO notes VALUES ('OB132',1,'Age at death as given in obit');
INSERT INTO notes VALUES ('OB142',1,'Sir Andrew later became Comte d\'Albie ');
INSERT INTO notes VALUES ('BB204',1,'connection with Mary Eure: family Noels of Dalby and Brook');
INSERT INTO notes VALUES ('BB205',1,'returned to Rheims');
INSERT INTO notes VALUES ('BB163',1,'Annals 48 has her name in baptism as Winefrid Smith');
INSERT INTO notes VALUES ('BB199',1,'Father imprisoned for his faith: annals 58-9 Annals record that she went to be cared for at a convent of Black, Nursing sisters for treatment of a painful malady in her arm.');
INSERT INTO notes VALUES ('BB145',1,'Annals 61 gives father as Sir Ferdinand Pulton of Barton, Bucks');
INSERT INTO notes VALUES ('BB179',2,'Father died in prison for his faith: see annals 85');
INSERT INTO notes VALUES ('BB082',1,'Although the annals 90 says she was cousin to Mary Gage the profession book makes clear that she was daughter of Edward Gage of Firle and hence sister of Mary.');
INSERT INTO notes VALUES ('BB139',1,'Her father was Peter Philips the composer: see ODNB');
INSERT INTO notes VALUES ('BB027',1,'The Chronicle account of her relationship to the Kempes is confusing; indeed, the relationships in this family are complex. John Kempe of Pentlow\'s widow (his known wife was Eleanor Drew of Devon) remarried to Sir Robert Brook, brother of Alice BB027 and Susan Brook LA041, who were thus step-aunts to Robert\'s step-daughters Frances LA158 and Mary BB105 Kempe. John Kempe\'s son and successor, another John Kempe of Pentlow, married Lucy, sister of Sir Robert Brook, who appears to have been Susan\'s sister.');
INSERT INTO notes VALUES ('BB122',1,'annals 119 has father as Sir William');
INSERT INTO notes VALUES ('BB072',1,'cousin to the Noels who came from Rheims to assist in foundation');
INSERT INTO notes VALUES ('BB170',2,'annals 166 says father came from Gatterthorpe, Herefords (not in Gazzetteer)');
INSERT INTO notes VALUES ('BB124',1,'Mother imprisoned for her faith at York: annals 173 annals has 1707 as date of profession.');
INSERT INTO notes VALUES ('BB125',2,'Mother imprisoned for her faith at York: annals 173');
INSERT INTO notes VALUES ('BB061',1,'annals says in old chronicles she always goes under two surnames: gives profession as 1695 4 Feb.');
INSERT INTO notes VALUES ('BB070',1,'annals gives surname as Stapleton-Errington.\r\nHer father was son of Mark Errington of Ponteland and Anne Stapleton, heir to her brother Sir Miles Stapleton of Carlton. In consequence the son of Mark and Anne later adopted the name Stapleton, thereafter used by the descendants of his son and successor Nicholas (father of PA157). Anne Stapleton was therefore Elizabeth\'s grandmother; the name of her mother, her father\'s first wife, was Mary Scrope of Denby (d. 1695/6): see Foster\'s Yorkshire Pedigrees ii, Stapleton of Carleton. Her brothers Nicholas and Gregory occur as non-jurors in 1715 (p. 204).');
INSERT INTO notes VALUES ('BB014',1,'annals describes her as cousin of Aloysia Compton');
INSERT INTO notes VALUES ('BB046',1,'annals says cousin of Margaret Berkeley');
INSERT INTO notes VALUES ('BB194',1,'in monastery school aged 8: ');
INSERT INTO notes VALUES ('BB035',1,'annals has 1717 23 May as profession');
INSERT INTO notes VALUES ('BB103',1,'placed in school when she was 13.');
INSERT INTO notes VALUES ('BB143',1,'in convent school for 4 years');
INSERT INTO notes VALUES ('BB023',1,'placed in convent school');
INSERT INTO notes VALUES ('BB161',2,'placed in convent school');
INSERT INTO notes VALUES ('BB030',1,'placed in convent school with sister');
INSERT INTO notes VALUES ('BB031',1,'placed in convent school with sister');
INSERT INTO notes VALUES ('BB142',2,'annals says Clarkenwell, Hants. At convent school for 3 years');
INSERT INTO notes VALUES ('BB141',1,'annals says Pigott from Witham Middx');
INSERT INTO notes VALUES ('BB174',2,'placed in convent school with sister');
INSERT INTO notes VALUES ('BB147',2,'placed in convent school');
INSERT INTO notes VALUES ('DP142',1,'related to Dorothy Witham Bruss ben');
INSERT INTO notes VALUES ('BB119',2,'died of cancer');
INSERT INTO notes VALUES ('LS101',1,'Father also known as Thomas: mother\'s father Admiral Sir Richard Hawkins. Mother was widow when she married Hawkins: first husband Tristram Stuer Esq of Ugborough, Devon. Note from Sister Mary Magdalene');
INSERT INTO notes VALUES ('LS043',1,'MS Notes on Lige Nuns in Box D1 says Catherine and Bridget Berington were her cousins');
INSERT INTO notes VALUES ('LS245',1,'Notes on Liege Nuns D1 says resigned 1770');
INSERT INTO notes VALUES ('LS192',1,'Three sisters schooled by the Pontoise Benedictines, Mary Anne, Clare and Rachel: Paris ob 398.');
INSERT INTO notes VALUES ('LS193',2,'Three sisters schooled by the Pontoise Benedictines, Mary Anne, Clare and Rachel: Paris ob 398.\r\n\r\nBruges Augs II ann 161 relates that on June 20th 1764 a Miss Semmes left them and went to Pontoise where she soon afterwards took the habit. She had thought of entering at Bruges but disliked their confessor Mr Hinde.');
INSERT INTO notes VALUES ('LS192',2,'History 54 refers to 4 sisters Semmes from Maryland only two of whom lived to be professed');
INSERT INTO notes VALUES ('LS190',1,'No other references to Ursula: ? parents');
INSERT INTO notes VALUES ('RP002',4,'Frequently visited by her nephew Henry, fifth Lord Arundell of Wardour (Chr II 8).\r\nChronicle records that she had a very particular talent in poetry.');
INSERT INTO notes VALUES ('MW160',2,'According to Vaux of Harrowden p375 (citing HMC Downshire II, 157), she initially wanted to become a Benedictine nun but changed her mind and joined the Carmelites before becoming an early member of the Mary Ward sisters. Death and burial from Vaux of Harrowden p474, 476, 491.');
INSERT INTO notes VALUES ('AC126',2,'Her name in religion at the Mary Ward Institute was Chrysogona.');
INSERT INTO notes VALUES ('RP161',1,'Was a scholar at Gravelines before going to Rouen. No space in coaches so joined the convent a year after foundation in 1645. Lady Arundel paid for her clothing.');
INSERT INTO notes VALUES ('LA300',2,'Chronicle 156) gives family details as follows: \'In the year 1616 were professed two nuns the one named Sister Mary Windsor daughter of Mr Andrew Windsor, son of the Lord Windsor & of the Lady Catharin Vere daughter to the Earl of Oxford. He was a younger brother but always a constant Catholick\'. Andrew was named in the Will of his mother Katharine de Vere (d. 1600), widow of Edward, 3rd Lord Windsor (TNA PROB 11/95). The name of his wife is given as Anne Peche in The Plantagenet Roll of the Blood Royal: The Mortimer-Percy, by Marquis of Ruvigny and Raineval Staff,(Heritage, London, 1911) p. 442.');
INSERT INTO notes VALUES ('AC068',1,'Although her sister is stated in the sources to have been brought up a heretic, all that is said of Mary is that she visited her sister after she had been some years professed and was moved to follow her example.');
INSERT INTO notes VALUES ('GB034',1,'a cousin to the duke of Ormond. Sent to Paris to discuss future of Ypres convent. Sent to Ireland to secure promises of money: died on her return journey.');
INSERT INTO notes VALUES ('GB137',1,'Her sister Frances Henrietta was a boarder at the Ghent convent when the Revolution broke out. She was very helpful in raising the alms needed to ensure the nuns\' safe to England.');
INSERT INTO notes VALUES ('GP027',1,'Chron 5 says she was cousin to Margaret Simmons');
INSERT INTO notes VALUES ('RP161',2,'Chron Chap 5 describes her as having been educated at Gravelines and left two sisters at Ghent: in fact only one entered there the other was a cousin. Chronicle describes her as cousin to Margaret Bedingfield. Because she was too young to enter as a nun was sent to the urusuline convent at Boulogne to learn French.');
INSERT INTO notes VALUES ('RP121',1,'Arrived as scholar in 1648 aged around 13: her uncle Rev Father Barton came for her clothing.');
INSERT INTO notes VALUES ('RP194',1,'Three sisters arrived as scholars 1648: were converted at convent.');
INSERT INTO notes VALUES ('RP193',1,'Three sisters arrived as scholars 1648: were converted at convent.\r\nDaughter of the 3rd duke of Lennox.');
INSERT INTO notes VALUES ('RP195',1,'Three sisters arrived as scholars 1648: were converted at convent.\r\nDaughter of the 3rd duke of Lennox.');
INSERT INTO notes VALUES ('PA162',1,'Went first (1651) to PCs Rouen, but did not stay. Was granddaughter to Lord Stourton. After Rouen went to Carmelites Antwerp then returned to England to live with her grandmother before going to Paris: see R chron I chap 11. These details permit the identification of her parents as Edward Stourton, eldest son of William 11th Lord Stourton, who died before his father in 1644 and his wife Mary Petre.');
INSERT INTO notes VALUES ('RP212',1,'Died novice');
INSERT INTO notes VALUES ('RP085',1,'arrived 1655');
INSERT INTO notes VALUES ('RP020',1,'She arrived in 1658 with her sister, Margaret.');
INSERT INTO notes VALUES ('MW171',2,'Unwittingly Winefrid Wigmore played a controversial role in the events surrounding the suppression of the order in 1630-1 and remained intensely loyal to Mary Ward throughout. From February 1631 until May 1632 she was imprisoned in Lige. ');
INSERT INTO notes VALUES ('GB251',2,'Three of her brothers, William, Robert and Richard Wigmore, were Jesuits.');
INSERT INTO notes VALUES ('MW167',1,'Founder of an unenclosed self-governing religious institute for women on the model of the Society of Jesus. Set up houses and schools in St Omer, Lige, Cologne, Trier, Rome, Naples, Perugia, Munich, Vienna, Bratislava (Pressburg) and sent members on the English Mission. Travelled extensively, mainly on foot, and pleaded the cause of her Institute personally before the Pope and Cardinals. She suffered the suppression of her Institute (1631) and in the same year, imprisonment for a time. (CK-B) For the life of Mary Ward, see _Mary Ward 1585-1656_, ed. Christina Kenworthy-Browne CJ, Catholic Record Society, 2008 and Henriette Peters, _Mary Ward, a World in Contemplation_, Gracewing, 1994. This will refer the reader to other texts relating to the life of Mary Ward.  ');
INSERT INTO notes VALUES ('MW168',1,'She seems to have spent most of her religious life in Flanders. After the 1631 suppression, she is recorded at St Omer in 1633, when Mary Ward\'s request to the Inquisition for 6 or 7 members to live there together as lay women was refused by the Cardinals. (CK-B)');
INSERT INTO notes VALUES ('MW166',1,'One of the original companions. With Mary Ward and other early members, she made the journey on foot from Lige to Rome in 1621. (CK-B)');
INSERT INTO notes VALUES ('AC132',2,'Her uncles, Thomas Percy, John and Christopher Wright, were all implicated in the Gunpowder Plot.');
INSERT INTO notes VALUES ('MW008',1,'She was a founder member of the Hammersmith community in 1669.  Did she enter in Munich or Augsburg before going to Hammersmith with Frances Bedingfield?');
INSERT INTO notes VALUES ('MW126',1,'She was also known as Langhorne.');
INSERT INTO notes VALUES ('MW021',1,'In 1739 she resigned as superior at Hammersmith. Details from Sister Gregory\'s research and Hammersmith convent registers.');
INSERT INTO notes VALUES ('MW155',1,'She was in Paris with Mary Portington in 1697. From 1703 until her death she was in Hammersmith.');
INSERT INTO notes VALUES ('GB140',5,'Her jubilee was celebrated during her time in Dublin, with King James II present.');
INSERT INTO notes VALUES ('RP120',1,'Arrived as scholars then sent to a French convent to learn the language. Her Uncle, Thomas Mascey, a secular priest came for her clothing.');
INSERT INTO notes VALUES ('RP056',1,'Came to be a scholar 1662: her sister Catherine came as a scholar but died in 1668 aged 13: see Chronicle Vol I 154, 183-4.');
INSERT INTO notes VALUES ('RP054',1,'Came in 1662 as a scholar but returned to England because of her health: came back 1667 and was clothed. Her sister Catherine came as a scholar but died in 1668 aged 13: see Chronicle Vol I 154, 183-4.');
INSERT INTO notes VALUES ('MW170',2,'She came with a large fortune but chose to be a lay sister.');
INSERT INTO notes VALUES ('RP028',1,'Professed Poor Clares, Bethlem Ireland: dispersed during Civil War; went to Spain but returned to France and stayed at Dieppe. Fell ill with consumption and travelled to Rouen with Sister Clare Tuite.');
INSERT INTO notes VALUES ('RP188',1,'Not formally a nun of the house; she had been superior at Dieppe and Novice Mistress in Ireland. Left Rouen in February 1671 and returned by October to Ireland, where she headed a small community at Athlone for a few years until her death. She influenced Sister Brigit Joseph Barnwells, decision to leave the convent and return to Ireland in 1685.');
INSERT INTO notes VALUES ('RP029',1,'Had been a scholar 7 years before clothing and had been sent to a French family to learn the language');
INSERT INTO notes VALUES ('AC038',1,'She was educated by the Ursulines in France.');
INSERT INTO notes VALUES ('AC018',1,'She intended to found the Maryland convent but died before it was safe for the nuns to travel to America.');
INSERT INTO notes VALUES ('GP229',1,'also known as Anne Raphael');
INSERT INTO notes VALUES ('RP030',1,'Had been scholar 7 years');
INSERT INTO notes VALUES ('RP198',1,'Sent over by Mr Sheldon');
INSERT INTO notes VALUES ('RP006',1,'Appears to be error in date given in Chronicle for Profession where it appears as 1675');
INSERT INTO notes VALUES ('RP125',1,'Chronicle reports that she had been novice at Paris Benedictines: not listed there');
INSERT INTO notes VALUES ('RP040',1,'Returned to England to collect her inheritance, but remained there and married');
INSERT INTO notes VALUES ('RP101',3,'According to the Chronicle, she went to France with a Protestant lady and was converted after having been put into a French monastery. Father Sherburne suggested the Benedictine nuns in Paris, but she wanted to enter a more austere house and chose Rouen.');
INSERT INTO notes VALUES ('RP059',1,'Came as schoolgirl aged 10. Chronicle reports her clothing in 1685 followed by profession in 1686. Dates given here are from profession list.');
INSERT INTO notes VALUES ('AC131',1,'Parents given as Henry Wakeman of Beckford Hall, Glocs, and Frances Higford of Dixton, by Robert P. Wakeman, Wakeman Genealogy 1630-1899 (1900), pp 37 ff.');
INSERT INTO notes VALUES ('AC129',2,'Ursula was the name of Edward Wakeman\'s mother.');
INSERT INTO notes VALUES ('PA195',1,'Given her date of birth she may have been another of the daughters of Anthony Windsor of St Nicholas and Knightley and his wife Frances Blount of Sodington, and hence sister of Bridget, Elizabeth and Mary, BF272-4.');
INSERT INTO notes VALUES ('GP237',1,'Buried in the cloister of the Carmelites.');
INSERT INTO notes VALUES ('RP120',2,'Parents supplied from Stirnet genealogy, which accords with details in the Rouen Chronicle.');
INSERT INTO notes VALUES ('RP121',2,'Parentage supplied from Stirnet genealogy which accords with details in the Rouen Chronicle. Father Richard Barton was the alias of Dorothy Bradshaigh\'s Jesuit brother.');
INSERT INTO notes VALUES ('GP158',1,'Chronicle reports that she was brought up in heresy till the age of 19 when she was converted by an Aunt. Struggled with her parents in order to join the convent.');
INSERT INTO notes VALUES ('GP188',2,'She had been converted by her uncle, priest to Lord Arundel of Wardour: R chr I chap 40.');
INSERT INTO notes VALUES ('RP194',2,'Confirmed as sacristan in 1691. Starting date obscure.');
INSERT INTO notes VALUES ('MW075',1,'She was a pupil at the Hammersmith school in 1718.');
INSERT INTO notes VALUES ('MW064',2,'She had been a pupil at the Hammersmith school.');
INSERT INTO notes VALUES ('MW068',1,'Educated by the Mary Ward Sisters in Paris. In 1662 she went to Augsburg but later returned to Munich.');
INSERT INTO notes VALUES ('MW070',1,'Educated by the Mary Ward Sisters in Paris. In 1662 she went to Augsburg as a founder member of the community there.');
INSERT INTO notes VALUES ('MW131',1,'She was educated by the Mary Ward Sisters in Paris and in 1662 she went to Augsburg. (CK-B)');
INSERT INTO notes VALUES ('MW159',1,'She was born in prison.  Following her mother\'s death, she was raised until her third year by her family, before being sent to the Institute for her education.  In 1662 she was chosen by Mary Poyntz to be amongst the first four pupils at Augsburg: details from Sister Ursula Dirmeier.');
INSERT INTO notes VALUES ('MW159',2,'A request was made for her as a lady-in-waiting by Maria Anna, archduchess of Austria, wife of Maximillian I, elector of Bavaria, and daughter of Emperor Ferdinand II.');
INSERT INTO notes VALUES ('MW010',1,'She was sent to Augsburg as a pupil in 1662.');
INSERT INTO notes VALUES ('PB021',1,'returned to Paris with her sister: Nolan 51-2');
INSERT INTO notes VALUES ('MW037',1,'She was educated by Mary Poyntz and Winefrid Wigmore in Paris. She was the founder and first superior of the house in Burghausen. (CK-B)');
INSERT INTO notes VALUES ('MW010',2,'She was superior general of the order.');
INSERT INTO notes VALUES ('MW009',1,'She went to Augsburg as a pupil in 1662.');
INSERT INTO notes VALUES ('MW009',2,'She was superior general of the order.');
INSERT INTO notes VALUES ('MW118',1,'She was the prefect of boarders in Augsburg.');
INSERT INTO notes VALUES ('BF131',3,'Her brother was Dom John Huddleston OSB, who reconciled Charles II on his deathbed and was chaplain to Catherine of Braganza (ODNB).');
INSERT INTO notes VALUES ('MW139',1,'Her uncle was Dom John Huddleston OSB, who reconciled Charles II on his deathbed and was chaplain to Catherine of Braganza (odnb).');
INSERT INTO notes VALUES ('MW023',1,'From 1660, at the age of five, she was a pupil in Rome.');
INSERT INTO notes VALUES ('MW143',2,'Parents given in CRS 4 363 as Jeremiah Bowes of Worlaby, Co. Lincoln and Anne Stephenson, of Holderness and Bonby-by Brigg, co Lincoln.');
INSERT INTO notes VALUES ('MW161',1,'She was a member of York Bar convent 1697 c.');
INSERT INTO notes VALUES ('MW112',1,'She also spent time at Augsburg and Passau.');
INSERT INTO notes VALUES ('PC107',2,'Goddaughter of Walter, 4th Lord Aston (Rouen Chron II, Chap 17). Spent time with the Poor Clares Rouen; invited by aunts to join Conceptionists: see Rouen Chron II Chap 18.');
INSERT INTO notes VALUES ('RP215',1,'Had been tourrier for over 45 years when she was found dead in her cell on 6 December 1738. Described as Sister Anne: no evidence she took vows.');
INSERT INTO notes VALUES ('RP216',1,'Although she entered the novitiate, she was soon regarded as not healthy enough. The confessor Father Trentham was concerned about her travelling home, especially since her parents were protestants. The nuns agreed to keep her on as tourrier, but even that the Confessor thought too hard for her. He succeeded also in having her kept on despite her an incident which the Chronicle says led to her loss of honour and fortune. She finally returned home, with money from the nuns, in October 1740.');
INSERT INTO notes VALUES ('RP166',2,'Arrived as pensioner with her sister Julia Ann');
INSERT INTO notes VALUES ('RP170',1,'Note in R chron II 18 says she was professed 12 August 1759. \r\nExamination reported parents living in London.');
INSERT INTO notes VALUES ('OB029',1,'Possibly daughter of John Clavering of Callaly and Anne, daughter of William Lord Widdrington , whose marriage contract is dated 26 March 1687. She was thus aunt of Anna Barbara OB030 and Barbara BA057 (Clavering pedigree).');
INSERT INTO notes VALUES ('DB040',1,'History 64 gives her mother as Anne Halsall. Although the date details suggest at first sight that Anne was more likely her grandmother, it seems that Anne is well-documented as the mother of 13 children borne over a period of nearly 30 years from her marriage in 1618. The evidence is collected from original documents in The Clifford Papers, by R. Cunliffe Shaw (1935) and detailed in http://www.rootsweb.ancestry.com/~clifton/clifton/c8a.htm. Five of Anne\'s daughters are said to have been nuns. Visitation of Lancs 1664-5, p87 shows four of them, including Elizabeth a nun at Dunkirk. This was GP076 who moved to Dunkirk. The fifth one was possibly this nun, and may have been the daughter Anne, b. c. 1638 according to the website cited.');
INSERT INTO notes VALUES ('MW163',1,'She lived in Rome and is recorded as having been there in 1631.');
INSERT INTO notes VALUES ('MW055',3,'She was a founder member of the Hammersmith community in 1669. Did she enter in Munich or Augsburg before going to Hammersmith with Frances Bedingfield?\r\n');
INSERT INTO notes VALUES ('MW114',2,'She was a founder member of the York Bar Convent in 1686. biog dic records that she and her sister were direct descendants of St Thomas More through Cresacre More.');
INSERT INTO notes VALUES ('BB122',2,'Teignmouth ms, Douay Abbey TAT1, has parents Sir William Mannock and Audrey daughter of Ferdinand Paris of Linton.');
INSERT INTO notes VALUES ('MW011',3,'Information about her earlier entry to the Benedictines at Brussels is given in the Chronicle of the Augustinians of Louvain, p 211. She had to leave because of a defect in her throat: joined the Mary Ward Sisters instead as one of the original companions.');
INSERT INTO notes VALUES ('LB074',1,'Led the return to England in 1809');
INSERT INTO notes VALUES ('MW049',1,'Appointed Superior of the Paradeiserhaus, Munich after the death of Winefrid Bedingfield in 1666. Two of her uncles, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert, was a Benedictine.');
INSERT INTO notes VALUES ('MW050',1,'Two of her uncles, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert, was a Benedictine.');
INSERT INTO notes VALUES ('MW012',1,'Two of her uncles, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert Babthorpe, was a Benedictine.');
INSERT INTO notes VALUES ('MW013',1,'Two of her uncles, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert Babthorpe, was a Benedictine.');
INSERT INTO notes VALUES ('BA149',1,'Two of her uncles, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert Babthorpe, was a Benedictine.');
INSERT INTO notes VALUES ('BA009',2,'Two of her uncles, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert Babthorpe, was a Benedictine.');
INSERT INTO notes VALUES ('LA069',1,'Two of her uncles, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert Babthorpe, was a Benedictine.');
INSERT INTO notes VALUES ('LA012',1,'Two of her uncles, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert Babthorpe, was a Benedictine.');
INSERT INTO notes VALUES ('AC099',1,'Two of her uncles, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert Babthorpe, was a Benedictine.');
INSERT INTO notes VALUES ('LA013',1,'Two of her sons, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert Babthorpe, was a Benedictine.');
INSERT INTO notes VALUES ('MW011',1,'As well as offices of Superior, she was appointed Provincial Superior of the houses in Northern Europe 1621-27 and succeeded Mary Ward as General Superior 1645-54.(CK-B)');
INSERT INTO notes VALUES ('MW011',4,'Two of her brothers, Ralph and Thomas Babthorpe, were Jesuits, whilst another, Robert Babthorpe, was a Benedictine.');
INSERT INTO notes VALUES ('BB151',1,'Her brother, Robert Rookwood, was a priest and served as confessor to the Poor Clares at Gravelines (1626 c - 1644 c) and then Rouen (1644 c - 1668).  Their father had entertained Queen Elizabeth I in 1578 but died in prison at Bury St Edmunds, Suffolk, in 1598 (Anstr II, pp.271-2).');
INSERT INTO notes VALUES ('MW134',1,'Her brother, Robert Rookwood, was a priest and served as confessor to the Poor Clares at Gravelines (1626 c - 1644 c) and then Rouen (1644 c - 1668).  Their father had entertained Queen Elizabeth I in 1578 but died in prison at Bury St Edmunds, Suffolk, in 1598 (Anstruther II, pp.271-2).');
INSERT INTO notes VALUES ('MW028',2,'Her cousin, Ursula Tyrwhitt, was mother to Elizabeth and Marie Babthorpe, sisters with the Mary Ward Institute, as well as Frances Babthorpe of the Louvain Augustinians and Ursula Babthorpe of the Bruges Augustinians.  Another of her cousins, Margaret Tyrwhitt, married Nicholas, brother of Dorothy and Susannah Rookwood of the Mary Ward Institute.');
INSERT INTO notes VALUES ('MW127',1,'A Companion of Mary Ward and early biographer. Her brother, John Poyntz, was a Jesuit.');
INSERT INTO notes VALUES ('MW030',1,'An early member, she lived in Lige and succeeded Barbara Babthorpe as Provincial of the houses in Northern Europe (1627-1630). She left at the time of the suppression of the house at Lige. but seems to have returned later and lived with the few members who remained in Lige. (CK-B)');
INSERT INTO notes VALUES ('MW034',2,'In 1627 she was in St Omer.');
INSERT INTO notes VALUES ('MW073',1,'She was in St Omer until appointed as Superior on theEnglish Mission in 1615. In 1618 she was Superior in Lige, where she remained until the suppression in 1630. She left the Institute shortly afterwards. (CK-B)');
INSERT INTO notes VALUES ('LA031',1,'Spoke Dutch. Served for a long time as refrectrice (Hamilton, Chron II, 79).');
INSERT INTO notes VALUES ('LA004',4,'Mistress of the school (Hamilton, Chron II, 79).');
INSERT INTO notes VALUES ('LA203',1,'Kinswoman of Sr Augustina Bedingfield LA023. Great niece, according to note in Hamilton, Chron II, 115, to Cardinal Reginald Pole. ');
INSERT INTO notes VALUES ('MW111',1,'She was in St Omer in 1621.');
INSERT INTO notes VALUES ('MW145',1,'She is recorded as a member of the Lige community in 1627.');
INSERT INTO notes VALUES ('MW158',2,'She was in Rome from 1621-26, Munich 1627-32, Rome c 1632-37, England 1639-50. She probably had some nursing skills as she was so often at Mary Ward\'s side, especially during her illnesses. (CK-B)');
INSERT INTO notes VALUES ('MW169',1,'She was in Munich 1630-33. In 1633 with several of the younger members, she was transferred to Rome. (CK-B) ');
INSERT INTO notes VALUES ('MW011',2,'She was in St Omer from 1609c-1616, Liege 1616c-1627, Bratislava 1628-1631, Munich 1631-1637 and in Rome from 1637 to 1654.');
INSERT INTO notes VALUES ('MW092',1,'She was recorded as still in Lige in 1630 and 1631.');
INSERT INTO notes VALUES ('MW140',2,'Went to Paris with Mary Poyntz in 1650 and had charge of the English pupils in the school. She remained there until 1655.');
INSERT INTO notes VALUES ('MW104',1,'She was the half-sister of Helen Marshall. From 1633 onwards several of the younger members in Munich were transferred to Rome including Clare marshall. She was recored as living in Rome in 1640. (CK-B)');
INSERT INTO notes VALUES ('BD027',2,'Cardinal Howard was half 2nd cousin once removed to Frances Howard, wife of Conyers Darcy, 2nd earl of Holderness.');
INSERT INTO notes VALUES ('MW054',1,'She was Mary Ward\'s Secretary from 1623 to 1637. Elizabeth Cotton was in Rome 1623-26 with a short stay in Perugia in 1624. She travelled (on foot) with Mary Ward to Munich in 1626 and remained there until 1632, apart from a short stay in Bratislava (Pressburg) in 1628. With Mary Poyntz she was present at Mary Ward\'s arrest and imprisonment on 7th February 1631. In 1632 she travelled with Mary Ward to Rome and remained there until 1651. (CK-B)');
INSERT INTO notes VALUES ('BA241',1,'Father Lieutenant Governor of Greenwich Hospital. She was converted at St Omer and sent prisoner to the English Poor Clares at Gravelines. After her return to England recommended to the Augustinians at Hengrave by Mr Greg Stapleton. Lived in the school for nearly three years before applying to join the community: III ann 113. Even though gave up the habit remained attached to the community.');
INSERT INTO notes VALUES ('MW071',2,'She was recorded as present in Lige in 1620.');
INSERT INTO notes VALUES ('MW077',1,'She is recorded as being in Lige in 1627 and 1630. She left after the suppression of the house. (CK-B)');
INSERT INTO notes VALUES ('MW168',2,'Her uncles, Thomas Percy, John and Christopher Wright, were all implicated in the Gunpowder Plot.');
INSERT INTO notes VALUES ('MW105',1,'Half sister of Clare Marshall. Remained in Munich until her death.');
INSERT INTO notes VALUES ('MW025',1,'She is known to have served on the English Mission, perhaps twice, and she probably replaced Susannah Rookwood as Superior from 1621-23 at the time when Dorothy was writing her account of her work in England.\r\nIn 1628 she was in Munich, then possibly in England again for a time. From 1631-32 she replaced Barbara Babthorpe as Superior in Bratislava (Pressburg) until the closure of that house. In 1633 she returned to Munich, where she lived until 1657. (CK-B)');
INSERT INTO notes VALUES ('MW144',1,'A member of the Munich community 1628-1632.');
INSERT INTO notes VALUES ('MW005',1,'She was in Munich in 1627.');
INSERT INTO notes VALUES ('MW028',3,'One of the original companions, she was a member of the community at St Omer until 1623 when she was  called to Rome. She was recorded as being in Naples in 1623-1628 and Munich 1628-31.');
INSERT INTO notes VALUES ('MW056',1,'She was called to Rome by Mary Ward in 1623 and was in Rome or Naples until the closure of the Naples house in 1628. (CK-B)');
INSERT INTO notes VALUES ('MW089',1,'In 1629 she was in Vienna, then Munich in 1631. After 1631 she seems to have returned to Vienna. (CK-B)');
INSERT INTO notes VALUES ('MW160',3,'She was at St Omer in 1614, but was recorded in Rome (1623) and Perugia in 1624 and 1625. The house at Perugia was closed in 1625. At this point Joyce Vaux left the Institute.');
INSERT INTO notes VALUES ('MW035',2,'She was recorded as being at St Omer in 1621, Liege in 1627 and, from 1633, Cologne.');
INSERT INTO notes VALUES ('MW074',2,'She was in Rome 1622-23 and Naples 1623-27. In 1627 she was called to Munich, then appointed Superior of the new foundation in Vienna. After she left the Institute c 1634, she seems to have remained with a few members of the former community supported by the Emperor until his death in 1637, but no longer members of the Institute.  Her uncle was John Gerard SJ.(CK-B)');
INSERT INTO notes VALUES ('MW087',1,'Acted as secreatary to Mary Ward: her handwriting appears on documents from 1616 to 1625. In 1621 she travelled with Mary Ward on foot from Lige to Rome. She remained in Rome apart from a short stay in Perugia in 1625. She probably died in Rome soon after that date. (CK-B)');
INSERT INTO notes VALUES ('MW013',2,'She was recorded as being in Munich in 1629 and 1631.');
INSERT INTO notes VALUES ('MW044',1,'She was in Lige until 1623, then travelled to Rome with the group of eight members. She was in Perugia 1624-1625. (CK-B)');
INSERT INTO notes VALUES ('MW053',1,'Up to 1630 she appears to have been in Lige: she left when the house was suppressed.');
INSERT INTO notes VALUES ('MW127',2,'She was in Rome in 1624 with Mary Ward, Elizabeth Cotton and several others.  Accompanied Mary Ward to Munich in 1627 where she was made Superior and developed the school. When the Institute was suppressed in 1631 it was Mary Poyntz who maintained a secret correspondence with Mary Ward. Although the school was closed in 1631, a small group remained together living as lay women. In 1633 she was summoned to Rome 1633-1637 by Mary Ward where she took charge of the community\'s house. Mary Ward, in search of health for herself and Mary Poyntz travelled to Lige and then on to London, arriving in 1639. They travelled northward to Yorkshire, finding refuge first at Heworth outside York, but the impact of the civil war made their conditions difficult. Mary Poyntz was with Mary Ward when she died at Heworth in 1645. She remained in England until 1650 when she was sent to Paris. Between 1654 and 1667 she was in Rome, Munich and Augsburg. Founder of the house and school in Augsburg with a founding community of English members. (CK-B)');
INSERT INTO notes VALUES ('MW129',1,'She was in Rome in 1623, then Naples as Superior from 1624 to 1628, when the house was suppressed. She remained in Naples until 1632. She is linked with Chrysogona Wakeman (AC126) with whom she joined the Antwerp Carmelites in 1632, but she did not persevere. (CK-B)');
INSERT INTO notes VALUES ('MW149',1,'She is recorded as a member of the Lige community in 1621 and was probably there until she left from Lige in 1629. (CK-B)');
INSERT INTO notes VALUES ('MW173',1,'She was in Munich in 1630 and accompanied Winefrid Wigmore on her visitation to Lige that year. After the suppression of the Lige house she remained in the town. In 1633 Mary Ward\'s request for the 7 or 8 remaining members to live together as lay women with Mary Wivell in Lige was refused by the Cardinals of the Inquisition. (CK-B)');
INSERT INTO notes VALUES ('MW135',2,'One of the original companions. She was in St Omer or Lige 1609-18 when she was appointed  Superior in London to succeed Anne Gage at a very dangerous time for the Institute, being sent to prison five times herself. Recalled to Flanders in 1621 and accompanied Mary Ward to Rome. She was recorded as being at Rome in 1623 acting as Mary Ward\'s secretary, before participating in the foundation in Naples in the same year. Was appointed Superior in Naples by Mary Ward. ');
INSERT INTO notes VALUES ('MW019',1,'She was sent from Flanders to Munich in 1627 for the new foundation and was Headmistress until the 1631 suppression. She succeeded Mary Poyntz as Superior in 1633, subsequently freeing the house from debt. Her good working relationship with the Elector Maximilian enabled her to re-open the school in 1635. In 1645 she began to receive new members into the Institute, thus ensuring its survival and future growth. (CK-B)');
INSERT INTO notes VALUES ('MW171',3,'In 1637 was in a small group of companions given permission (with Mary Ward) to leave Rome. They returned to England eventually reaching Yorkshire. Winefrid Wigmore was with Mary Ward when she died at Heworth in January 1645. She acted as headmistress of the school there and became the first headmistress of the institute\'s school for English girls in Paris. ');
INSERT INTO notes VALUES ('AP094',1,'Parents identified from Maryland sources');
INSERT INTO notes VALUES ('DP020',1,'Fifth abbess. Died in the fifth year of her abbatiate.');
INSERT INTO notes VALUES ('DP036',1,'Vicaress for nine years.\r\nFirst of those professed at Dunkirk to become a jubilarian.');
INSERT INTO notes VALUES ('DP109',1,'Vicaress for 12 years.');
INSERT INTO notes VALUES ('DP131',1,'Was also Dispencer.');
INSERT INTO notes VALUES ('DP028',1,'Given the closeness in dates of the four Cannel(l) nuns, it is likely that all four were sisters (DP028, GP061, GP062). See the note to Henrietta Maria Cannell (GP062).');
INSERT INTO notes VALUES ('DP062',1,'Dispencer for 9 years.');
INSERT INTO notes VALUES ('DP066',1,'Also Dispencer.');
INSERT INTO notes VALUES ('BA040',2,'She was badly injured when the convent chapel was struck by lightning but, after suffering convulsions, she fully recovered, which was believed to be bordering on the miraculous.');
INSERT INTO notes VALUES ('OB019',2,'In July 1714 she stayed with the Bruges Augustinians during her return trip from business elsewhere. (Bruges Augs I ann 318)');
INSERT INTO notes VALUES ('GP219',1,'On 17 July 1701, she had been received as a convictress at the Bruges Augustinians having arrived with Charlotte Stanley.  She was just under six years old at the time.');
INSERT INTO notes VALUES ('GP219',2,'On 22 November 1710 she returned to England to secure her pension and portion for her to profess at the Bruges Augustinian convent.  She returned on 4 July 1711 having secured her father\'s and brother\'s promises for a pension of 100 and a 400 payment before her profession.');
INSERT INTO notes VALUES ('GP219',3,'Despite excelling as a novice, the community regretted that they had to let her go.  Firstly, it appeared that payment was a problem, even though the nuns were willing to negotiate the fee.  However, she was then struck by severe mental illness and eventually had to be taken back to England by Barbara Devery.');
INSERT INTO notes VALUES ('BA072',2,'She brought the mentally ill novice, Mary Petre, back to England in October 1714.');
INSERT INTO notes VALUES ('BA182',2,'She brought with her to the covent Mary Petre, who later had to leave the novitiate due to mental health issues, on 17 July 1701.');
INSERT INTO notes VALUES ('BA191',2,'She suffered from a dropsy for 12 years, which caused her body to swell to such a size that the surgeon had to drain her body before she could be laid to rest.');
INSERT INTO notes VALUES ('BA057',1,'Her translation of an 8-Day Exercise from the Flemish was printed at the expense of Mrs Kempion, sister of sub-prioress Sister Willis (III ann 2).');
INSERT INTO notes VALUES ('HC002',1,'Seven year novitiate because of change in law on age at profession');
INSERT INTO notes VALUES ('GB119',2,'On 2 May 1715, she called at the Bruges Augustinians on her way to England and took breakfast at the Grate.  She was accompanied by Catherine Howard and one other.  On the return journey, they stayed with the nuns from 13 to 16 July (Bruges Augs I ann 323, 326).');
INSERT INTO notes VALUES ('GB104',3,'On 2 May 1715, she accompanied the abbess Mary Knatchbull to England and took breakfast at the Grate of the Bruges Augustinians.  On the return journey, they stayed with the nuns from 13 to 16 July (Bruges Augs I ann 323, 326).');
INSERT INTO notes VALUES ('BF234',1,'Her parents were imprisoned during the Popish Plot allegations.');
INSERT INTO notes VALUES ('BA091',1,'She arrived at the convent on the 22 June 1715 and entered the enclosure as a servant, having been recommended as a lay sister.');
INSERT INTO notes VALUES ('BA198',1,'She contracted small pox in 1715.');
INSERT INTO notes VALUES ('BA063',1,'She arrived at the convent on 14 Sep 1713.');
INSERT INTO notes VALUES ('GP222',2,'She was a convictress with her sister Catherine at the Bruges Augustinians, arriving on 4 Aug 1713.  Catherine returned to England on 18 May 1716 (I Ann 330).');
INSERT INTO notes VALUES ('BA128',1,'She arrived at the convent on 7 May 1713, at the age of about 15, having been recommended as a servant.');
INSERT INTO notes VALUES ('BA161',2,'II ann p1 says she was aunt to a Mrs Mannock who died on 22 October 1729.');
INSERT INTO notes VALUES ('BA112',2,'Chosen Arcaria in 1731-56.');
INSERT INTO notes VALUES ('PA088',3,'Her uncle, Edward Hunt, was a priest at Douai College.  He visited her on 3 Apr 1698, staying until 28 Apr, when he headed to England.');
INSERT INTO notes VALUES ('BA222',1,'She was received as a convictress on 11 December 1718 aged 9: I ann 355. II ann 9, under 1731.');
INSERT INTO notes VALUES ('GB205',1,'She may be the Dorothy of these parents shown in Stirnet Skrymshire 1 as wife of Robert Moseley, following the Visitation of Staffordshire 1664/5). She was older than most at profession and could have been a widow, though there is nothing in the surviving records to suggest this. ');
INSERT INTO notes VALUES ('BA222',6,'Another sister, Joanna, was received as a convictress on the 12 August 1732 (II ann 10).');
INSERT INTO notes VALUES ('BA044',2,'Her (great-)niece Mary Greenwood aged 13 joined as a convictress in 1734 (Chron Bruges 2).');
INSERT INTO notes VALUES ('BA202',1,'Her jubilee was not officially celebrated, her mental state having been impaired since her tenth or twelfth year of profession. Her sister was the one who suggested that her case being \'past management\' she be segregated from the community. Being harmless enough, eventually she was merely locked in at night to prevent wandering (II ann 82, 100, 139).');
INSERT INTO notes VALUES ('BA147',2,'Underwent surgery for cataracts in 1756 (II ann 125).');
INSERT INTO notes VALUES ('HC050',1,'She was named in honour of the marriage of Nicholas Leopold, Prince of Salm-Salm and Duke of Hoogstraten, to his second wife, Duchess Christina.');
INSERT INTO notes VALUES ('HC050',2,'She copied out many of the ceremonials, wrote out the billets and recorded many of the community\'s old customs.  She would never begin writing her Christmas song before the feast of St Damasus (11 December), who himself wrote verses with which he adorned the tombs of the martyrs.');
INSERT INTO notes VALUES ('BA189',2,'Having improved herself in painting and other such talents, she asked to return to the convent and was accepted on an \'under fortune\', arriving at the convent on 30 April 1716.');
INSERT INTO notes VALUES ('BA189',4,'She was appointed executrix by her mother, who died in 1738, leaving money to pay for \'irons in the Choir and organ loft\', and also to send the nuns\'s best singer, Sister Barbara Huddleston\', to a spa on account of her ill health (II ann 55).  ');
INSERT INTO notes VALUES ('BA221',1,'Sister of Fr Willis, Confessor to the Benedictines at Brussels and for three years until 1761 Extraordinary to the nuns at Bruges (II ann 134-5). She was a close contemporary of Elizabeth Willis (LA222), who was a sister of Joanna (PC128), who had been considered too unhealthy for a nun and sent back to her parents in England in 1735. Winifred\'s father Thomas had died and been buried in the Bruges convent church in 1726. Conceivably he was a brother of Elizabeth\'s father William, a merchant. They may have been a link to the family of Willis of Fen Ditton.');
INSERT INTO notes VALUES ('BA081',1,'Attempted suicide by drowning in 1764 after becoming blind (II ann 161).');
INSERT INTO notes VALUES ('HC060',1,'She was a Carmelite of Ghent but was chosen by the community at Courtrai to be their prioress and, as the great majority of the  nuns there desired, to place it under the bishop\'s authority. However, one of the nuns who wished Courtrai to stay under the control of the Carmelite fathers found out and raised a great cry against her.  As the bishop was her friend, Sister Lucy was rescued from the situation by being offered the opportunity to move to a different convent at which she would see out the rest of her days.  She chose Hoogstraten and they agreed to accept her.');
INSERT INTO notes VALUES ('MW045',1,'She was recorded as being in Lige in 1621 and 1627, then Vienna in 1629, where she was headmistress of the boarding school.');
INSERT INTO notes VALUES ('GB251',3,'Assisted with the foundation of Boulogne but died before the nuns moved. Her sources are therefore with the Pontoise community.');
INSERT INTO notes VALUES ('HC055',1,'She was one of the foundation group at Hoogstraten but had entered the novitiate before that.  She was the first to be professed at Hoogstraten.');
INSERT INTO notes VALUES ('HC053',1,'Her mother was the foundress of the convent.');
INSERT INTO notes VALUES ('HC053',2,'Her bridal dress was made of silver cloth, heavily embroidered with gold and pearls. It was later turned into a set of vestments.');
INSERT INTO notes VALUES ('HC053',3,'In 1701, the community was obliged to take refuge in Mechelen due to the wars.  The foundress, her mother insisted as much because she feared her nun daughter could be seized as a hostage.  Thus, she harboured the community at her own house called the Palace of Hoogstraat.  They remained there until the end of 1712.');
INSERT INTO notes VALUES ('HC056',1,'There is no record of her being clothed in Hoogstraten so it may have occurred at Antwerp.');
INSERT INTO notes VALUES ('BA071',1,'Retired from the world aged 29, recommended to Bryges by Fr Joseph Wright SJ (II ann 168).');
INSERT INTO notes VALUES ('BA091',2,'First lay sister to achieve jubilarian status, shortly before her death (II ann 191).');
INSERT INTO notes VALUES ('HC057',1,'She had been a companion of Princess Louise Marie of France in the St Denis novitiate, as well as a novice under the princess, known in religion as Therese of St Augustine.');
INSERT INTO notes VALUES ('BA196',2,'Her cousins Molly and Hester Goodsons (aged 11 and 10) arrived as pupils in the school in 1771 (II ann 202).');
INSERT INTO notes VALUES ('BA189',3,'Had gifts unusual in a woman, such as an understanding of art and architecture (II ann 216-17). Also a gift for poetry.');
INSERT INTO notes VALUES ('PC032',1,'Probably the same as Sally Farrell, sister of BA077 Mary Farrell, who was clothed at Bruges under the name Mary Xaveria on 3rd Aug 1775 and left for want of health on 7 Feb 1776 (II ann 222, 224). She left to go to Lige and again left for want of health.');
INSERT INTO notes VALUES ('BA069',1,'Both parents Protestant (PM). Suffered smallpox in 1783 (II ann 282).');
INSERT INTO notes VALUES ('OB014',1,'Permission to transfer: image 1P 185 in Pontoise [PM]  ');
INSERT INTO notes VALUES ('BA097',2,'Five of her cousins (unidentified) were lay sisters with the Franciscans at Bruges; they were invited to the Augustinian convent to help her celebrate her half-jubilee (II ann 299).\r\nShe was blind  for about the last 12 years of her life.');
INSERT INTO notes VALUES ('BA221',3,'Re-elected sub-prioress for the sixth time in 1787 (II ann 307). Jubilee 1792');
INSERT INTO notes VALUES ('BA010',1,'Born in the Low Countries although parents were English. Elected arcaria in 1716.');
INSERT INTO notes VALUES ('HC061',3,'Her mother was a cousin of Teresa, Mary and Catherine Charlton, all members of the Bruges Augustinians.');
INSERT INTO notes VALUES ('PC028',1,'Received into the church at the Friars Minor, Calais.Professed with the Franciscans 1806 2 Aug aged 53: see PB 172.');
INSERT INTO notes VALUES ('HC061',1,'Entered the Benedictine convent at Ghent; clothed 1700 10 Nov aged 17: no further data found.');
INSERT INTO notes VALUES ('HC058',2,'She received a vision of Jesus in 1720, prompting her to reform the practice of discussing spiritual matters after meals.');
INSERT INTO notes VALUES ('HC061',2,'During her many years in the world she had taken great pleasure in her own beauty.  Thus, as penance, she only washed her face once a year, on Good Friday.');
INSERT INTO notes VALUES ('HC062',1,'The pb was uncertain on parentage so the stirnet information has been opted for.');
INSERT INTO notes VALUES ('HC067',1,'In June 1713 a vision occurred during Mass, Jesus appearing in the Host at the moment of consecration.  This was believed to have happened to confirm Sister Monica Joseph\'s faith who at the time was having doubts about the Real Presence, though she had come to the convent to take the habit (Ann 24-5).');
INSERT INTO notes VALUES ('BF158',1,'She lived in the convent for 60 years, initially as a pensioner or perhaps a servant since, according to her obit, she was deaf and dumb and communicated in sign language. For her devotion she wore the habit for 27 years.');
INSERT INTO notes VALUES ('BA101',5,'Her sister, Winfred, married William Nithsdale, 5th earl of Maxwell.  Following his capture and imprisonment in the Tower of London following the 1715 Jacobite rebellion, she helped him escape the day before his execution.  On her way to France to meet up with her escaped husband, she stayed at the convent from 12 August to 14 September 1716 (I Ann 332-3).');
INSERT INTO notes VALUES ('GP222',3,'About a month after her clothing, when she took the name Eugenia, Rebecca began to think she should become a Poor Clare and later told her superiors that she would like to move.  Her parents at first rejected this proposal but following letters from the prioress, the convent\'s confessor and the rector of the English College in Ghent, they agreed.');
INSERT INTO notes VALUES ('BA175',2,'For roughly 30 years she was \'in charge of the woolen habit\', which included folding the wet linen in wash weeks.');
INSERT INTO notes VALUES ('GP219',4,'She sent several letters to the Bruges Augustinaians once her health had recovered asking if she could return, though she feared the community would be reluctant because of previous events.  Some were very opposed to this idea but as she had previously been such a good novice, she was invited to return.  However, in October 1716 she went from England to be present at the profession of her two younger sisters at the Gravelines Poor Clares and was so impressed that she decided to join them.');
INSERT INTO notes VALUES ('BA164',2,'She was opposed to Lucy Herbert\'s introduction of new statutes, feeling the community had not been properly consulted.');
INSERT INTO notes VALUES ('BA006',1,'She was received as a servant in order to be a lay sister on 12 August 1717. Jubilee 1770. Father Protestant');
INSERT INTO notes VALUES ('GB088',1,'1733 9 Nov: \'Mrs Frances Gasling came hether from Gant where she had been for some time but could not be [at] ease or resolve to settle among them, her inclination leading her to be here where she was propossed \r\nbefore she came over, but we refussed to take her both on account of \r\nher age and for that we had our number of lay Sisters and she no[t] capable \r\nof much labour. How ever compassion made us yeild to her importunity \r\nand we permitted her to come, but to our satisfaction, after a few days \r\nshe resolved to return back to Gand, which she did on the 15 of no[v]: II ann 20\r\n ');
INSERT INTO notes VALUES ('BA004',2,'Her time as novice mistress and sub-prioress overlapped slightly.  She was elected sub-prioress on 10 June 1717, but, having been elected as noivce mistress November 1716, she continued until 24 September 1717 as the community had decided she should remain in the position, despite her new election, until more novices arrived, there being only one at the time.');
INSERT INTO notes VALUES ('BA031',2,'She was the organist.');
INSERT INTO notes VALUES ('BA031',3,'She believed that she was cured of debilitative illness by the intercession of St Ignatius.');
INSERT INTO notes VALUES ('BA222',4,'Her father was a merchant. He was possibly related to the Willis family of Fen Ditton, Cambs. Her mother may have been a member of the Lucas family of Edith Weston, Rutland, and Fenton in Beckingham, Lincs.');
INSERT INTO notes VALUES ('OB065',1,'Allowed to leave the convent for a time in 1731 for her health. 68H10');
INSERT INTO notes VALUES ('BA062',1,'She was received as a convictress with her sister Elizabeth on 31 May 1719.  Her sister returned to England on 23 Nov 1722, whilst Frances received the first habit exactly a month afterwards.');
INSERT INTO notes VALUES ('BA228',1,'Her niece Frances Wright joined as a convictress on 31 May 1719.  Her brother and Frances\' father was a goldsmith (I Ann 356).  The niece left on 29 Aug 1720 to join two aunts at the Dunkirk Benedictines at the insistence of her parents (I Ann 370). [No record known of this in the Dunirk records.]\r\nMonasticon p1153 records her as the daughter of John Wright and his second wife but gives no name');
INSERT INTO notes VALUES ('BA072',3,'On 31 May 1719 she travelled to England.  She returned on 5 July, bringing with her Catherine and Ursula Chichester as convictresses and Mary Hilton as a servant in trial for being a lay sister.');
INSERT INTO notes VALUES ('BA052',3,'With her sister, Ursula, and Mary Hilton, she was brought from England by Barbara Devery, arriving at the convent on 5 July 1719.  She was received as a convictress.');
INSERT INTO notes VALUES ('BA053',2,'With her sister, Catherine, and Mary Hilton, she was brought from England by Barbara Devery, arriving at the convent on 5 July 1719.  She was received as a convictress.');
INSERT INTO notes VALUES ('GP033',1,'Had entered the Augustinian house at Bruges under the name Mary Xaveria, where she received the first habit having with difficulty obtained her father\'s consent. She soon recollected a vow to become a Poor Clare and was permitted to transfer to Gravelines, with her father\'s consent.');
INSERT INTO notes VALUES ('BA053',3,'Her uncle was Roger Palmer, 1st earl of Castlemaine.');
INSERT INTO notes VALUES ('BA064',1,'She always suffered from health problems. Mother and Father Protestant: \'tho her Parents being hereticks she had the prejudice of that unhappy education, yet coming to years of discretion... she was the more easily convinced of the errors of her false religion...: see Annals I 359-60.');
INSERT INTO notes VALUES ('BA016',2,'She was chosen arcaria in 1719.');
INSERT INTO notes VALUES ('BA238',1,'Lady Mary Herbert promised to pay her portion, but was unable to find the money.');
INSERT INTO notes VALUES ('OB069',2,'Entered the convict 1749 10 Aug aged 12.');
INSERT INTO notes VALUES ('BA076',2,'Annals gives detailed account of Sister Perpetua leaving the convent with the assistance of Lieut John Grant, whom she married at Sluys. He seems to have soon abandoned her, for soon afterwards she abjured her faith in order to support herself by begging and after a wandering life of abject poverty, mostly in Scotland, she returned to her brother\'s home in Northumberland and with assistance re-entered the convent as a penitent. Her excommunication was shortly afterwards lifted and she regained her rank of profession. ');
INSERT INTO notes VALUES ('OB086',1,'vows delayed because of non-payment of portion: fell into a fever and declined: see obit.');
INSERT INTO notes VALUES ('OB096',2,'Obituary refers to five year noviceship on account of family problems: (these were probably related to the dowry payment).');
INSERT INTO notes VALUES ('OB143',1,'Not entirely clear from obit at what age children were converted as no dates given: see Pontoise Register 306. \'She was one of the Daughters of the Right Honourable Lord Widdrington who with his lady her mother, being converted to the Romaine Catholic Faith neglect\'d not the Instruction of their Children in the same, ...\'');
INSERT INTO notes VALUES ('OB026',1,'Should she be under Chalk?');
INSERT INTO notes VALUES ('OB098',1,'Book of Entries states that she was sent by the Dowager Lady Petre who also paid for her journey and promised to pay her portion.');
INSERT INTO notes VALUES ('OB143',2,'Book of Entries gives portion as 500');
INSERT INTO notes VALUES ('OB114',1,'Her father\'s name was John Smith of Esh; see VCH Durham 3, pp 321-43 and footnote 168.');
INSERT INTO notes VALUES ('OB116',1,'Also a musician: played organ. See obit.');
INSERT INTO notes VALUES ('OB118',1,'Obit refers to her chief care to look after the sick without giving her an official title.');
INSERT INTO notes VALUES ('OB119',1,'Obit records her fine voice.');
INSERT INTO notes VALUES ('GP153',1,'With Urusla and Catherine Chichester, she was brought from England by Sister Barbara Devery, arriving at the Augustinian convent at Bruges on 5 July 1719.  She had wanted to enter the Poor Clares at Gravelines, but they were full at the time. Admitting this during her novitiate at Bruges (where she was known as Mary Joseph), her superior arranged for her admission at Gravelines.');
INSERT INTO notes VALUES ('BB117',1,'Former pupil in the school of the Augustinians of Bruges which she joined in 1687. According to the Annals of Bruges, she was clothed with two companions in November 1693, but when they came to be professed she advised to transfer to the Benedictines at Brussels as being more suitable for her.');
INSERT INTO notes VALUES ('LA093',1,'Her father was amongst those imprisoned \'for the mass\' in the Fleet. A In a State Paper of 1578 he petitioned for his release,stating that he had a wife \r\nand eleven children dependent on him (Chron I,16).\r\n');
INSERT INTO notes VALUES ('HC069',1,'She arrived at the convent on 4 July 1754.');
INSERT INTO notes VALUES ('OB128',1,'Had her own children: made arrangements for their care before she entered religion: see obit');
INSERT INTO notes VALUES ('OB127',1,'Was elected Prioress four times: see obit');
INSERT INTO notes VALUES ('OB131',1,'Sir Richard Foster paid 1000 livres for her portion: see Benefactors\' Book');
INSERT INTO notes VALUES ('OB134',1,'\'powerful in word and work, instructing and reduceing to the Catholick faith many heretick soldiers who were quartered in this town...\'see obit');
INSERT INTO notes VALUES ('OB147',1,'Name in baptism from entry in Book of Accounts');
INSERT INTO notes VALUES ('LA027',1,'Mother\'s name supplied from H. Jenkins on Edward Bendlowes in Review of English Studies 12, no. 47 (1936),p. 274.');
INSERT INTO notes VALUES ('LA027',2,'She was a distant kinswoman of several nuns, including BF139, BF085, GP091 etc.');
INSERT INTO notes VALUES ('LA201',1,'Chronicle says she was kinswoman of Margaret Skidmore, LA232.');
INSERT INTO notes VALUES ('LA141',1,'Parents supplied from the description in Hamilton, Chron Louvain II, 26,  of the descendants of Charles Carrington Smith and the details of Margaret Hungate\'s (DB083) parents.');
INSERT INTO notes VALUES ('LA143',1,'Parents supplied from the description in Hamilton, Chron Louvain II, 26,  of the descendants of Charles Carrington Smith and the details of Margaret Hungate\'s (DB083) parents.');
INSERT INTO notes VALUES ('LA106',1,'According to Chron Louvain II 44-5, she had married without her father\'s consent; the marriage was never consummated and was ended by her entry into religion.');
INSERT INTO notes VALUES ('PA176',1,'Her brother Francis, then Governor of Carlisle, was executed as a traitor in 1746 following the battle of Culloden.');
INSERT INTO notes VALUES ('RP051',1,'A notice of the death of the Abbess of the Poor Clares convent at Rouen, Mother Francis of Saint Benedict, formerly Frances Clifton, on 24th August 1756. Probably printed in Rouen. see Durham University Library, Special Collections');
INSERT INTO notes VALUES ('LB118',1,'Historia da vida admiravel e das accoes prodigiosas da veneravel Madre Soror Brizida de S Antonio escrita por Fr Agostinho de Santa Maria, Lisboa, 1701');
INSERT INTO notes VALUES ('GP233',2,'In January 1626 the Commissary deposed Abbess Tildesley and installed Margaret Paul in her place, to the great discontent of many of the nuns. She was removed and sent with 10 supporters to Dunkirk. The Commissary struggled to enforce his will, but eventually yielded after the nuns at Gravelines successfully appealed to Rome (Gravelines Chron, 145-65).');
INSERT INTO notes VALUES ('LB158',1,'Sister of Poor Clare Catherine (pb 68, note by Gillow)');
INSERT INTO notes VALUES ('GP133',1,'Dispencer');
INSERT INTO notes VALUES ('GP007',1,'Had spent 39 years as an extern servant before she took the habit.');
INSERT INTO notes VALUES ('GP024',1,'Had been an extern servant for 22 years before entry.');
INSERT INTO notes VALUES ('GP078',2,'Greatly valued for her singing. Blind in her last years.');
INSERT INTO notes VALUES ('LA162',1,'Hamilton 257 suggests that she was a cousin of Sister Mary Pole.');
INSERT INTO notes VALUES ('GB044',1,'Examination for clothing marked with a cross: no signature. No references in the Annals to this nun: data above taken from examinations.');
INSERT INTO notes VALUES ('YB055',1,'Great niece of Abbess Butler, Monasticon 1960 p295 Shipwrecked on her way from Ireland to Ypres in 1725 see Nolan 262-3');
INSERT INTO notes VALUES ('YB023',1,'Under her leadership she introduced the convent to the devotion to the Sacred Heart of Jesus: Monasticon 1960 p295. ');
INSERT INTO notes VALUES ('YB015',1,'sister of Elizabeth and Anne');
INSERT INTO notes VALUES ('DB144',1,'Nolan (p54)raises question of whether Mary Ryan is the same person as Mary Joseph O\'Brien who does not appear in the Dunkirk list, although she is mentioned on p30 Dunkirk History as Dame Josepha O\'Bryan. Further investigation suggests this is correct since no further data exists about Josepha O\'Bryan.');
INSERT INTO notes VALUES ('YB006',1,'Nolan 77 describes her as \'extern sister\' and not strictly speaking a member of the community');
INSERT INTO notes VALUES ('OB019',3,'Went to Dublin to establish a convent at request of James II: left following King\'s defeat July 1690: Nolan 149-151');
INSERT INTO notes VALUES ('OB089',2,'Nolan 161 records that she acted as superior while Abbess Butler was absent.');
INSERT INTO notes VALUES ('OB019',4,'On her return from Dublin lived with only 4 lay sisters: received 4 novices 1695 but only 2 stayed and these were not professed until 1700: Nolan 209');
INSERT INTO notes VALUES ('YB053',1,'Recommended by Queen Mary of Modena in 1705: her father followed James II into exile. Nolan 272');
INSERT INTO notes VALUES ('YB054',1,'Most expert at her pen and arithmetic. Procured a gift of 600 from her brother: see Nolan 282');
INSERT INTO notes VALUES ('YB044',1,'Nolan has date of profession 1703 but based on date of clothing it must be 1733. No profession examination image available. CB');
INSERT INTO notes VALUES ('YB002',1,'Examination for profession 1730 3 Apr: Nolan list gives date of profession 6 Nov 1731');
INSERT INTO notes VALUES ('GB203',1,'Described as a recent convert, she was brought from England by Sister Barbara Devery of the Bruges Augustinians, arriving at that convent on 23 June 1720, entering the enclosure in order to discern whether she had a vocation.  She left them on 21 July 1720, conducted to Ghent by, again, Sister Barbara Devery.');
INSERT INTO notes VALUES ('BA124',1,'She was market sister for about 27 years: died as a result of an accidental head injury.');
INSERT INTO notes VALUES ('BA138',3,'On 12 Nov 1720, her widowwed mother retired to the convent bringing her youngest daughter, Ursula Markham, as well as Ann Poulton, with her.  They became pupils at the school (I ann 376).');
INSERT INTO notes VALUES ('BA047',2,'Her sister, Elizabeth, also attended the convent school from 4 Nov 1720, leaving on 27 April 1721 (I ann 376, 384).');
INSERT INTO notes VALUES ('BA047',3,'Another sister, Catherine, came to the convent on 6 Jan 1721 to try a change of air having previously suffered from a fever and lived in a Dutch convent at Poperinge.  She was again advised to change air to aid her recovery and left for a Dutch monastery in Ghent on 10 Mar 1721 (I ann 378, 383).');
INSERT INTO notes VALUES ('BA058',1,'She arrived as a pupil at the school on 31 March 1721, along with Frances Berington, daughter of Sister Frances Clough\'s cousin.');
INSERT INTO notes VALUES ('GP033',2,'Her parentage has been deduced from the details given in the Bruges annals.\r\nOne of her parents was the cousin of Sister Frances Clough.');
INSERT INTO notes VALUES ('GP033',3,'She arrived as a pupil at the Bruges Augustinians\' school on 31 March 1721 with Elizabeth Clough, later a nun there.');
INSERT INTO notes VALUES ('OB014',2,'Following her family obtaining leave from the Archbishop of Rouen that she may leave the impoverished Bellefonds convent, she desired to live under the obedience of her relation, the Reverend Mother of the Bruges Augustinians, which was granted.  Thus, she was given a cell in the dormitory.  There was a distant kinship link through her grandmother, Elizabeth Somerset, but closer through her uncle, Francis Browne, 4th visc Montague, who married Mary Herbert, sister of the reverend mother, Lucy Herbert.');
INSERT INTO notes VALUES ('BA170',3,'On 9 Oct 1721 she arrived at the convent to visit her aunt, Elizabeth Browne, on her way to become a pupil with the Ghent Benedictines.  Through her brother, Lord Montague, Elizabeth convinced Ralph Salvin to let Dorothy remain as a pupil with the Bruges Augustinians.');
INSERT INTO notes VALUES ('OB014',3,'She secured her niece, Dorothy Salvin, as a pupil for the Bruges Augustinians when she visited on 9 Oct 1721.');
INSERT INTO notes VALUES ('BA081',2,'She arrived as a servant on 7 June 1723.');
INSERT INTO notes VALUES ('BA072',5,'She accompanied Elizabeth Browne to the Brussels Benedictines, leaving on 9 July 1723.  She was also supposed to accompany her to the Pontoise Benedictines on 30 Sep 1724 but fell ill so Margaret Linny went in her place.');
INSERT INTO notes VALUES ('BA185',2,'She walked with a limp.');
INSERT INTO notes VALUES ('BA174',1,'She arrived as a pupil for the school on 20 March 1724 and had been accompanied to the convent by Isabella Vendow and Ann Formby.');
INSERT INTO notes VALUES ('BA210',1,'She arrived with Ann Formby on 20 March 1724 as a servant in order to be a lay sister.  Catherine Simner had come with them.');
INSERT INTO notes VALUES ('BA082',2,'She arrived with Isabella Vendow on 20 March 1724 as a servant in order to be a lay sister.  Catherine Simner had come with them.');
INSERT INTO notes VALUES ('BA011',1,'She arrived as a servant on 30 May 1724.');
INSERT INTO notes VALUES ('OB014',4,'On 13 July 1724, she again returned to the Bruges Augustinians, this time because of her weak constitution and the Brussels Benedictines\' refusal to allow her to have a fire.  Lucy Herbert secured permission for her to stay for six weeks while she got permission from her brother to return to her convent at Rouen, where she had been invited to return as abbess.  Nevertheless, she turned the opportunity down.  Her brother, Lord Montague, also wanted her to remain in an English convent rather than a French one and secured from the Archbishop of Rouen that she could go to the Pontoise Benedictines, to which she agreed.  She left on 30 Sep 1724, attended by Sister Margaret Linny.');
INSERT INTO notes VALUES ('GB002',1,'She was a pupil at the school of the Bruges Augustinians, entering on 29 Aug 1724 and leaving for the Ghent Benedictines on 23 May 1726. Jubilarian 1790.');
INSERT INTO notes VALUES ('BA128',2,'Due to Sister Barbara Deverey falling sick, she accompanied Elizabeth Browne to the Pontoise Benedictines, leaving on 30 Sep 1724. Employed as market sister, but had such solid judgement that she was able to speak upon business to the chief of the town: see II ann 163 ');
INSERT INTO notes VALUES ('BA169',1,'She served as the cook, showing a particular talent in that role.');
INSERT INTO notes VALUES ('BA222',5,'On 18 Oct 1725, she left the convent to return to England.  She had a vocation and a very good singing voice, so she went for further training in England as it would help reduce her portion; her father had been badly affected by the South Sea financial difficulties.  The canonesses agreed to this.');
INSERT INTO notes VALUES ('PC128',1,'She visited her dying sister Elizabeth at the Bruges Augustinians in 1735 - she had been convictress there from April 1732 to Dec 1733- and though she wanted to stay she was told she was too frail for religion (Bruges Annals II, 10, 20, 28).');
INSERT INTO notes VALUES ('DB061',1,'She lent a book of the convent\'s plain song to the Bruges Augustinians for them to copy and use at the request of their prioress, Lucy Herbert (Bruges Augs I ann 418-19).');
INSERT INTO notes VALUES ('RP214',1,'Although Isabel Bertley was not professed, the Chronicle uses the title Sister and records her as long term faithful servant. ');
INSERT INTO notes VALUES ('GP204',1,'Served two terms as vicaress. Jubilarian');
INSERT INTO notes VALUES ('RP017',1,'Following the death of his wife, Frances\' father placed her in the convent at three years old and became a Carthusian.  All her siblings entered religion, including the priest John Philip Betts.');
INSERT INTO notes VALUES ('RP016',1,'Following the death of his wife, Ann\'s father placed her in the convent at and became a Carthusian. All her siblings entered religion, including the priest John Philip Betts.\r\n');
INSERT INTO notes VALUES ('RP024',1,'Being too young to be clothed on her arrival in 1658 (with her sister Jane), she was sent to a French convent to learn the language first.');
INSERT INTO notes VALUES ('RP194',3,'Daughter of the 3rd duke of Lennox.');
INSERT INTO notes VALUES ('AP071',1,'Health problems led to postponment both of clothing and of profession. Was first clothed 1697 but sent out of the convent for want of health. Returned and clothed again 1700. Had to leave again in 1702 and spent time with Bernadines at Douay before returning for profession with the Poor Clares: see Register.');
INSERT INTO notes VALUES ('GP057',1,'According to the Aire Register was an outsister at Gravelines before professing as a lay sister at Aire');
INSERT INTO notes VALUES ('GP176',1,'2nd Abbess');
INSERT INTO notes VALUES ('GP221',1,'Note in CRS vol to the effect that she was probably sister of Rev Edward Pickford president of the English College, Lisbon');
INSERT INTO notes VALUES ('RP140',1,'Her father was a benefactor of the house, R chron I 17.');
INSERT INTO notes VALUES ('LA004',5,'According to VCH Essex 8, pp. 186-95, her grandfather James Altham, d. 1583, purchased Mark Hall from Lord Morley. He disinherited his eldest son Thomas because he was a Catholic (Visit. Essex (Harl. Soc. xiv), ii. 538-9; Essex Record Office, T/A 531/1, 2; E.R.O., D/DCw T13; Essex Recusant, v. 86; xv. 5-7;. Mark Hall and the associated estate descended through the issue of Thomas\'s brother Edward (d. 1605).');
INSERT INTO notes VALUES ('AC124',2,'Her father Lionel Wake, who lived in Antwerp, was son of Richard Wake of Hartwell (Stirnet).');
INSERT INTO notes VALUES ('BA042',2,'Father\'s first name supplied from Stirnet. The descent of this family from can be traced through mortgages and other deeds in The national Archives, DG24/277, DG24/286, DG24/327.');
INSERT INTO notes VALUES ('AP023',2,'Served as outsister at Gravelines many years before going to Aire: see Aire register. Obituary notice in register includes her time at Gravelines in calculation of length of religious life.');
INSERT INTO notes VALUES ('GP189',1,' A member of the community that returned to Gravelines in Dec 1814: intro CRS vol p29-30 & Bertrand 226.\r\n\r\nBrought up in the community since she was a child: Bertrand 211');
