INSERT INTO notes VALUES ('CB027',6,'At the invitation of the Bishop of Cambrai assisted Justina Gascoigne in reforming the French convent of St Lazar\'s in the town. She compiled instructions for performing the divine office and guides to devotions for them in French. She was chosen to assist in the foundation of the Paris convent. Wrote the Paris Constitutions 1656: copyist of a number of MSS including Julian of Norwich Showing of Love: see Holloway, \'Colections\' pxvi');
INSERT INTO notes VALUES ('PB027',1,'Scribe of _Colections 1724_ Bib Mazarine MS1202:1 see http://www.umilta.net/coll.html accessed 30/08/2006 and a translation of Blosius');
