INSERT INTO notes VALUES ('CB043',1,'Wolfe (2007) has listed eleven original works written and compiled; transcriptions of twenty five spiritual works as well as maintaining her community\'s register of letters and instructions and emending scribal copies of contemplative treatises: see p158.  The list given above does not include compilations and copies: for these see Wolfe');
INSERT INTO notes VALUES ('PB034',1,'Both parents Protestants. She entered the convent soon after her conversion, but her profession was delayed for 4 years because of the unsettled times: see Eaton p30.');
INSERT INTO notes VALUES ('CB075',1,'Eaton p31 refers to attachment to Catherine Gascoigne, abbess of Cambrai and frequent correspondence between the two.');
INSERT INTO notes VALUES ('PB086',1,'In her term as Prioress the cloister and church were built.');
INSERT INTO notes VALUES ('BD005',1,'baptised in house of lord Middleton of Stockeld: father was master wig maker: see profession enquiry');
INSERT INTO notes VALUES ('BD013',1,'She left Galway in 1717 to found a convent in Dublin.  In 1729, due to ill health, she travelled to Brussels where she stayed with the English Dominicans.  This was only supposed to be temporary but she was soon elected prioress. She then tried to found an Irish Dominican convent in Brussels, returning to Dublin in 1733 to raise funds and recruits. This caused major arguments though by 1737 the fledgling community had rented a property.  By 1739 it had disintegrated and she returned to Dublin. (P Majerus, \'Norfolk\'s Rising Hill in Brussels. Le couvent des dominicaines anglaises  Bruxelles (17ime-18ime sicles)\' in Les Cahiers Bruxellois, 2005, XXXVIII, pp 45-93)');
INSERT INTO notes VALUES ('BD016',1,'At her profession gave the community 4 houses adjacent to convent: see obit in OA 201');
