INSERT INTO notes VALUES ('DP138',1,'Almighty God was pleased to distinguish her from the rest of her family, being the only one that was called to the true faith, a blessing she always expressed a sensible gratitude for, as well as her vocation to holy Religion, for which she always showed a great zeal for the good & prosperity of it, employing every talent for the good of the community, being blessed with a great genious; and being many years Mistress of the Works she greatly improved them, much to the advantage of Religion: she was faithfull to all quire duties till her last sickness which was but a few dayes: She exercised the office of dispencere & Quire Mistress each time three years also that of Woolin Sister fourteen years which she continued to her death;... ob 86');
