INSERT INTO notes VALUES ('BB105',1,'Her father John Kempe of Pentlow\'s widow (his known wife was Eleanor Drew of Devon) remarried to Sir Robert Brook, brother of Alice BB027 and Susan Brook LA041.');
INSERT INTO notes VALUES ('LA041',2,'The Chronicle account of her relationship to the Kempes is confusing; indeed, the relationships in this family are complex. John Kempe of Pentlow\'s widow (his known wife was Eleanor Drew of Devon) remarried to Sir Robert Brook, brother of Alice BB027 and Susan Brook LA041, who were thus step-aunts to Robert\'s step-daughters Frances LA158 and Mary BB105 Kempe. John Kempe\'s son and successor, another John Kempe of Pentlow, married Lucy, sister of Sir Robert Brook, who appears to have been Susan\'s sister. ');
INSERT INTO notes VALUES ('BB027',2,'For the identity of her mother Joan Prannel see Archaeologia Cantiana (1877), pp. 202-3, daughter of London merchant Henry Prannel and sister of the Henry Pranell who was first husband of Frances Howard, later Duchess of Richmond and Lennox.');
