INSERT INTO notes VALUES ('GB173',1,'No other details known: does not appear in convent Annals under this name. However, Joscelin de Percy of Beverley a convicted recusant (Will proved June 4 1653; nephew of the Gunpowder Plotter Thomas), and his wife Elizabeth Fitwilliam of Mablethorpe, Yorks, had a daughter Eleanor known to have married William Ferrand of Westhall, Yorks. According to Dugdale, Visitations of York, they were married c 1662 and she was named heir to her brother Alan in his Will, proved in 1693. Neither left children. William Ferrand is stated in the same source to have been born c. 1635. At his decease in 1652/3 Joscelin was said to have had several young children, although Alan seems to have been of age. None of the children are known to have left issue. The parentage details make it likely that Elinor Percy was Joscelin\'s daughter who left the abbey before profession. If so, the date of her entry given as 1642 is much more likely to have been the date of her birth.');
INSERT INTO notes VALUES ('LA275',1,'no other details known');
INSERT INTO notes VALUES ('LA321',1,'Examination notes that she is an orphan');
INSERT INTO notes VALUES ('LA001',1,'Examination records that she was orphaned at a young age');
INSERT INTO notes VALUES ('GB017',1,'Eleanor Mildmay, the form given for her mother\'s name, appears to be the same person as Helena Lacon of Kinlet, a granddaughter of Anthony Viscount Montacute. Firstly wife of Walter Mildmay and mother of Helen Mildmay AC091, she swiftly remarried after his death to Matthew Bedingfield of Redlingfield, by whom she was mother of AC010, GB017 and GB018. Matthew was living in Brussels in 1646 and subsequently married as his second wife a Flemish lady (Bedingfield Paper,s Genealogical Supplement, CRS Misc.6).');
INSERT INTO notes VALUES ('AC010',1,'Helena Lacon of Kinlet, a granddaughter of Anthony Viscount Montacute, occurs elsewhere as Eleanor Mildmay. Firstly wife of Walter Mildmay and mother of Helen Mildmay AC091, she swiftly remarried after his death to Matthew Bedingfield of Redlingfield, by whom she was mother of AC010, GB017 and GB018.');
INSERT INTO notes VALUES ('GB018',2,'Helena Lacon of Kinlet, a granddaughter of Anthony Viscount Montacute, occurs elsewhere as Eleanor Mildmay. Firstly wife of Walter Mildmay and mother of Helen Mildmay AC091, she swiftly remarried after his death to Matthew Bedingfield of Redlingfield, by whom she was mother of AC010, GB017 and GB018.');
INSERT INTO notes VALUES ('AC091',1,'Helena Lacon of Kinlet, a granddaughter of Anthony Viscount Montacute, occurs elsewhere as Eleanor Mildmay. Firstly wife of Walter Mildmay and mother of Helen Mildmay AC091, she swiftly remarried after his death to Matthew Bedingfield of Redlingfield, by whom she was mother of AC010, GB017 and GB018.');
INSERT INTO notes VALUES ('GP144',1,'Her father, known as Captain Francis Greene, took part in the 1745 Jacobite rising.');
INSERT INTO notes VALUES ('GB023',1,'It is highly likely that she was daughter of one of several Thomas Bodenhams of Rotherwas, and hence kinswoman of two other Benedictines, Mary BB023, and Mary OP010 who was herself daughter of a Thomas Bodenham and Catherine Guildford. With no dating evidence it is impossible to go further.');
