INSERT INTO notes VALUES ('LS019',1,'Her father Richard Billinge of Billinge in Haydock, Lancs, recorded the pedigree in the 1665 Visitation (VCH Lancs 4, p. 83-7). His son John, born c. 1648, married Margaret Bradshaw.');
