INSERT INTO notes VALUES ('PC109',1,'Her mother was governess to the princess, Louisa Maria Teresa Stuart, daughter of James II. Her father was commissioner of James II\'s household.');
INSERT INTO notes VALUES ('CB115',1,'The husband of Bridget Crosland was Philip Langdale of Langthorpe. One of their sons was named Marmaduke. See English Catholics 1715, p. 301.');
INSERT INTO notes VALUES ('DB003',1,'Parents identified in Burke\'s Commoners as William Acton of Wolverton (d. 1725) and his wife Margaret Perkins. William was son of William Acton (d. 1679) and Barbara Vincent of Gray\'s Inn. There were four nuns in earlier generations of that family, BF002, BF003, LS001 and BF001.');
INSERT INTO notes VALUES ('DB002',1,'Parents identified in Burke\'s Commoners as William Acton of Wolverton (d. 1725) and his wife Margaret Perkins. William was son of William Acton (d. 1679) and Barbara Vincent of Gray\'s Inn. There were four nuns in earlier generations of that family, BF002, BF003, LS001 and BF001.');
INSERT INTO notes VALUES ('BF272',2,'Perhaps also sister of Anne, PA195.');
INSERT INTO notes VALUES ('LA243',1,'Charlotte was daughter of Nicholas Errington Stapleton and his second wife Mabel Bagenall,according to Foster\'s Pedigrees of Yorks, ii, Stapleton of Carleton, which, however, dates the marriage to 1722. The obit date of Nicholas\'s first wife Charlotte Eure is not given. Charlotte is mentioned in the Will of his stepmother Mary Sandys in 1735 (Records of the English Catholics 1715, p. 80). Convent records refer to Caroline rather than Charlotte');
INSERT INTO notes VALUES ('PA157',1,'Likely to be half-sister of Charlotte LA243.');
INSERT INTO notes VALUES ('PA192',2,'In his Will her father left for a marriage portion to his daughter Apollonia 2000 and to her sisters Elizabeth and Mary 1500, provided that none of them should leave England; if any of them left under the age of 21 her portion should be divided amongst the rest. The Will was amended to show that Apollonia had left, under the age of 21, and professed as a nun in 1701 (Records of English Catholics 1715, p116).');
INSERT INTO notes VALUES ('BF158',2,'John Taafte swore an oath in 1717 that Catherine sister of the late William Massy of Puddington, Cheshire, had been a Poor Clare at Bruges for many years (Records of English Catholics 1715, p. 121). This fits the bill for Catherine Massy and hence provides the names of her parents from the established Massy genealogy. The same source, p.95) says the Will of William Massy left 500 to his sister, a professed nun at Douay, plus gifts to several priests).');
INSERT INTO notes VALUES ('RP128',1,'Probably elder sister of Anne BF167 and Dorothy CB133, daughters of Francis Moore of Fawley and his wife Frances Jermyn.');
INSERT INTO notes VALUES ('PB020',2,'Mother\'s name given in Durham Visitation Pedigrees.');
INSERT INTO notes VALUES ('LS133',1,'She was accepted wihout a dowry because of her musical abilities, particularly playing the lute and the organ, as well as singing.');
INSERT INTO notes VALUES ('LA030',1,'This is Mary Best the elder: see Hamilton Vol II 13. \'She was a good and virtuous religious, very fervent in devotion even from her first conversion, and when she was a Protestant she was devout in that religion.\'');
INSERT INTO notes VALUES ('LA055',1,'Parents died when girls were very young and they were brought up by their nurse at \'Millous\', Sussex among Protestants. Around age 12 they were sent to live with their grandmother Wybourn (who had Bedingfield connections) at Redlingfield, Suffolk, where they were converted. Later they were sent to Mr Matthew Bedingfield in Brussels and eventually after several further moves joined St Monica\'s: see Chronicle.');
INSERT INTO notes VALUES ('LA054',1,'Parents died when girls were very young and they were brought up by their nurse at \'Millous\', Sussex among Protestants. Around age 12 they were sent to live with their grandmother Wybourn (who had Bedingfield connections) at Redlingfield, Suffolk, where they were converted. Later they were sent to Mr Matthew Bedingfield in Brussels and eventually after several further moves joined St Monica\'s: see Chronicle. The Chronicle describes her sister Mary as a convert so Margaret probably was also.');
INSERT INTO notes VALUES ('LA110',1,'1642: \'This year also Mr Gillibrand sent us aforehand half of his 2 daughters portion, 4 hundred pound.  They were then novices, & the rest was, according to our agreement, to have sum upon rent there untill he should pay in the full portion, which was as much more 4 hundred pound, but this rent faild afterwards like the rest for som 12 years til tims were more quiet, he paid in the rest in the year 1655\': see Chronicle 481. ');
