INSERT INTO notes VALUES ('LA115',1,'1777 Letter from Abbess of Benedictine convent Brussels re this candidate & her lack of parental consent. Draft of response on same sheet explaining the views of the ecclesiastical authorities on the essential requirement of parental consent and the dangers to the community of not following correct procedures.  1777 22 Dec Letter from Marina Smith, Prioress Augustinians Louvain seeking advice regarding this candidate who had made several attempts to join a convent against the wishes of her father. She had returned to London with him but he had left her with very little money. She had returned to Louvain and asked to be admitted there. Draft of reply advising of importance of parental consent. Archive contains examination for clothing 1778 23 Jun.');
