INSERT INTO notes VALUES ('MW046',2,'There is a difficulty with the  parents as given in CRS 4. Thomas Clifton of Westby Lancs, husband of Mary Molyneux, was born in 1696; Mary\'s own parents married c. 1704/5. Eleanor was possibly sister of this Thomas and hence daughter of Thomas Clifton of Westby (d. 1720), recusant, husband of Eleanor Alathea Walmesley, who certainly had several daughters, some nuns, including GP072 and GP078: see Stirnet. CB & KKR');
