INSERT INTO notes VALUES ('GP062',2,'The outlines of her parentage are given in her obit in the Chronicle. It has some support from William Blundell, Crosby records : A Cavalier\'s note book being Notes, anecdotes, & observations of William Blundell, of Crosby, Lancashire, esquire, p. 164. Her father was a judge (Deempster) in the Isle of Man, possibly John Cannell who occurs in 1643. The family was persecuted as the only Catholics in the area and Henrietta was brought up largely by her grandmother Hesketh, her mother (daughter of a Thomas Hesketh of Meols) having at least 9 or 10 children. According to the notes to Crosby records, at least five of the children went into religion. Given the closeness in dates of the four Cannel(l) nuns, it is likely that all four were sisters.\r\n\r\n');
INSERT INTO notes VALUES ('GP061',1,'For parentage see William Blundell.\r\nCrosby records : a cavalier\'s note book being notes, anecdotes, & observations of William Blundell, of Crosby, Lancashire, esquire, p. 164. She had five children in religion abroad, so this nun can be fairly safely assumed to be sister of Henrietta GP062. See the commentary there.');
