INSERT INTO notes VALUES ('DB144',2,'Dunkirk was considered by some to be an unhealthy place, and discussions about moving were held. Mary Joseph Ryan was among those who suggested looking for Irish candidates to keep the convent at Dunkirk. They obtained permission to leave & stopped at Ypres (1682) on the way to England. They spent several months in England before returning to Ypres. She joined a delegation in Paris to negotiate for a new convent for the Irish at Ypres but this failed. In 1683 with three others (Ursula & Mary Joseph Butler & Christine White) she entered Ypres. M J Ryan went to Ireland with Ursula Butler to fetch candidates & money returning to Ypres in 1684. In 1685 she returned to Ireland settling in Dublin where she wished to establish a convent & school. During this period there were disputes regarding the authority of Abbess Mary Joseph Butler which were finally smoothed over. Mary Joseph Ryan opened a convent in Channel Row in 1687. Following the accession of William III conditions were challenging and she returned to Dunkirk.  ');
