INSERT INTO notes VALUES ('BB119',3,'She and her sisters were beneficiaries of the Will of their \'cousin\' Benedict Conquest of Irnby, proved in 1761.');
INSERT INTO notes VALUES ('GB150',1,'\'borne in England and delivered from her Nurce into the hands of Catholike Gentlewomen at Hammersmith near London\': (ie Mary Ward Sisters)see Examination for Clothing 1696');
INSERT INTO notes VALUES ('PA197',2,'She arrived at the convent school on 9 Aug 1697 with her sisters Elizabeth and Mary, having been met by their uncle, Robert, at Bruges.');
INSERT INTO notes VALUES ('GB169',1,'No other details known: does not appear in convent sources');
INSERT INTO notes VALUES ('GB162',1,'no other details known: does not appear in convent sources');
