INSERT INTO notes VALUES ('GB194',1,'No convent sources known under this name');
INSERT INTO notes VALUES ('GB230',1,'Eugenia listed in Annals 201 is probably this sister: professed before 1729');
INSERT INTO notes VALUES ('GP046',1,'Bertrand, 1857, p94 makes incorrect family links between the Bradshaighs.');
INSERT INTO notes VALUES ('GP048',1,'Bertrand 94 makes incorrect family links between the Bradshaighs.');
INSERT INTO notes VALUES ('GP047',1,'Bertrand 94 makes incorrect family links between the Bradshaighs.');
INSERT INTO notes VALUES ('PA019',2,'Her cousin, Winefride Browne, was later buried in the same grave.');
INSERT INTO notes VALUES ('PA070',1,'She had been housekeeper to the Prince of Wales, James Francis Edward Stuart.');
INSERT INTO notes VALUES ('GP181',1,'A member of the community that returned to Gravelines in Dec 1814: intro CRS vol p29-30 & Bertrand 226.');
INSERT INTO notes VALUES ('GP191',1,'A member of the community that returned to Gravelines in Dec 1814: intro CRS vol p29-30 & Bertrand 226.');
INSERT INTO notes VALUES ('GP144',2,'A member of the community that returned to Gravelines in Dec 1814: intro CRS vol p29-30 & Bertrand 226.');
INSERT INTO notes VALUES ('GP060',1,'It is most probable that she is Susanna Campion');
INSERT INTO notes VALUES ('AP107',2,'Jubilarian');
INSERT INTO notes VALUES ('AP037',1,'On fragment of paper she recorded: \'on the 27th of June 1798 about 10 oclock at night we were all turned out of our beloved convent by the wicked French, we remained in the town in different houses till the 4th of September 1799, then we set off for Calais: we were detained there till the 10th, on which evening we took shipping for England. We landed at Dover at 9 oclock in the morning the 11th. 12 of us arrived in London the 13 & the rest on the 14. We remained a month in London, then we went to Britwell & staid there till the year 1813\'.');
INSERT INTO notes VALUES ('DP055',1,'Parents given in Foster family ms pedigree at convent');
INSERT INTO notes VALUES ('DP054',1,'Parents given in Foster family ms pedigree at convent');
INSERT INTO notes VALUES ('AP088',1,'10th Abbess');
INSERT INTO notes VALUES ('AP096',1,'8th Abbess');
INSERT INTO notes VALUES ('AP114',1,'7th Abbess: name in baptism as given in profession list in Aire Register');
INSERT INTO notes VALUES ('AP053',1,'5th Abbess');
INSERT INTO notes VALUES ('GP109',2,'3rd Abbess. There was a gap in her service as Abbess: in this period Frances Golding was Abbess. ');
INSERT INTO notes VALUES ('GP233',3,'1st Abbess Aire');
INSERT INTO notes VALUES ('AP128',1,'12th Abbess: appear to be no professions attached to her name: abbess for 13 months');
INSERT INTO notes VALUES ('AP138',1,'16th Abbess? Appear to be no professeions attached to her name: abbess for two years.');
INSERT INTO notes VALUES ('LB153',1,'Abbess three times.');
INSERT INTO notes VALUES ('PA074',2,'Her father was buried in the convent church.\r\nExtract from ODNB entry for Sir Edward Hales:Hales\'s conversion exposed the breakdown of his marriage. He kept his apprehensive wife in a Paris convent for two years from 1686. Several, perhaps all, of his children, however, followed him in turning Catholic.');
INSERT INTO notes VALUES ('LA069',2,'The choice of the nuns fell on her as Prioress in 1635, but the episcopal visitor rejected their choice on account of her age; she was 28: see Monasticon, 1978 p1151.  ');
INSERT INTO notes VALUES ('PA192',3,'She attended the convent school, arriving on 25 Nov 1695.');
INSERT INTO notes VALUES ('PA038',1,'Her parents requested that her profession be deferred, claiming that they wanted to wait until the convent\'s discussions were settled.  Her mother returned to the convent on 8 July 1696 to say things were ready for the profession to proceed.');
INSERT INTO notes VALUES ('PA088',1,'She arrived at the convent on 8 March 1696.');
INSERT INTO notes VALUES ('PA140',1,'She attended the convent school and was sent to a French convent, presumably to learn that language, on 19 March 1696.');
INSERT INTO notes VALUES ('OB002',2,'She attended the school run by the Paris Augustinians, leaving them in June 1696.  Her father continued to have dealings with the convent such as on 8 and 10 Feb 1699, and 1 Jan 1700.');
INSERT INTO notes VALUES ('GB108',1,'Mother\'s surname is probably Braybrook, a family from Abingdon in Berkshire. The name Humphrey is common amongst the Berkshire Hydes.');
INSERT INTO notes VALUES ('DB170',1,'Her father was leading Roman Catholic conveyancer and legal adviser of his day. He acted as agent for four convents, all closely connected, like him, with the Jacobite cause, the Benedictines of Dunkirk and Brussels, the Dominicans of Brussels and the Augustinians at Louvain. Four of his surviving six children entered religious orders. See R. G,. Williams, ODNB.');
INSERT INTO notes VALUES ('LB171',1,'Possibly a daughter of William Witham, grandson of George Witham of Cliffe who acquired an estate at Preston where the family built Preston Hall, conveyed to George\'s grandson in 1702, who sold it in 1722. He was married to Anne Lawson in 1707 and was grandfather of Frances Witham (LA305).');
INSERT INTO notes VALUES ('PA175',1,'She is likely to have been a niece of Agatha Tourner (PA173) and Ann Tourner (PA174).');
INSERT INTO notes VALUES ('AP128',2,'Joined Bruges Augustinians as convictress in 1705 and left 10 Sep 1708 to join the Poor Clares. The Annals record her joining Gravelines, but the Poor Clare records show her professing at Aire. Annals report her mother as second wife of William Sykes, no name given.');
INSERT INTO notes VALUES ('BA228',2,'Celebration of jubilee Annals 242. ');
INSERT INTO notes VALUES ('BD023',3,'Bruges Annals Vol I p274 reports that her sister Anne left the Augustinian school, Bruges in April 1710 because of ill health and her father moved her to Brussels to see if her health would improve. p212 records that it did not and she died before 1718. ');
INSERT INTO notes VALUES ('PA060',1,'She accompanied Mary Hunt to St Germain on 8 Aug 1696, returning on 15 Aug with her.');
INSERT INTO notes VALUES ('GB019',3,'She was a convictress with the Augustinians Bruges and was sent to Ghent to learn French: while she was there she decided to join the English Benedictines: see Bruges Annals Vol I p278');
INSERT INTO notes VALUES ('PA109',2,'She received the veil from Mary Stafford in the place of James II\'s daughter, Princess Louisa Maria Teresa Stuart.  Mary Stafford (nee Southcote) was governess to the princess.  Her husband was John Stafford-Howard, commissioner of James II\'s household.  Their daughters, Louisa and Beatrix Stafford joined the Paris Conceptionist convent.');
INSERT INTO notes VALUES ('PA154',2,'She entered as a pensioner for the second time on 15 Nov 1696 (pd).');
INSERT INTO notes VALUES ('PA088',2,'She was accompanied by Betty Floyd to St Germain on 8 Aug 1696, returning on 15 Aug with her.');
INSERT INTO notes VALUES ('BA106',3,'Arcaria 1713: Jubilarian 1714');
INSERT INTO notes VALUES ('AC015',3,'Bruges Annals 308 refers to a cousin who was permitted to enter Antwerp at the same time.');
INSERT INTO notes VALUES ('BA205',1,'Entered the convent originally as a servant before becoming a lay sister. Died of small pox: I annals 445.');
INSERT INTO notes VALUES ('AC147',1,'Abbess Herbert took an interest in Mrs Mackenzie and helped her to find a convent that would accept her by providing her with a dowry (50 left by Lady Carrington): the Bernadines of Spermallie.');
INSERT INTO notes VALUES ('RP217',1,'She was accompanied by the convent\'s confessor, Mr King, to the Paris Augustinians, where she became a pensioner on 18 Jul 1697, heading to England on 23 Jun 1698.');
INSERT INTO notes VALUES ('PA199',2,'She arrived at the convent school on 9 Aug 1697 with her sisters Elizabeth and Dorothy, having been met by their uncle, Robert, at Bruges.');
INSERT INTO notes VALUES ('PA128',2,'She received the body of her brother, Edmund Perkins, to be buried in the convent church on 16 Aug 1697.  He had been under-governor to the Prince of Wales, James Francis Edward Stuart.');
INSERT INTO notes VALUES ('PA132',1,'Her father became a Jesuit laybrother after her mother\'s death.  The convent sung a requiem Mass for him on 8 Feb 1698.');
INSERT INTO notes VALUES ('BF202',1,'Single reference to this nun professed at the Franciscan convent Valenciennes brought in at the foundation to provide experienced leadership as with other foundations.');
INSERT INTO notes VALUES ('BF042',1,'Came from St Jacob\'s convent Ghent to assist with the foundation and to act as Abbess until a suitably qualified English candidate was found. Her name appears underwriting the professions of August 1622. ');
INSERT INTO notes VALUES ('BA120',1,'MASON MJ\r\n    Nuns of the Jerningham Letters: Elizabeth Jerningham 1727-1807 & Frances Henrietta Jerningham 1745-1824 Augustinian Canonesses of Bruges /MJ Mason\r\n    Recusant History  22 n3  (1995)  35-369');
