INSERT INTO notes VALUES ('BA122',3,'MASON MJ\r\n    Nuns of the Jerningham Letters: Elizabeth Jerningham 1727-1807 & Frances Henrietta Jerningham 1745-1824 Augustinian Canonesses of Bruges /MJ Mason\r\n    Recusant History  22 n3  (1995)  350-369');
INSERT INTO notes VALUES ('BA121',2,'MASON MJ\r\n    Nuns of the Jerningham Letters: Elizabeth Jerningham 1727-1807 & Frances Henrietta Jerningham 1745-1824 Augustinian Canonesses of Bruges /MJ Mason\r\n    Recusant History  22 n3  (1995)  350-369');
INSERT INTO notes VALUES ('BA120',2,'Mason p350 records Henry\'s occupations in London as artist, engraver, jeweller and goldsmith of Russell Street, London: wife was daughter of a London merchant.');
INSERT INTO notes VALUES ('BA121',3,'Mason p350 records Henry\'s occupations in London as artist, engraver, jeweller and goldsmith of Russell Street, London: wife was daughter of a London merchant.');
INSERT INTO notes VALUES ('BA122',4,'Mason p350 records Henry\'s occupations in London as artist, engraver, jeweller and goldsmith of Russell Street, London: wife was daughter of a London merchant.');
INSERT INTO notes VALUES ('OB069',3,'MASON MJ Nuns of the Jerningham Letters: Elizabeth Jerningham 1727-1807 &  Frances Henrietta Jerningham 1745-1824 Augustinian Canonesses of Bruges /MJ Mason Recusant History 22 n3 (1995) 350-369 see note 9 p365');
INSERT INTO notes VALUES ('BA145',2,'F Young, Mother Mary More and the Exile of the Augustinian Canonesses ...1794-1802,  Recusant History v 27 n1, 2004\r\n');
INSERT INTO notes VALUES ('BA145',3,'Wrote 20 letters to her nephew Thomas Waterton of Walton Hall, Yorkshire 1779-91: see Julia Blackburn, Charles Waterton 1782-1865, Traveller and Conservationist, London Bodley head, 1989, p9');
INSERT INTO notes VALUES ('BA190',2,'Perhaps you have heard of the step one of our community has taken, Sister Alipia Talbot, sister to Lord Shrewsbury. Between you and me it has not surprised any of us as for some years there has appeared a great oddity in her. She has resolved and gone to the Poor Clares of Graveline, who lives now at Gosfield, and she intends to enter their order. I pity the community, for I shall not be surprised any day to hear she is quite crazy poor thing. Reverend mother had done all in her power to keep her but all in vain... from a letter from Sister Sales to Lady Jerningham Jan 1803. Quoted in MASON MJ Nuns of the Jerningham Letters: Elizabeth Jerningham 1727-1807 &  Frances Henrietta Jerningham 1745-1824 Augustinian Canonesses of Bruges /MJ Mason Recusant History 22 n3 (1995)p360 fn 62 suggests Sister Alipia left the Gravelines community and joined the Rouen community at Haggerston where she died.');
INSERT INTO notes VALUES ('BA071',2,'Remained at Bruges when the rest of the community came to England. II ann 10 refers to her mother as the daughter of lord Strangford.');
INSERT INTO notes VALUES ('BA003',2,'Lost her reason 25 years after her profession; \'nevertheless her raving was all pious\'. See I annals 404 ');
INSERT INTO notes VALUES ('BA239',1,'Came as a servant and took the scholar\'s kerchief the following year. The annals (p191) comments that she obtained this privilege by importunity & fair promises for her conduct whilst a servant did not give satisfaction in regard of religious duties: II ann 191. She was taken in although not English because of a shortage of lay sisters and health problems among the English.');
INSERT INTO notes VALUES ('BA099',2,'Jubilarian 1731');
INSERT INTO notes VALUES ('BA050',1,'Seized with madness the second year after her profession and continued in that afflicting state till deth: see II ann 4');
INSERT INTO notes VALUES ('BA209',1,'Was sent to the school when aged 10, but her father recalled her two years later. She remained with her family for 13 years. Visited the Carmelites at Lierre where she had a relative, but was advised to join her first place, the Augustinians. Thought to have died of spotted fever.');
INSERT INTO notes VALUES ('BA199',1,'Jubilarian 1734');
INSERT INTO notes VALUES ('BA107',1,'Problems over the independence of her profession are indicated in the obituary of her given in the annals 24-6: ...\'Some time before her death she told one of our religious that she did not now repent her being a religious, and if it ware againe to do, it should be her own choice: that it was not so her first coming was wholly unknown to ye comunity tell after her \r\nprofession or she would never have been professed here.\'\r\n');
INSERT INTO notes VALUES ('BA222',7,'Her voice was judged to be one of the best they had ever heard even by experts.');
INSERT INTO notes VALUES ('BA047',4,'caught small pox and died within a very short time');
INSERT INTO notes VALUES ('BA219',1,'Jubilarian 1737. Parents given in convent pedigree of Widdrington of Cheesburn Grange: described as \'tentative\'. CB');
INSERT INTO notes VALUES ('PC109',3,'She appears to have received the sacrament of confirmation from the Paris archbishop in his own private chapel on 18 Mar 1708 (Paris Augs pd).');
INSERT INTO notes VALUES ('OB067',2,'Mentioned as his sister Marina in his Will by Sir Thomas Windsor Hunloke, who also names his daughter Marina (Rec. Eng. Catholics 1715 p 11).');
INSERT INTO notes VALUES ('LS054',1,'From a minor gentry family that owned the estate of Cufaude or Cuffold in Basing, Hants, from the sixteenth century until 1732 (VCH Hants vol 4, 115-27). Matthew was succeeded by his brother John who died at an advanced age in 1701, when the estate seems to have passed to a distant relative before being sold. Matthew may also have been the father of two other Cuffaud nuns, RP059 and RP060.');
INSERT INTO notes VALUES ('GP189',2,'Elected Abbess while the community was at Gosfield. Bertrand explains that she remained friendly with the French royal family including the duchesse d\'Angouleme and Mgr Louis-Joseph de Bourbon, prince de Conde');
INSERT INTO notes VALUES ('GP172',1,'Returned to Gravelines with the community 1814 Dec: see Bertrand 226');
INSERT INTO notes VALUES ('RP112',1,'Reference in Bertrand 241 to correspondence between Mary Anastasia Lancaster & Mary Anna Innes of Poor Clares Rouen then at Scorton with Mary Martin ending in 1820. Bertrand suggests that although they wanted to visit Gravelines age and infirmity prevented them doing it.');
INSERT INTO notes VALUES ('OB068',1,'Reference in Bertrand 241 to correspondence between Mary Anastasia Lancaster & Mary Anna Innes of Poor Clares Rouen then at Scorton with Mary Martin ending in 1820. Bertrand suggests that although they wanted to visit Gravelines age and infirmity prevented them doing it.');
INSERT INTO notes VALUES ('GP189',3,'Reference in Bertrand 241 to correspondence between Mary Anastasia Lancaster & Mary Anna Innes of Poor Clares Rouen then at Scorton with Mary Martin ending in 1820. (see R chron III p47 for confirmation) Bertrand suggests that although they wanted to visit Gravelines age and infirmity prevented them doing it.');
INSERT INTO notes VALUES ('LA122',1,'Property of father also known as Wollas Hall, Eckington');
INSERT INTO notes VALUES ('PC107',3,'1788 10 Apr left the convent\'by her own desire, tho\' contrary to the wishes of the Community, who wou\'d have been glad she had corrected herself at home...\' obtained permission from the Archbishop who sent her to the Ursuline convent at Argenteuil: see p186.  Mason 1998 p91 describes her mental health after 1780 as \'uncertain\' and she was subject to fits of violence. She went to live with the Ursulines of Argenteuil, however after the riots of 1791 she returned to live with her community. She petitioned to live with the English Benedictines in Paris while living with the Augustinian Orphelines de l\'Enfant Jesus. She was also in touch with the Augustinian canonesses.');
INSERT INTO notes VALUES ('PA088',4,'According to the diurnal, she was cousin to Catherine Clarkson and Ann Bass of the same convent.');
INSERT INTO notes VALUES ('GP054',1,'Richard Hitchmouth deposed in October 1716 that he had seen Lawrence Breers officate as a priest and that his sister Catherine was a nun at Gravelines; both of them drew income from the estate of Walton Hall, near Liverpool (Rec. Eng. Catholics 1715, p121-2).');
INSERT INTO notes VALUES ('DP019',1,'Probably sister of Dorothy DP018 who entered at the same time. Possibly nieces of France OB147, daughter of Dorothy Bolney, and more distant kin to two Bolneys of an earlier generation OB011 and OB012.');
INSERT INTO notes VALUES ('BA101',6,'Professed 26 religious for the choir, and 15 lay sisters: buried 45 nuns and 11 lay sisters: see II ann 94.');
INSERT INTO notes VALUES ('BA071',3,'Decided to discontinue the practice of having seculars living in the convent: II ann 96 Had professed 17 for the choir and 4 lay sisters and buried 15 religious and 7 lay sisters: II ann 168');
INSERT INTO notes VALUES ('PA108',2,'She visited the convent between 15 and 30 Apr 1698, coming from St Germains.');
INSERT INTO notes VALUES ('PA198',1,'Her brother, Thomas, was preacher royal in England under James II and superior of the Paris seminary (he visited after her death on 30 May 1698: pd). Her cousin, George, was vicar apostolic to the northern district. Another cousin, Robert, was vicar-general for the same district before being elected president of Douai College (odnb).');
INSERT INTO notes VALUES ('BA203',1,'Jubilee 1761');
INSERT INTO notes VALUES ('BA085',2,'Jubilee 1762');
INSERT INTO notes VALUES ('PA179',3,'She succeeded Eugenia Perkins as superior, Perkins advising the sisters to elect her.');
INSERT INTO notes VALUES ('PA060',2,'She accompanied Mistress Katherine Salvin to St Germains to be touched by the King on 12 Aug 1698, returning on 16 Aug.');
INSERT INTO notes VALUES ('PA094',1,'She accompanied two pensioners, Katharine Browne and Anne Roper, who were both suffering from a form of \'paralytic humour\', to the Bourbon waters in an effort to cure or ease their pains on 16 Jan 1699.  She returned with Anne Roper on 20 May 1699.');
INSERT INTO notes VALUES ('BA189',5,'Jubilee 1767');
INSERT INTO notes VALUES ('BA239',2,'1768 Jun voting on her status held a month early: she was voted out as being unsuited to the religious life.');
INSERT INTO notes VALUES ('PA051',2,'She arrived at the convent on 5 Jun 1699, brought there by her uncle, Mr Ireland, a Jesuit.');
INSERT INTO notes VALUES ('PA096',2,'She celebrated her jubilee on 30 Jun 1699.');
INSERT INTO notes VALUES ('PA060',3,'Her sister, Dorothy, visited the convent on 30 Jun 1699.  On 13 Jul she accompanied her sister to St Germains where she was to wait upon Elizabeth Martinash, mother of Mary, Barbara and Anne Martinash, and nurse to Louisa Maria Teresa Stuart, daughter of James II. She returned on 16 Jul.  Dorothy was again present on 17 Aug 1699.');
INSERT INTO notes VALUES ('PA060',4,'She acted as \'market-woman\' for the convent.');
INSERT INTO notes VALUES ('BA090',1,'Family relationship given in annals');
INSERT INTO notes VALUES ('BA151',3,'Not allowed to profess at the usual time because of Imperial edict requiring candidates to be 25. She was given the privileges of being professed apart from the veil: II ann 220');
INSERT INTO notes VALUES ('BA150',2,'Had to delay profession because of Imperial edict requiring candidates to be 25: see II ann 223.');
INSERT INTO notes VALUES ('PA070',2,'She went to St Germains on 7 Sep 1699.');
INSERT INTO notes VALUES ('PA180',3,'On 8 Oct 1699 she accompanied Elizabeth Molyneux, seemingly a pupil at the school who had small pox, to the sick room in order to care for her.');
INSERT INTO notes VALUES ('PA173',2,'Services were said to her father shortly after his death, 26-27 Oct 1699.');
INSERT INTO notes VALUES ('PA174',1,'Services were said to her father shortly after his death, 26-27 Oct 1699.');
INSERT INTO notes VALUES ('BA026',1,'Jubilee 1784');
INSERT INTO notes VALUES ('BA192',1,'Jubilee 1791');
INSERT INTO notes VALUES ('BA108',1,'Placed in rank of professed 1790 because she was affected by the decree forbidding profession until age 25: II ann 220');
INSERT INTO notes VALUES ('PA192',4,'Some claimed she had been forced to profess against her will, something she denied (pd 2 Dec 1699) though this was resolved (31 Mar 1700).');
INSERT INTO notes VALUES ('PA026',1,'On 6 Dec 1699 she went to the house at the end of the garden with Mary Bernard Perkins to care for Mistress Casy, seemingly a schoolgirl, who was suffering from small pox.');
INSERT INTO notes VALUES ('PA131',1,'On 6 Dec 1699 she went to the house at the end of the garden with Elizabeth Bromich to care for Mistress Casy, seemingly a schoolgirl, who was suffering from small pox.');
INSERT INTO notes VALUES ('PA108',3,'Her mother brought her to the convent as a pensioner 15-16 Dec 1699.  She returned to the court on 31 Dec (returned 4 Jan 1700) to say goodbye to her friends and to kiss the hands of the queen and princess, as she had resolved to become a religious.');
INSERT INTO notes VALUES ('PA060',5,'On 19 Dec 1699, she went to collect a new schoolgirl, Helen Eyre, who had been sent from England to St Germains.  She returned with her the next day.');
INSERT INTO notes VALUES ('PA169',4,'She arrived as a pensioner at the school on 3 Jul 1700.');
INSERT INTO notes VALUES ('PA026',2,'Her uncle was a priest trained at the English College in Lisbon, Mr Daniel Fitter, who showed kindness towards the convent (8 Jul 1700).');
INSERT INTO notes VALUES ('PA008',1,'According to the diurnal, she was cousin to Mary Hunt of the same convent (pd 30 Oct 1700).');
INSERT INTO notes VALUES ('PA034',1,'According to the diurnal, she was cousin to Mary Hunt of the same convent (pd 30 Oct 1700).');
INSERT INTO notes VALUES ('PC005',2,'Mason (1998)records that she was received into the church at the Blue Nuns\' convent 1768 10 Aug. She was living in Reading in 1816.');
INSERT INTO notes VALUES ('PA205',2,'She seems to have had leave to visit and stay at a different convent with Mary Roper c.1706-7 (pd 15 Jan 1707; 16 Jun 1707; 9 Jun 1708).');
INSERT INTO notes VALUES ('PA139',1,'She seems to have had leave to visit and stay at a different convent with Mary Yate c.1706-7 (pd 15 Jan 1707; 16 Jun 1707; 9 Jun 1708).  Due to parts of the diurnal missing it is difficult to discover the reason though a clue seems to be a letter  wanting an appartment built over the still-house for her use, with a tribune which should have a view into the church for conveniently hearing the Office and assisting at Mass (pd 10 Jan 1708).');
INSERT INTO notes VALUES ('PA026',3,'Her brother, Andrew Bromich, was trained as a priest at the Lisbon College (pd 10 Feb 1707).');
INSERT INTO notes VALUES ('LA251',1,'Letter re Mary Benedict\'s death in Rackett papers, D/RAC in Dorset History Centre under D/RAC/85');
INSERT INTO notes VALUES ('BA036',1,'Jubilarian 1794');
INSERT INTO notes VALUES ('BA015',1,'Considered too frail to travel in June 1794 and remained at Bruges. Great skill in plainsong. ');
INSERT INTO notes VALUES ('BA240',1,'Announced that she would not be leaving with the community in Jun 1794: the Prioress required her to leave the habit.');
INSERT INTO notes VALUES ('BA233',1,'Was the last to arrive in Norfolk and her arrival made the community complete 27 November 1794: II ann 34 Like Augustina Webster had been unsettled by the journey and was making life very difficult for her novice mistress: was told she would have to pass another year as a novice and decided to re-enter Nov 1794: III ann 41. She continued to find religious life difficult and was seen as too independent and disobedient. \'Her departure was a great solace to Reverend Mother.\' See III ann 66');
INSERT INTO notes VALUES ('PA051',3,'On 14 Jun 1707 she returned from Louvain in order to enter religion.');
INSERT INTO notes VALUES ('BA090',2,'Elected Arcaria 1794');
INSERT INTO notes VALUES ('PA200',2,'Her sister, Ann, arrived at the school on 15 Jul 1707.');
INSERT INTO notes VALUES ('BA234',1,'Had become unsettled by the journey to England and was told by the Prioress that she would have to repeat her noviceship. She appeared to accept this at first, but after 3 months decided to leave. Had been in the habit for four years: III ann 40');
INSERT INTO notes VALUES ('PA110',1,'A service was said for her recently dead father on 17 Aug 1707 (pd).');
INSERT INTO notes VALUES ('PA180',4,'She painted highly detailed pictures of the four evangelists and St Augustine on a very fine cope given by Dorothy Tarleton c.1777 (pd 23 Aug 1707).');
INSERT INTO notes VALUES ('PA108',4,'Her brother was a Jesuit (pd 1 Sep 1707).');
INSERT INTO notes VALUES ('PA107',2,'Her brother was a Jesuit (pd 1 Sep 1707).');
INSERT INTO notes VALUES ('PA109',3,'Her brother was a Jesuit (pd 1 Sep 1707).');
INSERT INTO notes VALUES ('BA120',3,'Chantress from her youth and taught plain song to the young ones: procaturess for twenty years at different times: III ann 91-2');
INSERT INTO notes VALUES ('PA203',2,'She embellished a part of the choir which housed a statue of the Virgin Mary with angels and crowns, making all the guilding and several other things at the request of Helen Fairfax (pd 20 Nov 1707).');
INSERT INTO notes VALUES ('PA054',1,'She instructed Anna Yate to make the guilding for part of the choir around a statue of the Virgin Mary.  She herself made a canopy to cover the statue, along with many other things (pd 20 Nov 1707).');
INSERT INTO notes VALUES ('PA181',2,'She received the veil from the queen, Mary of Modena.');
INSERT INTO notes VALUES ('PC109',2,'Her mother acted in the place of James II\'s daughter, Princess Louisa Maria Teresa Stuart, giving the veil to Mary Martinash of the Paris Augustinians.');
INSERT INTO notes VALUES ('PC110',2,'Her mother was governess to the princess, Louisa Maria Teresa Stuart, daughter of James II. Her father was commissioner of James II\'s household.');
INSERT INTO notes VALUES ('PC110',3,'Her mother acted in the place of James II\'s daughter, Princess Louisa Maria Teresa Stuart, giving the veil to Mary Martinash of the Paris Augustinians.');
INSERT INTO notes VALUES ('PA087',2,'She celebrated her jubilee on 19 Jun 1708, marking 50 years since her clothing.');
INSERT INTO notes VALUES ('PA075',1,'She arrived at the convent on 3 Jul 1708, having been recommended by Bishop George Witham of the northern district.  He wrote to his sister, Dorothy Witham, at the convent, advising that Mrs Fleetwood of Plodwell, whom Jeanne had served for some time, would support her financially.  Mrs Fleetwood was originally a Gerard who had been in the monastery when she was young, presumably schooled there (pd 13 Nov 1708).  She would appear to be Frances Gerard, sister of Charles Gerard, 6th lord of Gerard\'s Bromley and William, 7th lord and a Jesuit, who married Thomas Fleetwood.');
INSERT INTO notes VALUES ('PA181',3,'To mark the 50th jubilee of her great aunt, Ann Tyldesley, she created a miniature picture of St Paul (pd 16 Jul 1708).');
INSERT INTO notes VALUES ('PA168',4,'To mark the 50th jubilee of Ann Tyldesley she created a copy of verses in praise of St Paul, written in gold characters (pd 16 Jul 1708).');
INSERT INTO notes VALUES ('PA074',3,'She was found unconscious in her cell on 16 Nov 1708 but later recovered (pd).');
INSERT INTO notes VALUES ('AC034',2,'Hardman 79 gives her death date as 7 Sep 1676. ');
INSERT INTO notes VALUES ('AC119',1,'Because she entered at a relatively advanced age it was agreed that she would not profess after the end of her novititiate, though she would publicly wear the black veil as if she had. The reason was to spare both parties embarrassment if her long years of independence compromised her ability to live under full vows. It was agreed she would take final vows on her deathbed, which she duly did at some point during her final illness.');
INSERT INTO notes VALUES ('AC141',1,'Death date also occurs as 1651 17 Nov.');
INSERT INTO notes VALUES ('BA233',2,'She returned again Dec 1797 on hearing of the death of Mary Catherine Willis the subprioress: II ann 113-4. She was clothed 6 Jan 1798 taking the name Aloysia Joseph, however she left again 4 Sep 1798.');
INSERT INTO notes VALUES ('DP110',1,'She is recorded as dying at Gravelines.  As she does not appear in any of the Gravelines Poor Clare documents, it would appear that she died here after the Dunkirk Poor Clares had been forced to flee from their convent.');
