INSERT INTO notes VALUES ('BB180',1,'Named in the Will of her presumed father, dated 1619 (d. 1626), Lichfield Record Office, Catalogue Index B/C/11 (available at http://www.oxford-shakespeare.com/, accessed 26/2/2011), who left her one thousand pounds. Of the four daughters named in his Will, Vere, Katharine, Anne and Mary, only Katharine appears not to have entered religion. ');
INSERT INTO notes VALUES ('LA262',2,'Generally listed in literary sources as Gertrude Aston.');
INSERT INTO notes VALUES ('BA123',2,'Mentioned in the Will of her father: \'Frances Heneritta, extx., gold watch, a mare, my picture in miniature, choice of fiddles and choice of mandalins, furniture, books, surgeon instruments, and mulatto Jenny.\' Available from The first 100 years: Wills, Court, Church, Land, Inventories & Accounts, Descendant Register, Generation 2, which shows that her mother was Catherine Rozer, born in Prince George\'s County, Maryland.');
INSERT INTO notes VALUES ('GP168',2,'Perhaps a fifth nun daughter of George Jerningham and Eleanor Philpot. Her birth c. 1609x11 and date of profession fits well with theirs. ');
INSERT INTO notes VALUES ('AP078',1,'Parents supplied from pedigrees in  \'Parish of Heighington\', The History and Antiquities of the County Palatine of Durham: volume 3: Stockton and Darlington wards (1823), pp. 303-324. URL: http://www.british-history.ac.uk/report.aspx?compid=76362&strquery=walworth castle jenison Date accessed: 01 February 2011, which shows her as a daughter with the baptismal name Frances.');
INSERT INTO notes VALUES ('LC072',1,'Bruges Annals Vol III p124 claim the sisters were from a branch of the family of Cardinal Poole. This is probably a mistake: see http://www.tim.ukpub.net/visitation/pooles.html');
INSERT INTO notes VALUES ('GB211',1,'The Examination for this nun was conducted in Dutch, which explains the garbling of her mother\'s maiden name as Kelchull. She was undoubtedly Anne Culcheth of Culcheth, wife of Richard Stanley of Ecclestone, Staffs. Two of her brothers were Jesuits, as was her son Henry. The family pedigree was printed by Foley. For detail and source material see \'Townships: Culcheth\', A History of the County of Lancaster: Volume 4 (1911), pp. 156-166. URL: http://www.british-history.ac.uk/report.aspx?compid=41400 Date accessed: 01 February 2011.');
INSERT INTO notes VALUES ('GB106',1,'No mention of her in convent sources under this name.');
INSERT INTO notes VALUES ('GB245',1,'No year given for death');
INSERT INTO notes VALUES ('RP121',3,'R chron I p84 gives her name as Mary, but this appears to be an error.');
INSERT INTO notes VALUES ('RP105',1,'Joined the Community in France, but not professed until after they arrived at Haggerston: R chron III p33');
INSERT INTO notes VALUES ('RP170',2,'Jubilarian Aug 1809');
INSERT INTO notes VALUES ('AC066',1,'Perhaps a daughter of Thomas Howard of Corby Castle and his second wife Barbara Musgrave; if so a niece of Bridget, Lucy and Mary, three nuns of the same house, AC065, AC067, AC069.');
INSERT INTO notes VALUES ('CB027',8,'For further details of creative works see Marion Wynne-Davies, To have her children with her: Elizabeth Cary and Familial Influence, in Heather Wolfe, ed., The literary Career and Legacy of Elizabeth Cary, 1613-1680, Palgrave, 2007');
INSERT INTO notes VALUES ('BB140',3,'Portrait mentioned in annals.');
INSERT INTO notes VALUES ('RP100',1,'Parentage supplied. Likely to be the daughter of this name of John Hornyold of Blackmore and Hanley and his first wife Mary Gower, recorded in the Visitation of Worcester 1682-3 as living and unmarried (p. 61). She was probably therefore niece to PA078-81 (q.v.), whose parentage has been deduced from the same source.');
INSERT INTO notes VALUES ('PA078',1,'Parents supplied. Four and perhaps all five of the Paris Hornyold nuns can be identified with the daughters of these names known (except for Helen)from the Visitation of Worcestershire 1683, p. 61, to have been born to John Hornyold of Blackmore, Worcs (d. 1643) and Elizabeth Russell. They would have been aunts to RP100, who was probably the daughter of their brother Thomas and his first wife Margaret Gower.');
INSERT INTO notes VALUES ('PA079',1,'Parents supplied. Four and perhaps all five of the Paris Hornyold nuns can be identified with the daughters of these names known (except for Helen)from the Visitation of Worcestershire 1683, p. 61, to have been born to John Hornyold of Blackmore, Worcs (d. 1643) and Elizabeth Russell. They would have been aunts to RP100, who was probably the daughter of their brother Thomas and his first wife Margaret Gower.');
INSERT INTO notes VALUES ('PA080',1,'All four Hornyold nuns are likely to have been the daughters of these names known to have been born to John Hornyold of Blackmore, Worcs (d. 1643) and Elizabeth Russell. They would have been aunts to RP100, who was probably the daughter of their brother Thomas and his first wife Margaret Gower.');
INSERT INTO notes VALUES ('PA081',2,'Parents supplied. Four and perhaps all five of the Paris Hornyold nuns can be identified with the daughters of these names known (except for Helen)from the Visitation of Worcestershire 1683, p. 61, to have been born to John Hornyold of Blackmore, Worcs (d. 1643) and Elizabeth Russell. They would have been aunts to RP100, who was probably the daughter of their brother Thomas and his first wife Margaret Gower.');
INSERT INTO notes VALUES ('PA082',1,'Parentage supplied. All four Hornyold nuns are likely to have been the daughters of these names known to have been born to John Hornyold of Blackmore, Worcs (d. 1643) and Elizabeth Russell. They are all recorded as unmarried in the Visitation of Worcestershire 1683, p. 61; where some are recorded as dead in that year it fits the data for these nuns as well. They would have been aunts to RP100, who was probably the daughter of their brother Thomas and his first wife Margaret Gower.');
INSERT INTO notes VALUES ('LA088',2,'Her Uncle William Evans a merchant in Antwerp was a significant donor to the convent.');
INSERT INTO notes VALUES ('GP270',2,'Image facing p 36 in Profession Book.');
INSERT INTO notes VALUES ('DB091',2,'Listed in 1790.');
INSERT INTO notes VALUES ('BB176',1,'Abbess Alexia Blanchard wrote (Jul 24 1651) to the Archbishop of Mechelen requesting permission to give the habit to Helena Thomson who was very virtuous and had a true vocation for the religious life. Her two sons confirmed that they would pay 160 florins every year for her keep as long as she lived. She was not strong enough for heavy labour, but desired to serve the community.');
INSERT INTO notes VALUES ('BB049',1,'Abbess Ursula Hewicke wrote (29 Oct 1624) to the Archbishop of Mechelen explaining that she was too uncertain in her vocation to be allowed to continue.');
INSERT INTO notes VALUES ('GP009',2,'The parents supplied by notes to the CRS volume are certainly incorrect. There would have been an age gap of almost thirty years with one of those alleged to be her sisters. Unfortunately, showing who her true parents were is not currently possible. The pedigree given by Foley of the main branches of this family is inconsistent and contradictory. KKR.');
INSERT INTO notes VALUES ('BF253',1,'Obit states that she served as Vicaress, though the date are impossible to determine from the election data. It also extolled her virtues as a musician - she was mistress of music for many years-  especially as an organist. ');
