INSERT INTO notes VALUES ('PC100',2,'Her nerves are so much attacked, which I believe proceeds from the heat of her blood, and she has had no education, had a great deal of pain to learn the Latin to which she applied herself closely in the beginning... had been a kitchen maid. See Margaret Mason, The Blue Nuns in Norwich 1800-1805, Recusant History, No 24, 1998-9 p99');
INSERT INTO notes VALUES ('PC043',1,'1718 given permission to go to Bourbon to take the waters and from to Bath: did not return to the convent: see Diary 71 and Margaret Mason, The Blue Nuns in Norwich 1800-1805, Recusant History, No 24, 1998-9 p100');
INSERT INTO notes VALUES ('PC082',2,'Nuns received 730 as the residue after other legacies paid from her will: see Margaret Mason, The Blue Nuns in Norwich 1800-1805, Recusant History, No 24, 1998-9 p103');
