INSERT INTO notes VALUES ('GB186',1,'Prayer Book at St Edmund\'s Ware: Cabinet F2, Upper Shelf. \r\nInside cover details of her profession. My mother dyed the first day of April according to the English account 1668. My grandmother Mannock dyed the 14th of March according to the English acct. 1667. My Aunt Angela Pordage dyed on the 5 of March 1682. [From Andrew Cichy.]');
INSERT INTO notes VALUES ('LC065',2,'Letter No 86, 26 Aug 1697 printed in Lambeth Papers, CRS Misc Records 56, 1954, p157. Here she is wrongly identified as Elizabeth Fettiplace.');
INSERT INTO notes VALUES ('GP009',3,'The manuscript profession book gives the date of her death as 14 Jul 1659 and her age at death 52.');
INSERT INTO notes VALUES ('BA094',1,'Lived for years as a widow with Poor Clares in Gravelines; died professed at Bruges, where her younger daughter was Novice Mistress (IBVM/CJ Biographies, 2nd edn. p. 181-2).');
INSERT INTO notes VALUES ('AC089',1,'Her death is described in a letter from Teresa Cowdrey in Lanherne to Port Tobacco 18 Apr 1806');
INSERT INTO notes VALUES ('RP055',2,'Mother was educated by the Mary Ward Sisters in Paris. Her sister Catherine came to Rouen as a scholar but died in 1668 aged 13: see Chronicle Vol I 154, 183-4.\r\n');
INSERT INTO notes VALUES ('RP218',1,'Associated with Mary Parnell Talbot Howard');
INSERT INTO notes VALUES ('RP169',2,'Chronicle describes her as from Eggton Bridge.');
INSERT INTO notes VALUES ('RP047',2,'Chronicle describes her arrival with her Father Mr Chadwick of Burgh who brought also his niece Blundel aged 11 [Elizabeth] and Betty Hide to be a lay nun in July 1766.');
INSERT INTO notes VALUES ('RP017',2,'The Chronicle mentions that a number of pictures and reliquaries were brought to England from France which were the work of Sister Francis Bruno whose health was too delicate to allow her to take part in the more laborious works: see Chron III p61.');
INSERT INTO notes VALUES ('LS009',1,'Name inscribed inside _A Memorial of a Christian Life_ St Omers, 1625. ');
INSERT INTO notes VALUES ('LS041',2,'As well as portion had a pension of 12 a year for life: see Chapter Book p24.');
INSERT INTO notes VALUES ('LS042',3,'As well as portion had the interest on 3000 during her life: see Chapter Book p25.');
INSERT INTO notes VALUES ('LS080',1,'Had for her portion 40 a year & at her death 1666: 13: 4 in the 3% Consolidated Bank annuities falls to the Community: see Chapter Book p25');
INSERT INTO notes VALUES ('LS090',1,'Because of the size of her portion and the fact that she was not accustomed to work was exempted from the hardest tasks of being a lay sister: see Chapter Book p28.');
INSERT INTO notes VALUES ('LS113',1,'No other data known');
INSERT INTO notes VALUES ('LS168',1,'100 ll of her portion was paid the year after her profession in consideration of an infirmity she had: see Chapter Book.');
INSERT INTO notes VALUES ('RP142',1,'Her father was a benefactor of the house, R chron I 17.');
INSERT INTO notes VALUES ('RP138',1,'Likely to have been a sister of RP139.');
INSERT INTO notes VALUES ('RP139',1,'Likely to have been a sister of Bridget RP138.');
INSERT INTO notes VALUES ('LS231',1,'She spent about twenty three years in England between her first and second entries into the convent.');
INSERT INTO notes VALUES ('LA313',1,'Her parents lived in exile in Louvain for their faith. Her brother Rev Richard Worthington became 2nd Chaplain to St Monica\'s: he was buried in their chapel: see Hamilton Vol II 54 etc.');
INSERT INTO notes VALUES ('LA318',1,'Her parents lived in exile in Louvain for their faith. Her brother Rev Richard Worthington became 2nd Chaplain to St Monica\'s: he was buried in their chapel: see Hamilton Vol II 54 etc.');
INSERT INTO notes VALUES ('OB043',2,'Barbara Fitzroy is said to have been the mother of Charles Hamilton by James Douglas, earl of Arran after which she was sent abroad to join the Benedictines at Pontoise: see notes in Diary of the Conceptionists, p355. ODNB entry on Charles Hamilton gives Barbara Fitroy as his mother, explaining that when the earl of Arran discovered the affair, he insisted that she be sent abroad and she joined the English Benedictines the same year. There is no mention of any child in her reported obituary notice.');
INSERT INTO notes VALUES ('DB060',2,'The nuns list Cecilia Fitzroy\'s father as King Charles II. This would not have been possible however, because Lady Barbara Villiers was dismissed from court in 1676, when she moved to Paris. At the time John Churchill was in command of the royal English regiment in France, and ODNB suggest that Lady Villiers moved to Paris to resume their relationship. However by the 1680s we have no knowledge of her relationships and the father of Sister Cecilia is currently unkown. GR');
INSERT INTO notes VALUES ('OB042',1,'ODNB suggests that Sister Ignatia lived to see the consolidation of the Hanoverian dynasty and the coronation of King George III. This seems unlikely as convent records show that she died in 1704. GR ');
INSERT INTO notes VALUES ('MW155',3,'Sr Kirkus (biog dict p. 186)assumes she was a niece of the daughters of George Thweng. The pedigrees established by Foster from the Visitations show that their father Augustus was a younger brother of George. Father also appears in convent records as Albertus.');
INSERT INTO notes VALUES ('AC020',1,'Grandfather Mr. Henry Burton died in prison on account of religion: see Hunter, p. 4. ');
INSERT INTO notes VALUES ('AC095',1,'Brother Edward created Baronet by Charles II in 1670 for Catholic and royalist loyalty, founded line of Mostyns of Talacre (Hardman, 1937, p. 1).\r\nOrdered portress to give aid and food to regiment of exiled Charles II quartered in town during winter, paid for doctors for soldiers (Hardman, 1937, pp. 61-62).');
INSERT INTO notes VALUES ('CB211',3,'Relationship to Waldegrave nuns through mother. Nothing in father\'s lineage to link them. Check ref. KKR');
INSERT INTO notes VALUES ('LC084',2,'She had numerous first cousins once removed amongst the Bedingfields, including the daughter of Francis Bedingfield and Katherine Fortescue.');
INSERT INTO notes VALUES ('RP211',1,'Perhaps the unmarried daughter of this name of Charles Yaxley of Yaxley and his wife Elizabeth Lovell of East Harling (Stirnet). Charles was son of Henry Yaxley and Frances Waldegraves, three of whose daughters were nuns, GP301, CB211 and BB201.');
INSERT INTO notes VALUES ('AC137',1,'Mentioned in Hardman (1937), pp. 39, 41.');
INSERT INTO notes VALUES ('AC102',1,'Mentioned in Hardman (1937), pp. 39.');
INSERT INTO notes VALUES ('AC044',1,'Mentioned in Hardman (1937), pp. 39.');
INSERT INTO notes VALUES ('AC138',1,'Mentioned in Hardman (1937), pp. 39.\r\n');
INSERT INTO notes VALUES ('AC074',1,'Mentioned in Hardman (1937), pp. 39.');
INSERT INTO notes VALUES ('GB241',2,'Listed as one of three unmarried daughters of these parents, Anne, Barbara and Jeronima in Stirnet, following Visitation of Essex. Probably named after the wife of her uncle Charles Waldegrave, Jeronima Jerningham.');
INSERT INTO notes VALUES ('AC140',1,'Mentioned in Hardman (1937), pp. 52-53, p. 116.');
INSERT INTO notes VALUES ('MW163',2,'Listed in Stirnet, following Visitation of Essex, for Nicholas Waldegrave of Borley, Essex, and his wife Katherine Browne, are three unmarried daughters of these parents, Anne, Barbara and Jeronima. The second two were certainly BB189 and GB241: very likely this was the third sister.');
INSERT INTO notes VALUES ('AC096',1,'Mentioned in Hardman (1937), pp. 46, 69, 75, 78. 86, 122, 132.');
INSERT INTO notes VALUES ('LC024',1,'Mentioned in Hardman (1937), p. 81-83.');
INSERT INTO notes VALUES ('LC046',1,'Mentioned in Hardman (1937), p. 86, portrait facing p. 134.');
INSERT INTO notes VALUES ('LC064',1,'Mentioned in Hardman (1937), p. 86.');
INSERT INTO notes VALUES ('LC065',3,'Mentioned in Hardman (1937), pp. 86-87. Dunkirk History p38 explains that her deafness was brought on by walking barefoot.');
INSERT INTO notes VALUES ('LC063',2,'Mentioned in Hardman (1937), p. 86.');
INSERT INTO notes VALUES ('LC003',1,'Mentioned in Hardman (1937), pp. 125-127.');
INSERT INTO notes VALUES ('MW032',2,'Served as Assistant to the Superior, Dispenser (or keeper of the stores) and Consultress (biog dict).');
INSERT INTO notes VALUES ('MW003',1,'Said to have been a close kinswoman of Cecily Cornwallis MW055, whose mother was an Arundel (biog dict). Given her dates she was possibly a daughter of Cecily\'s cousin, Thomas Arundel, 4th Lord of Wardour (1633-1711/2) and his wife Margaret Spencer.');
INSERT INTO notes VALUES ('MW002',1,'Held offices of Keeper of Linen, Dispenser, Assistant and Consultress (biog dic).');
INSERT INTO notes VALUES ('MW026',1,'For some years she held the unenviable post of \'Caller\', and then for 40 years served as cook (biog dic).');
INSERT INTO notes VALUES ('MW027',1,'Assistant infirmarian for nearly thirty years (biog dic).');
INSERT INTO notes VALUES ('MW038',3,'Also served as Librarian and as Consultress (biog dic).');
INSERT INTO notes VALUES ('MW039',1,'Mistress of the day School from 1766 until her sudden death in 1777 (biog dic).');
INSERT INTO notes VALUES ('MW060',2,'Taught French, \'ornamental work\' and Latin in the boarding school (biog dic).');
INSERT INTO notes VALUES ('MW097',1,'Infirmarian to the \'pensioners\' or children in the boarding school (biog dic).');
INSERT INTO notes VALUES ('MW143',1,'Converted through the influence of her aunt Mrs Heneage of Haniton Lincs. Also Assistant Dispenser (biog dic).');
INSERT INTO notes VALUES ('DB115',1,'Dunkirk History p26 suggests she was a connection of Abbess Caryll through her cousin Philippa married Lord Morley amd Monteagle.');
INSERT INTO notes VALUES ('RP055',3,'Extract from obit: She was when very young placed in the holy congregation of the English Jesuitresses at Paris [Mary Ward Sisters] whear she made vows according to their institute & lived in great piety and devotion in that state, her hart still sighing & desiring a Religious life in our Convent ');
INSERT INTO notes VALUES ('MW062',1,'Probably a pupil in Cologne: not known where exactly she joined. Mary Ward refers to her in a letter written from London c. 1639. Known to have been in Rome 1656. She was elected as the fourth General Superior after Mary Poyntz\' death in 1667. (CK-B)');
INSERT INTO notes VALUES ('MW082',1,'She was in Lige in 1627.');
INSERT INTO notes VALUES ('MW098',1,'Probably of French origin: left Institute at suppression.');
INSERT INTO notes VALUES ('MW124',1,'Nothing further known about her.');
INSERT INTO notes VALUES ('MW016',1,'She is given in Sister Ursula Dirmeier\'s list: so far no additional sources located. ');
INSERT INTO notes VALUES ('LC084',3,'Mentioned in Hardman (1937) pp. 127 - 129.');
INSERT INTO notes VALUES ('MW145',2,'Father given in convent texts: confirmation still being sought.');
INSERT INTO notes VALUES ('MW146',1,'Companions records her as daughter of earl of Shrewsbury: confirmation still being sought.');
INSERT INTO notes VALUES ('MW149',2,'Father given in convent sources: confirmation still being sought.');
