INSERT INTO notes VALUES ('BF198',1,'Father described \'of Bruges\'. Obit describes her as a lay sister and a back woman of Bruges. Ages for clothing and profession as in sources: should profession be 24? ');
INSERT INTO notes VALUES ('AC066',2,'Father\'s status given as \'Esq\'');
INSERT INTO notes VALUES ('AC131',2,'Father\'s status given as \'Esq\' in convent sources.');
INSERT INTO notes VALUES ('LA032',1,'Father described as from Yorkshire.');
INSERT INTO notes VALUES ('BF004',1,'She left \'saying she found the duties of religion too hard for her to comply with\': see BC p84');
INSERT INTO notes VALUES ('BF005',1,'Name does not appear in the elections for 1815 suggesting a date of death between 1812 and 1815.');
INSERT INTO notes VALUES ('BF017',1,'P2 of Franciscana reports that out of love for their friend Ann Baker Samuel Alexander and Jane Hercott left England and came to live in the convent. After the death of her husband Jane devoted herself to the service of the convent and made a number of journeys to England. She and her husband gave money, plate and gifts worth 500 to the convent and would have given more had they been able.');
INSERT INTO notes VALUES ('BF184',1,'Skilful in prick song and played the treble viol very well. With her sister brought music into the Choir: See BC p11.');
INSERT INTO notes VALUES ('BF135',1,'Sent to England 1638');
INSERT INTO notes VALUES ('LS066',1,'Responsible for many liturgical reforms.');
INSERT INTO notes VALUES ('LS061',2,'\'greatly revered for her mysticism\'');
INSERT INTO notes VALUES ('LS171',1,'1678 sent to the convent at Bouiloon with Mother Angeline preston to reform the convent: remained there as Prioress until her death in 1680: see M Metcalfe thesis \'Sepultus Est\' p30. ');
INSERT INTO notes VALUES ('LS177',1,'In 1678 sent to Bouillon with Mother Anne Frances Plenevaux, becoming Prioress on the latter\'s death. She was given permission to return to Lige in 1685: see M Metcalfe thesis \'Sepultus Est\', p30. ');
INSERT INTO notes VALUES ('LS061',3,'According to Maurice Whitehead, joint author with Father John Howard SJ of _Prayers and Devout Instructions for different times & duties of the Day_, Lige, 1776. The book was for the use in the Sepulchrine school and the Jesuit academy.');
INSERT INTO notes VALUES ('LA131',2,'Mother Protestant');
INSERT INTO notes VALUES ('BD008',2,'p198: she left Ireland when still a girl.... she determined to abjure Protestantism & embrace the saving Roman Catholic Faith...');
INSERT INTO notes VALUES ('PC018',1,'Diary p244 describes parents as Protestant and says she made her abjuration at Hammersmith in 1713. Was this the result of the work of the Mary Ward Sisters? (CB)');
INSERT INTO notes VALUES ('OB140',2,'This lady was evidently a kinswoman of Catherine Whetenhall abbess of Brussels BB194, who was daughter of Henry Whetenhall and his wife Lettice Tichborne; and also kinswoman of Elizabeth Anne Whetenhall PC124 who declared herself daughter of Thomas Whetenhall and Anne Saunders of Shankton and is said to have had a younger sister Catherine who died a pensioner at Paris in 1717. The three nuns were born between 1693 and 1699, with this lady the youngest. Probably they were cousins and two of them were sisters. Without further research the matter cannot be settled. One point, however, can  be cleared up. Foley, English Jesuits v, 802, thought that Henry Whetenhall S.J.\'s grandfather Thomas was probably father of Henry and all three of these nuns, whereas one at least was certainly Henry\'s daughter and all three were contemporaries. Foley muddied the waters by reference to Henry?s father Thomas\'s second wife Elizabeth Bedingfield just before he speculates about Thomas as the father of Henry and the three nuns. The difficulty was noted in the Bedingfield Papers, p. 90 note, where it was noted that the Oxburgh pedigree of the Bedingfields showed that Elizabeth died without issue. That this was incontrovertibly the fact is shown by her epitaph in Peckham church, where she was buried aged 27 in 1664; it was written by her husband and stated that she died childless (transcribed in A Manor Through Four Centuries, AR Cook, Oxford, 1938, p. 40). ');
INSERT INTO notes VALUES ('LC042',1,'Her parents are clearly the same as those of Mary PC044 so the fuller details available for Mary\'s parents are used here.');
INSERT INTO notes VALUES ('GP013',2,'According to the Visitation of Yorkshire by Sir William Dugdale, 1665 and 1666, George Anne of Frickley had two daughters, Bridget and Frances, who were nuns in Flanders.');
INSERT INTO notes VALUES ('LA195',1,'Great-great-niece of Ursula Palmes,BA149, died 1679.');
INSERT INTO notes VALUES ('LA096',3,'A pedigree of Fortescue of Salden among the Sepulchrine papers at Douai names her mother as Mary Magdalen Revesby.');
INSERT INTO notes VALUES ('BB168',2,'Foster\'s Pedigrees of Yorkshire Families ii Stapleton of Carleton makes both Mary and Charlotte OB030 daughters of Nicholas\'s second wife Mabel Bagnall, although he dates the marriage to 1722, which is Charlotte\'s case could mean she was daughter of the first marriage to Charlotte Eure and thus full sister to Mary.');
INSERT INTO notes VALUES ('GB151',1,'Her parents are given as John Messenger and Margaret Scroot. The full details are found in Walbran\'s pedigree of Messenger (copied in a Douai ms).');
INSERT INTO notes VALUES ('OB019',7,'Her mother was niece of Abbess Mary Knatchbull of Ghent GB118. She was Anne Audley of Essex, daughter of Catherine Knatchbull\'s first marriage, and had married her step-brother through her mother\'s second marriage to Piers Butler of Callan Castle, co. Kilkenny, Ireland.');
INSERT INTO notes VALUES ('PC046',2,'Said in the notes to the Diary to have been a cousin of Mary Bridget Harris PC044. Possibly therefore a sister of Abbess Mary Teresa PC045, daughter of Richard Harris and Martha Hawkins.');
INSERT INTO notes VALUES ('LS098',2,'Speculatively; perhaps a daughter of John Harris of Milton, Cambs, and Martha Tempest, sister of Frances LC042, Catherine LC040 and Mary PC044.');
INSERT INTO notes VALUES ('DB067',1,'A Thomas Gage of Bentley married Juliana Caesar of Williams, Herts, daughter of Robert Caesar and Joanna Lovelace (Stirnet). It is not know where Thomas fits in the Gage genealogy.');
INSERT INTO notes VALUES ('BF224',1,'Mary Slaughter appeared in both convents independently: sufficient circumstantial evidence appeared to support the amalgamation of her identity. CB');
INSERT INTO notes VALUES ('LS061',4,'It is not entirely clear from the convent History p49 how old she was when her father died and her mother returned to the Catholic faith in which she brought up her children. It is possible that she had little recollection of the Protestantism of her father.');
INSERT INTO notes VALUES ('LS062',2,'It is not entirely clear from the convent History p49 how old she was when her father died and her mother returned to the Catholic faith in which she brought up her children. It is possible that she had little recollection of the Protestantism of her father.');
INSERT INTO notes VALUES ('LS082',1,'Father also given title Colonel');
INSERT INTO notes VALUES ('LB069',1,'Father\'s surname given as Graham');
INSERT INTO notes VALUES ('DP067',1,'Surname also given as Hoxey');
INSERT INTO notes VALUES ('BF268',1,'Should mother\'s surname be read as Marshall?');
INSERT INTO notes VALUES ('RP084',1,'May be safely identified with the daughter Jane of these parents (Stirnet). Three of her sisters were nuns, including Elizabeth RP084 who professed with her at Rouen on the same day. The date evidence suggests that she and Elizabeth might have been twins.');
INSERT INTO notes VALUES ('BF153',1,'Her father was Sir Richard Lee of Langley, Shrops, Bart (d. 1660) and her mother Elizabeth daughter of Edward Allen, alderman of London (Visitation of Shrops, 1623, pt II). Her sister Mary was wife of Sir Edward Smythe bart of Esh, brother of Margaret OB113 and Isabella OB114.');
INSERT INTO notes VALUES ('BF142',1,'Book of Clothing p73 records her surname as Kitchenin: surely a misreading of the original ms? Would seem to be sister of BF142.');
INSERT INTO notes VALUES ('LB110',1,'Name also given as Lorraine');
INSERT INTO notes VALUES ('LB129',1,'Surname also written as Pugh');
INSERT INTO notes VALUES ('BF020',1,'\'...her father was a Queaker & her mother a Anabaptista, she was converted at 14 years of age...\': see Book of the Dead p207');
INSERT INTO notes VALUES ('LA230',1,'Probably sister of Margaret Short (BD061) and Mary Short (BD062)');
INSERT INTO notes VALUES ('BD061',1,'Probably sister of Anastasia Short (LA230) and Mary Short (BD062)');
INSERT INTO notes VALUES ('BD062',1,'Probably sister of Anastasia Short (LA230) and Margaret Short (BD061)');
INSERT INTO notes VALUES ('CB059',1,'Parents of PA049-50 are given in http://www.berkshirehistory.com/gentry/englefield_ped.html as Anthony Englefield of Whiteknights and Alice Stokes.');
INSERT INTO notes VALUES ('RP161',3,'Originally entered in database with Elizabeth Sulyard as mother but given Anne Sulyard\'s daughters as sisters: Foley has four daughters of Anne as nuns, but doesn\'t name three of them. CB He also gives the mother\'s name as Elizabeth or Anne. The convent sources agree to call her Anne, the form we  retain. Their evidence confirms that we have four sisters. The name of their father has been normalized because of the level of inconsistency in the spelling. KKR');
INSERT INTO notes VALUES ('LA256',1,'Her father \'was a hot protestant, but her mother was a good Catholick...[He] permitted his wife to keep her religion but would have his children to be brought up in heresie...\' Agnes was brought up in heresy \'but coming to years of discretion ...was secretly reconciled to the church: see Chronicle pp252-9. ');
INSERT INTO notes VALUES ('BF225',1,'With Petronilla Kemp took the habit of a lay sister and lived outside the cloister: they were responsible for the founding of the convent: see BC p6. Taken inside the convent in her old age: see BC p16.');
INSERT INTO notes VALUES ('BF140',1,'With Lucy Sleford took the habit of a lay sister and lived outside the cloister: was responsible for the founding of the convent: see BC p6');
INSERT INTO notes VALUES ('BF124',1,'Niece of the Revd Lord Whiting executed Abbot of Glastonbury: see BC p7');
INSERT INTO notes VALUES ('BF125',1,'Niece of the Revd Lord Whiting executed Abbot of Glastonbury: see BC p7');
INSERT INTO notes VALUES ('BF103',1,'Educated by the Mary Ward sisters at St Omer: see BC p8.\r\nConvent uses the spelling Jernagan, Gernagam, Gernigam or Gernegan');
INSERT INTO notes VALUES ('BF031',1,'Had long served Lady Dormer at Wing in Bucks: see BC p8');
INSERT INTO notes VALUES ('BF199',1,'BC p9 also gives Quinzmond for surname.');
INSERT INTO notes VALUES ('BF145',1,'Sponsored by Dame Margarite de la Laing, countess of Berlaymont: see BC p17. Her father was brother to William Knolles of Rotherfield Grey, Oxon, 1st earl of Banbury; her mother was daughter of John, Baron de Merode and comte de Dlen in Brabant.');
INSERT INTO notes VALUES ('BF134',1,'Also known as Mary of the Holy Cross in religion.');
INSERT INTO notes VALUES ('RP146',1,'Is mother\'s name Derbyshire?');
INSERT INTO notes VALUES ('LA059',3,'Her father was converted when she was 14 years old. She was brought up by her Protestant grandmother after the death of her mother. Like her father\'s religion better, but \'her husband being a Protestant she remained so likewise\'. On his death she brought up her children Catholic. She travelled abroad with her son \'that he might come to learning through Catholick teaching\'. She was attracted to the religious life in Bruges and decided to enter the convent having been a widow some 16 or 17 years: see Chronicle pp 153-5.  ');
INSERT INTO notes VALUES ('DB051',1,'...a novice, already mentioned, who was a convert, and daughter of a Protestant, Colonel Dyve, was admitted... see History p68.');
INSERT INTO notes VALUES ('LA104',2,'She was sister to Henry Garnet the martyr...\'thro\' his means she came to be a Catholick as also to be sent over to be religious...\' Chronicle p348');
INSERT INTO notes VALUES ('RP084',2,'Extract from ODNB entry for Sir Edward Hales:Hales\'s conversion exposed the breakdown of his marriage. He kept his apprehensive wife in a Paris convent for two years from 1686. Several, perhaps all, of his children, however, followed him in turning Catholic.');
INSERT INTO notes VALUES ('RP082',2,'Extract from ODNB entry for Sir Edward Hales:Hales\'s conversion exposed the breakdown of his marriage. He kept his apprehensive wife in a Paris convent for two years from 1686. Several, perhaps all, of his children, however, followed him in turning Catholic.');
INSERT INTO notes VALUES ('RP083',2,'Extract from ODNB entry for Sir Edward Hales:Hales\'s conversion exposed the breakdown of his marriage. He kept his apprehensive wife in a Paris convent for two years from 1686. Several, perhaps all, of his children, however, followed him in turning Catholic.');
INSERT INTO notes VALUES ('BB092',1,'She had been a protestant but was sent for her education to the Benedictines at Calais, she there discovered her error and embraced the true faith: Obituary Book p257 ');
INSERT INTO notes VALUES ('MW100',2,'Biographical Dictionary refers to her Protestant father describing him as an opulent citizen said to have been Mayor of London. She was sent out of London to escape the plague to stay with some Catholic friends and was converted by them.');
INSERT INTO notes VALUES ('YB053',2,'...\'she was converted some time ago, having been a Protestant\'... see Nolan p221');
INSERT INTO notes VALUES ('LA188',2,'Neither of her parents were Catholic \'nor their children except this daughter Ann\'... on the death of her mother she was sent to live with an Aunt who was Catholic with a Protestant husband. Anne was 15 before she became Catholic: see Chronicle p193');
INSERT INTO notes VALUES ('DB120',1,'Nolan p102 describes her as a convert with no further details.');
INSERT INTO notes VALUES ('PB067',1,'The obituary is not clear that the children had been brought up with any element of Protestant teaching: it is possible they had always been Catholic.');
INSERT INTO notes VALUES ('LA229',2,'She was \'brought up an earnest heretick\' and was converted when she went to live with her brother George, a good Catholic: see Chronicle p104 ');
INSERT INTO notes VALUES ('LA233',2,'After his marriage Sir John Skinner continued to be a \'rank heretick\' and would not permit the children to be Catholic. After his death three of his children became Catholic: see Chronicles p293-4.');
INSERT INTO notes VALUES ('DB185',1,'History of Dunkirk p77 refers to both sisters as converts.');
INSERT INTO notes VALUES ('DB184',2,'History of Dunkirk p77 refers to both sisters as converts.');
INSERT INTO notes VALUES ('GP290',2,'Not entirely clear from obit at what age children were converted as no dates given: see Pontoise Register 306 referring to the death of her sister Elizabeth: \'She was one of the Daughters of the Right Honourable Lord Widdrington who with his lady her mother, being converted to the Romaine Catholic Faith neglect\'d not the Instruction of their Children in the same, ...\'');
INSERT INTO notes VALUES ('CB204',1,'Not entirely clear from obit at what age children were converted as no dates given: see Pontoise Register 306 referring to the death of her sister Elizabeth: \'She was one of the Daughters of the Right Honourable Lord Widdrington who with his lady her mother, being converted to the Romaine Catholic Faith neglect\'d not the Instruction of their Children in the same, ...\'');
INSERT INTO notes VALUES ('BA106',4,'Durrant 271-305 gives Catharine Holland\'s own account of her conversion.');
INSERT INTO notes VALUES ('BF003',1,'Portress of the back gate for over 20 years according to BD. A Jubilarian. She played well on the bass viol.');
INSERT INTO notes VALUES ('BF007',1,'Accompanied Vicaress Frances Xaveria Lorymer to Taunton Lodge in September 1807. Became a Jubilarian on 16 Oct 1816.');
INSERT INTO notes VALUES ('BF011',1,'Marketing Sister for above 20 years, being a good conomist (BD: 238).\r\nNote: The text as printed confuses Catharine?s date of clothing, which was probably in 1753. Her ages at date of clothing and of profession are discrepant. ');
INSERT INTO notes VALUES ('BF010',1,'Jubilarian 5 Feb 1811.');
INSERT INTO notes VALUES ('BF018',1,'She became consumptive 4 months after her clothing and was never professed, but remained in the convent infirmary until her death');
INSERT INTO notes VALUES ('BF019',1,'Second mistress of the choir for about 20 years. Suffered a nervous collapse two years before her death.');
INSERT INTO notes VALUES ('BF021',1,'By her husband Mr Prince of Abingdon she had 12 children. Two years after his death she and two of their daughters joined the convent.');
INSERT INTO notes VALUES ('BF022',1,'\'She had a great genious to all sorts of Musick as well as Singing, which though it was painful to her haueing a Cancer, yet she constantly sung or played on some instrument.\' (BD: 208).');
INSERT INTO notes VALUES ('BF023',1,'Obit data inferred from Franciscana Introd. vii which gives her as abbess in 1830, succeeded by Frances Jerningham in 1847.');
INSERT INTO notes VALUES ('BF024',1,'12 years after profession \'some humeur seizing her braine depriued her of her senses for the rest of her life\' (BD). Jubilarian.');
INSERT INTO notes VALUES ('BF006',1,'Widow of Mr Beswick of London. Could she have been grandmother of Anne Beswick BF024?');
INSERT INTO notes VALUES ('BF026',1,'Two of her sisters, Bridget (Mary Alouisa) and Frances (Frances Catherine) were clothed in 1799 (BC: 90). Her mother had been educated in the convent. As a widow Mrs Bird retired to the new location of the community at Taunton and was buried in its cemetery in December 1817 (BD: 251).');
INSERT INTO notes VALUES ('BF027',1,'Grate sister 1776, 1779. Talented musician. Mistress of the choir for upward of 37 years, she wrote music, including plainsong, for it.');
INSERT INTO notes VALUES ('BF030',1,'Last to be clothed at Nieuport. She died some months after a fall in which she broke her thigh bone during her first year as a Jubilarian.');
INSERT INTO notes VALUES ('BF038',2,'Dispenser and Infirmarian for 20 years; still Sacristan at her death in 1685');
INSERT INTO notes VALUES ('BF039',1,'The sources show a confusion in her names; she was called Luicy in BC, known in religion as Luicy John; in BP and BD she occurs as Luisa, name in religion of Luisa of St Bernadine. Death book gives her age as 19 after four years of profession: not possible given other data given and regulations.');
INSERT INTO notes VALUES ('BF052',1,'Talented musician; played violin. Mistress of the choir for many years. Jubilarian 20 June 1762.\r\n');
INSERT INTO notes VALUES ('BF060',2,'First  back gate sister for 18 years.');
INSERT INTO notes VALUES ('BF036',1,'Grate sister 1685.');
INSERT INTO notes VALUES ('BF059',2,'Grate sister 1788-94.');
INSERT INTO notes VALUES ('BF062',2,'Discreet  1705, 1731, 1734, 1737; Grate sister 1734, 1737');
INSERT INTO notes VALUES ('BF066',1,'Dates as infirmarian extrapolated from her obit notice in BD.');
INSERT INTO notes VALUES ('BF068',2,'Sick mother 1743, 1749, 1755; Portress and Discreet 1765, 1773, 1776, 1779');
INSERT INTO notes VALUES ('BF069',1,'Elected Procuratrix and Discreet in 1674, 1679, 1682, 1685, 1688, 1692; Discreet 1705-6, 1710. ');
INSERT INTO notes VALUES ('BF072',1,'Nothing further known. Probably left as did her sister.');
INSERT INTO notes VALUES ('BF086',1,'For some years mistress of the Low Quire having a strong and sweet voice');
INSERT INTO notes VALUES ('BF087',1,'Although infirm from the time of her novitiate was a leading musician, playing organ and bass viol; accomplished needlewoman who taught embroidery in the school.');
INSERT INTO notes VALUES ('BF089',1,'She and her husband had been patrons of the convent after the entry of their daughter BF221 there, among their gifts being a new organ');
INSERT INTO notes VALUES ('BF093',1,'Went to England on some business of her own in 1662. She was increasingly unhappy and claimed to have been forced into religion by her mother. ');
INSERT INTO notes VALUES ('BF097',1,'Mistress of the Music for many years, being a perfect mistress of the organ, lyra viol and bass viol; also the best workwoman that ever the Monistary had, for imbrodry, according to her obit.');
INSERT INTO notes VALUES ('BF105',1,'Returned to England (Winchester) with the community in 1794.');
INSERT INTO notes VALUES ('BF106',1,'Returned to England with the community in 1794.');
INSERT INTO notes VALUES ('BF107',1,'Aged 24 entered the Augustinian Congregation of Our Lady at Douai, professing on 14 June 1772. She accompanied the returning Franciscans of Bruges to England in 1794 at the request of Mr Angelique du Four. She wore the habit of the Franciscans but never professed.');
INSERT INTO notes VALUES ('BF108',1,'Said to have died in the 50th year of  her profession, having been professed in an Irish monastery destroyed by Cromwell\'s war.');
INSERT INTO notes VALUES ('BF109',1,'She held the office of Abbess by conventual election until she deposed on 21 Nov 1640 by Fr Angelus Mason.');
INSERT INTO notes VALUES ('BF114',1,'Jubilarian 6 Jan 1788.');
INSERT INTO notes VALUES ('BF115',1,'Played bass viol and was a great support to the plain song, having been Mistress of the Choir many years (BD).');
INSERT INTO notes VALUES ('BF117',1,'Probably the same person as Anne Andrews BF013, whose details closely mirror hers and was also a lay sister with the unusual name Anne Didacus. BF013\'s obit is given as 4 Apr 1696 aged 66 and of 30 years profession (BD: 200). This would accord with a birth date of c.1630 for BF013 and BF117. However, the clothing entry for BF117 lists her under 1654 (which gives a birth date c 1630), but the text says 1664, which would fit better with 30 years professed for BF013.');
INSERT INTO notes VALUES ('BF119',2,'Accompanied Abbess Timperley on business to England in 1662.');
INSERT INTO notes VALUES ('BF120',1,'Mentioned as a cellarer and infirmarian in her obit.');
INSERT INTO notes VALUES ('BF138',1,'Forced to return to England because of an intractable eye disorder after 15 months.');
INSERT INTO notes VALUES ('BF199',2,'In 1639 one of three nuns sent to found a seminary in England for the support of the convent.');
INSERT INTO notes VALUES ('BF257',1,'Made Jubilarian with her sister Mary Xaveria on 29 Sep 1777.');
INSERT INTO notes VALUES ('BF262',1,'Grate sister 1794-97. Underwent a novitiate of 7 years obeying the new Imerial regulations regarding entry into convents: see BD p239');
INSERT INTO notes VALUES ('BF146',1,'Left after 15 months novitiate because of ill health. ');
INSERT INTO notes VALUES ('BF147',1,'Ages for profession and clothing as given in sources');
INSERT INTO notes VALUES ('BF076',1,'No record of her profession in the Profession Book: however Clothing Book p 79 records that she completed 50 years since her clothing and was made a Jubilarian 1766 1 Jan.');
INSERT INTO notes VALUES ('BF151',1,'Jubilarian 19 Oct 1817: Source gives age at profession as 19.');
INSERT INTO notes VALUES ('BF161',1,'Jubilarian 10 Aug 1734.');
INSERT INTO notes VALUES ('BF163',1,'Turned out for want of strength (BC).');
INSERT INTO notes VALUES ('BF166',1,'Gave 900 pounds towards the purchase of a house adjoining the school in 1769.');
INSERT INTO notes VALUES ('BF170',1,'Brought a considerable portion to the house, out of which she was allowed 4 pound yearly.');
INSERT INTO notes VALUES ('BF178',1,'Grate sister 1746-49.');
INSERT INTO notes VALUES ('BF181',1,'It appears that she was elected second procuratrix within a few months of her death. The text is confused; cf. BC : 52-3 and BD: 198.');
INSERT INTO notes VALUES ('BF089',2,'BD uses her married name (Weld) in obituary.');
INSERT INTO notes VALUES ('BF098',2,'Obituary describes her as an excellent musician \'both of the leeraway, violine and sea trumpet...\'');
INSERT INTO notes VALUES ('BF197',1,'Made a Jubilarian on 11 Oct 1819.');
INSERT INTO notes VALUES ('BF109',2,'Obituary appears under her married name.');
INSERT INTO notes VALUES ('BF203',1,'The age at date of death and at profession in the printed Franciscana text accord. Hence the error in respect of age at clothing, given in the text as 19, is here corrected to 17.');
INSERT INTO notes VALUES ('BF206',1,'Worked in the kitchen the greater part of her time in religion.');
INSERT INTO notes VALUES ('BF207',1,'Under her abbacy the house resolved its debt crisis.');
INSERT INTO notes VALUES ('BF211',1,'Jubilarian 24 June 1806 (BC p93).');
INSERT INTO notes VALUES ('BF217',1,'Grate sister 1752-58, 1761-76.');
INSERT INTO notes VALUES ('BF219',1,'Excellent at music.');
INSERT INTO notes VALUES ('BF223',1,'Last occurs helping the community move to Taunton in 1807.');
INSERT INTO notes VALUES ('BF228',2,'Grate sister 1682-5. Ages as given in clothing and profession irreconcilable.');
INSERT INTO notes VALUES ('BF264',1,'Marketing sister for over 40 years.');
INSERT INTO notes VALUES ('BF269',1,'Seems to have had a connection with the convent from an early age. BC shows that she was recommended to the service of the Baroness de Quincy at Douai by the Revd Father Guardian of St Bonadventure in October 1630.A year later she was sent to serve Lady Babthorpe in Antwerp and from then to Bthune. She was finally clothed at Brussels in April 1633.\r\nAccording to BD she was School Mistress and Novice Mistress at some point. There is no sign of her as Novice Mistress in BP. ');
INSERT INTO notes VALUES ('BF273',1,'On account of poor health was sent to England where she died.');
INSERT INTO notes VALUES ('BF276',1,'Suffered a serious accident in March 1809 at Tauton when she severed a tendon when her arm went through a glass window she was trying to open. A great deal of suffering ensued but her eventual full recovery was recorded as a miracle: her date of death is unknown.');
INSERT INTO notes VALUES ('BF278',1,'Grate Sister 1740-43. Her mother was from Rousham, Norfolk. On the Wood family see F. Blomefield, _Norfolk_ Vol. 5, 83-9.');
INSERT INTO notes VALUES ('BF277',1,'Grate sister 1755-58. Although the records of elections show her as an important member of the community, her obit says that for the last 30 years of her life her health was too poor to allow her to participate in community acts. ');
INSERT INTO notes VALUES ('PT009',2,'A descendant of Major (or Captain) William Boarman, from a family of Devon and Somerset who occurs in 1645 in Maryland; he died in 1709. Elisabeth and her cousin Matilda PT008 were his great-great-granddaughters. See Cornelius Francis Thomas, The Genealogy of the Boarman Family (Baltimore, 1897); http://ia600401.us.archive.org/27/items/genealogyofboarm00thom/genealogyofboarm00thom.pdf (accessed 09.05.11).');
INSERT INTO notes VALUES ('BF139',1,'Age at death as given in convent source.');
INSERT INTO notes VALUES ('BF154',1,'\'she thought religious dutys to hard for her.\'');
INSERT INTO notes VALUES ('BF160',1,'Also known as Helen a Sancta Cruce in religion.');
INSERT INTO notes VALUES ('BF172',1,'\'She was charitably dismissed upon the 14th of May 1790 being in the opinion of all the Discreets, not proper for religion.\'');
INSERT INTO notes VALUES ('BF175',1,'\'A very laborious devout & good religious having been converted to the Catholick faith some few years before she came over...\' BD p216');
INSERT INTO notes VALUES ('BF183',1,'She returned to England and married.');
INSERT INTO notes VALUES ('BF187',1,'\'She was converted to the Holy Roman church some years before she came to be religious and taken into the Church by Bishop York...\' BD p222');
INSERT INTO notes VALUES ('BF194',1,'No other details given');
INSERT INTO notes VALUES ('BF282',1,'half-sister E R [new number]\r\ncousin MR LA218: cousin MR LA217: BC CB043');
INSERT INTO notes VALUES ('BF213',1,'Had been infirm throughout her life, but was very pious and was \'made of the corde of our holy father St Francis\' on her deathbed, according to her obit. This was not the same as full profession since she was below the canonical age.');
INSERT INTO notes VALUES ('BF236',1,'Sponsored by Prince Don Emanuel de Portugal whom she had served: he gave her for her dowry 50 before she was clothed and promised 400 more for her profession. He is recorded as paying 300 of this: BC p16.');
INSERT INTO notes VALUES ('BF237',2,'Age at clothing and profession as given in sources.');
INSERT INTO notes VALUES ('BF248',1,'Appears in BP as Cockayne rather than Turville. In addition to the normal 200 dowry brought an additional 200 for which special arrangements were made to include provision for her children: see BC p60');
INSERT INTO notes VALUES ('BF249',1,'\'played very sweetly on the bass violl\' BD p195');
INSERT INTO notes VALUES ('BF254',1,'She was a secular scholar, but intended by her friends for religion. On her deathbed urgently requested to be professed.');
INSERT INTO notes VALUES ('BD005',2,'Death date supplied by J Chapman, PCC Hartpury, Gloucs, May 2011.');
INSERT INTO notes VALUES ('BD071',2,'Death date supplied by J Chapman, PCC, Hartpury, Gloucs. Tomb gives her as lay sister which seems more likely given her nationality and her illiteracy.');
INSERT INTO notes VALUES ('BD039',1,'Also had 15 pounds a year for life with her 1000 guilders: see OA 201');
INSERT INTO notes VALUES ('BD041',2,'Surname also given as Stafford Howard: see OA 203');
INSERT INTO notes VALUES ('BD043',1,'She endeavoured to enter religion \'a few years affter her convertion from the heresie she was bred in, to the Catholic faith...\' Profession Book p228');
INSERT INTO notes VALUES ('BF177',1,'Possibly a half-sister of BD051 Mary Paston, born in Paris around 1736, who was daughter of Clement Paston, an officer, and Mary Brown.');
INSERT INTO notes VALUES ('BF256',1,'Clothed as Mary of St Xaverius, she thereafter occurs, in a common elision of such names, as Mary Xaveria.');
INSERT INTO notes VALUES ('BF041',1,'Obit says that she fell into a state of imbecility 11 years before her death.');
INSERT INTO notes VALUES ('BF048',1,'Listed with those who returned from Princenhof in Bruges to England in 1794, BC p89.');
INSERT INTO notes VALUES ('BF078',2,'Her obit refers to her as Mother Vicaress - she was elected to that office at each election between 1674 and 1688 - and she seems to have died in tenure. The date of her death was omitted, only the year being given. A document dated 11 Jan 1691 old style, 21 January 1691 new style, was signed by Abbess Brinkhurst and several others, not including Mary Agnes Eyston, who was either ill or already dead. The name following that of the abbess was Mary Gawen. Elizabeth Prince became vicaress in the election of 1692 (BC p53).');
INSERT INTO notes VALUES ('BF077',1,'Jubilarian 13 Jun 1763 (BC p75).');
INSERT INTO notes VALUES ('BF081',1,'According to her obit she had an excellent bass voice.');
INSERT INTO notes VALUES ('BF083',1,'Nothing further known of her. Her mother was Jane Thornborough, daughter of John the anti-recusant bishop of Worcester (d. 1641). See Rev Thomas Rudge. History of the County of Gloucestershire ...down to the year 1803 (Gloucester, 1803), p40. Thornborough was a fascinating and controversial figure. At the end of his life he appointed his Catholic son-in-law Francis Finch as one of the overseers of his Will; see ODNB.');
INSERT INTO notes VALUES ('BF084',1,'On the Finch family of Grovehurst in Milton, Kent, see Archaeologia Cantiana vol. 21, p. 133, on monuments in Preston church. Her brothers Thomas b. 1598 and Richard b. 1600 were baptised there.');
INSERT INTO notes VALUES ('RP217',2,'Probably the daughter of this name of Sir Edward Hales, \'earl of Tenterden\' and his wife Frances Windisbank. She subsequently married a Mr Hussey of Ireland (Stirnet). If so she was sister of RP082-84 and PA074.');
INSERT INTO notes VALUES ('BF088',1,'Willed 50ll by her sister Mrs Haggerston of Ellingham in 1745 (BC p70).');
INSERT INTO notes VALUES ('BF092',1,'The first novice to be clothed at Princenhof in Bruges, BC p36.');
INSERT INTO notes VALUES ('BF094',2,'She was \'turned out\' six months after her first clothing (BC p11) but was obviously successful at her second attempt.');
INSERT INTO notes VALUES ('BF100',1,'Jubilarian.');
INSERT INTO notes VALUES ('BF148',1,'Obit says she was blessed with an excellent voice and a great knowledge of music, mistress of music for many years.');
INSERT INTO notes VALUES ('PC043',2,'She spent almost 7 years as a novice because her portion could not be paid: in the end she received a portion of 4000 livres which was put out to rent: see Diary p49');
INSERT INTO notes VALUES ('GB040',4,'Given permission to spend time with the Conceptionists Paris 23 Aug-29 Sep 1701 with three of her choir nuns (unnamed) and two gentlewomen Bedingfield and Caryll until some business was finished. Visit agreed by the Conceptionists at the request of \'Her Majesty\'. See Conceptionists\' Diary p50');
INSERT INTO notes VALUES ('PC022',1,'Received to the veil by the Abbess and Discreets , but not being found fit was charitably dismissed the same year: p58');
INSERT INTO notes VALUES ('BA099',3,'Her mother is identified as Alice Moore, daughter of Sir Edward Moore, 1st baronet of Kirklington, Notts, by Anthony Adolph, in The Catholic Havers of Thelveton Hall, Norfolk.');
INSERT INTO notes VALUES ('BA099',4,'Mary was great-great-niece of Frances Havers GP149.');
INSERT INTO notes VALUES ('GP149',2,'She was great-great-aunt of Mary Havers BA099 adn Mary Havers PC043.');
INSERT INTO notes VALUES ('PC041',1,'Sent by young Lady Petre: Annals p76');
INSERT INTO notes VALUES ('PC050',1,'Sent by young Lady Petre: Annals p76');
INSERT INTO notes VALUES ('PC018',2,'Recommended by Bishop Gifford: Annals p76');
INSERT INTO notes VALUES ('PC131',1,'Took the veil 8 Nov 1722: Annals p78');
INSERT INTO notes VALUES ('PC089',1,'\'Mrs Rhenelson an English gentlewoman was presented to us by Madame Thirsault in order to be a relligious whome wee could not refuse because the said Madame Thirsault had been soe kinde to us and moreover deed diminish from her accompts which she gave us, and which has allready been spoken of the summe of three thousand livres upon conditione that wee should take some English gentlewoman to be religious who had not wherewith of her own\'. See Annals p78 ');
INSERT INTO notes VALUES ('PC132',1,'Married to a Scots gentleman. Agreed to separate both to enter religion: see Annals p80 Considerable difficulties over negotiating her dowry and entry: see Annals 84-5.');
INSERT INTO notes VALUES ('PC093',2,'Her dowry was paid by Lady Webb: see p95.');
INSERT INTO notes VALUES ('PC070',2,'Sent to the Conceptionists by the Duchess of Norfolk who paid her pension during novitiate at 25 pounds a year: see p97 Grace Duchess of Norfolk also paid her dowry of 150: see p103');
INSERT INTO notes VALUES ('PB085',1,'Went to the Conceptionists to go to confession with their Confessor Mr Christmas and died very suddenly. Was buried at the Conceptionists\' Chruch yard: See Conceptionist Annals p98. Annals also record that she was companion to Lady Catherine Melfort.');
INSERT INTO notes VALUES ('PC116',1,'Dowry converted to 4,360 livres. p103');
INSERT INTO notes VALUES ('PC121',2,'Entered 1740: Also known as Hannah: see p106');
INSERT INTO notes VALUES ('PC030',1,'Portion paid by Grace, duchess of Norfolk: see p108');
INSERT INTO notes VALUES ('PC128',2,'During her second trial in Paris, her pension was paid by the duke of Norfolk: see p107. He also paid her dowry: see p 112.');
INSERT INTO notes VALUES ('MW171',4,'Assisted Mary Poyntz in writing the first biography of Mary Ward and with her commissioned the Painted Life of Mary Ward.');
INSERT INTO notes VALUES ('MW171',5,'Three of her brothers, William, Robert and Richard Wigmore, were Jesuits.');
INSERT INTO notes VALUES ('MW135',3,'Her brother, Robert Rookwood, was a priest and served as confessor to the Poor Clares at Gravelines (1626 c - 1644 c) and then Rouen (1644 c - 1668).  Their father had entertained Queen Elizabeth I in 1578 but died in prison at Bury St Edmunds, Suffolk, in 1598 (Anstruther II, pp.271-2).');
INSERT INTO notes VALUES ('MW100',3,'Reference to her conversion: \'When a plague broke out, [her father] sent his daughter into the country for safety, placing her in the household of a Catholic nobleman. She returned home Catholic.\' See Companions p110.');
INSERT INTO notes VALUES ('PC059',1,'Diary records no vocation.');
INSERT INTO notes VALUES ('PC037',1,'NB Annals lists surname as Lloyd.');
INSERT INTO notes VALUES ('MW167',4,'Her uncles, Thomas Percy, John and Christopher Wright, were all implicated in the Gunpowder Plot.');
INSERT INTO notes VALUES ('PA057',1,'Niece of Arabella Fermor, heroine of Pope\'s poem, Rape of the Lock.');
INSERT INTO notes VALUES ('PA059',1,'Her brother\'s widow married George IV.');
INSERT INTO notes VALUES ('PB035',1,'1807 given as alternative death year.');
INSERT INTO notes VALUES ('PA016',1,'According to Alger, Englishmen in the French Revolution App E, left convent in 1836.');
INSERT INTO notes VALUES ('GB084',1,'Visitation of Sussex (1634) shows her father was Hugh Durvall of Hampton. Her husband was son of Lancelot Gildridge of Bedingham, Sussex, and  Margaret Shelley of Mapledurham (see Stirnet). Her husband was cousin to  Frances Stanford LA242.');
INSERT INTO notes VALUES ('PA047',1,'Her father was a forge man in Shropshire: see Council Book');
INSERT INTO notes VALUES ('PA031',1,'Discussed in Council Meeting 26 Jun 1768 where it was decided she could be accepted although not English because she had been educated in the school.');
INSERT INTO notes VALUES ('BF242',1,'In 1694 entered the Augustinians, Bruges and received special dispensation since there were three sisters. However she decided to move to the Franciscans where she was clothed in April 1694: see bruges Annals Vol I p176.');
INSERT INTO notes VALUES ('BA203',2,'Entered as a convictress with her sister Frances in 1707. her sister left two months after Anne\'s profession. When Frances died in 1734, appraently unmarried, she left 5 pounds to the convent (Bruges Annals I, p268, 273, II, p26).');
INSERT INTO notes VALUES ('LB149',1,'Had been replaced as abbess by Catherine Miles by 1698 (MS Annals p. 179).');
INSERT INTO notes VALUES ('LB148',2,'The Lisbon MS Annals (p. 2, 147, 150-1) state that Lucy and her sister Mary Bridget entered together, and trace a group of Smiths from the first Bridget LB147, to her niece LB149 and then to her great-nieces.\r\nTheir parents are likely to have been Richard Smith of Egton and his wife Agnes, both of whom were presented as recusants in 1674. See http://sites.google.com/site/blackburnkitchingancestry/home/hearts-of-oak/contents/returns1 (accessed 17 June 2011).');
INSERT INTO notes VALUES ('BF116',1,'Note: According to a note in the Book of Clothing she was one of two who \'went forth because they had not the will to persevere\'.');
INSERT INTO notes VALUES ('GB071',4,'LB049 was her half-aunt.');
INSERT INTO notes VALUES ('GP126',2,'');
INSERT INTO notes VALUES ('OB042',2,'Poem published in Carol Shiner Wilson (ed.) _The Galesia Trilogy and Selected Manuscript Poems of Jane Barker,_ Oxford, 1997, pp297-8: from Niall Mackenzie, \'Jane Barker, Louise Hollandine of the Palatinate and \'Solomons Wise Daughter\', _Review of English Studies_ Vol 58, no, 233, 2007.');
INSERT INTO notes VALUES ('mw014',1,'In 1631 she was in Munich, but was later in Rome, probably transferred c.1633-1635 with other younger members. (CK-B)');
INSERT INTO notes VALUES ('mw115',1,'Niece of Cecily Morgan (Companions p111)\r\nShe left after the interrogation of the Lige community and the suppression of the house in 1630. (CK-B)');
INSERT INTO notes VALUES ('mw134',2,'Her brother, Robert Rookwood, was a priest and served as confessor to the Poor Clares at Gravelines (1626 c - 1644 c) and then Rouen (1644 c - 1668).  Their father had entertained Queen Elizabeth I in 1578 but died in prison at Bury St Edmunds, Suffolk, in 1598 (Anstruther II, pp.271-2). Her cousin Ambrose Rookwood was executed in 1606 because of his part in the Gunpowder Plot.');
INSERT INTO notes VALUES ('mw166',2,'Her uncles, Thomas Percy, John and Christopher Wright, were all implicated in the Gunpowder Plot.');
INSERT INTO notes VALUES ('mw037',2,'According to ODNB, it seems likely that the children of gunpowder plotters Robert Catesby and Thomas Percy married, meaning that Helena was the grand-daughter of the two conspirators.');
INSERT INTO notes VALUES ('mw078',1,'Educated by the Mary Ward Sisters in Paris. Resigned her office of Superior in Augsburg because of ill-health and transferred to Munich where she remained until her death in 1685. (CK-B)');
INSERT INTO notes VALUES ('mw095',1,'Educated by the Mary Ward Sisters in Paris. (CK-B)');
INSERT INTO notes VALUES ('AD004',1,'Became convinced that the Ignatian way of life of the order should be given up and a different one substituted. Supported by some in the Lige house. However she suddenly died. No further details of her origins known.');
INSERT INTO notes VALUES ('MW170',3,'Three of her brothers, William, Robert and Richard Wigmore, were Jesuits.');
INSERT INTO notes VALUES ('PC107',4,'P147 refers to her sister Mme la comtesse de Chabot.');
INSERT INTO notes VALUES ('PC008',2,'Had been recommended as a lay sister, but the convent was short of choir sisters and the Abbess and discreets considered her suitable to be a choir nun: see p157');
INSERT INTO notes VALUES ('PC017',1,'Bishop Talbot only knew by hearsay: did not realise she had bad eyes which are an abstacle to her being received: see p181');
INSERT INTO notes VALUES ('HC009',1,'The Will of Richard Vivian senior of St Columb Major, Cornw, gent, proved 1655, names inter alia, his cousin Katharine Hore. The Burlace or Borlase family also occurs in Cornwall, at Treludra, St Just and Crantock and elsewhere.');
INSERT INTO notes VALUES ('LS028',1,'Her mother was Alice Taylor of Claughton, Lancs, named in his spiritual Will by her uncle Richard Taylor 11 May 1726, Lancs. Rec. Off. RCCL/1/5. Her father was of the Butler of Rawcliffe and Eccleston family. His personal name may derive from a link with the Orde family of Weetwood, Northmb. (Catholic Non-Jurors, p. 209). Distant relation of Dorothy Butler (GP059)');
INSERT INTO notes VALUES ('AC021',1,'Dates suggest she that she was a sister of Margaret (AC022). The name Fleetwood occurs among the daughters of Henry Butler of Rawcliffe and his wife Jane Stanley of Eccleston (Stirnet Butler16), who may have been her grand or great-grandparents.');
INSERT INTO notes VALUES ('DP027',1,'The outlines of her parentage are given in her obit in the Chronicle. It has some support from William Blundell, Crosby records : A Cavalier\'s note book being Notes, anecdotes, & observations of William Blundell, of Crosby, Lancashire, esquire, p. 164. Her father was a judge (Deempster) in the Isle of Man, possibly John Cannell who occurs in 1643. The family was persecuted as the only Catholics in the area and Henrietta was brought up largely by her grandmother Hesketh, her mother (daughter of a Thomas Hesketh of Meols) having at least 9 or 10 children. According to the notes to Crosby records, at least five of the children went into religion. Given the closeness in dates of the four Cannel(l) nuns, it is likely that all four were sisters (DP028, GP061, GP062).\r\n\r\n');
INSERT INTO notes VALUES ('MW004',1,'She was a pupil at the Bar Convent School. After profession she occupied nearly every office in the house. As Superior she increased the number of pupils and improved the financial position. She then carried out an extensive building programme, beginning with the hidden chapel (1669) and ending with the present Bar Convent faade (1788) which completed the Georgian core of the convent. (CK-B)');
INSERT INTO notes VALUES ('MW057',2,'As Superior, influenced by the French emigr priests, she fostered a more monastic style of life. In 1816, being misinformed that Mary Ward\'s Institute no longer existed in Germany, she obtained permission from Rome for the Bar Convent to be placed under the authority of the Bishop, with strict enclosure. This separation from the main body of the Institute lasted until 1911. (CK-B)');
INSERT INTO notes VALUES ('MW121',1,'All that is known about her is that she was an early eighteenth century member of the bar Convent.');
INSERT INTO notes VALUES ('MW142',1,'She was an heiress and when she entered she placed her estates at the disposal of the Bar Convent, thus relieving the house of the heavy burden of debt it had endured for many years. (CK-B)');
INSERT INTO notes VALUES ('GP071',2,'');
INSERT INTO notes VALUES ('BF105',2,'Her father was of the furniture-making family and her brother, Robert, died at the English College in Lisbon.  Her father was dismayed by her becoming a nun as he felt she should enjoy the way of life the family business meant she could (odnb Gillow family).');
INSERT INTO notes VALUES ('LA304',3,'She was sub-prioress of St Ursula\'s when she moved to St Monica\'s in 1609 (Chronicle, p87).');
INSERT INTO notes VALUES ('LA302',3,'She was sub-prioress of St Ursula\'s when she moved to St Monica\'s in 1609 (Chronicle, p87). Elected as arcaria of St Monica\'s after the move (Chron., p91).');
INSERT INTO notes VALUES ('LA058',6,'Both her parents had accepted exile for their faith. John Clement instructed his only son and four daughters in Latin and Greek. Her mother was brought up in the house of the martyr, Thomas More, and was also conversant with these languages. They returned to England on the accession of Mary, but Margaret was unwilling to leave St Ursula\'s Louvain even though her father obtained a place for her with the Brigettines in England. She was instructed in religious life by Elizabeth Woodford (LA038), an English nun who had been given shelter by John Clement when ejected from her English monastery and had helped look after Margaret as a child. Margaret\'s sister, Dorothy, who had been a scholar in the convent with her, became a Poor Clare in Louvain. Margaret\'s appointment as superior in 1570 was contentious, she being an Englishwoman in a Flemish house and aged only about 30, but she skillfully led and reformed the house (Chronicle, 3-14). ');
INSERT INTO notes VALUES ('LA232',1,'Of her transfer to St Monica\'s as founder member the Chronicle p89 notes \'Sister Mary Scidmore the youngest had promis of her uncle Sir Richard Farmer of 20 nobles a year, moreover because  she could play on the organs, and had other good parts was gladly taken with them\'.');
INSERT INTO notes VALUES ('LA039',2,'The Chronicle says she her mother was a niece of the earl of Southampton. Hamilton infers that she was sister [or possibly sister-in-law] of Thomas Wriothesley 4th earl of Southampton 1624-67, as inferred from the earl?s Will in which he speaks of his sister Brittan (Hamilton, Louvain I, 148). Chronologically, the Chronicle would seem to refer to the third earl (d. 1624), which makes better sense of describing her father?s children as cousins of Katherine Cornwallis, who was sister of the second earl. The details need further checking.');
INSERT INTO notes VALUES ('LA040',3,'MS Chron, p114-118: She was daughter to Edward Brumfield Esquire in the County of Surrey who living long a Scismatick yet som two years before his death was reconciled and died a good Catholick.  After whose disceace his widdow named Catherin Fromans before her marriage being a gentlewoman of very fine behavor & having good friends was called to the Court of Queen Elizabeth & made Mother of the Maids of Honour not being a Catholick as her desceased husband, but only well minded, she then took this her daughter Ann to the Court at the age of sixteen where for 4 years she gave her self wholly to the pleasures & delights of the world?Almighty God forgot her not in this case, but one day a gentleman that was a Catholick who unknown coming to the court and seeing her so sad and melancholy asked what she wanted. Where unto she answerd she knew not what to do, nor what would help her she was in such affliction of mind.  He answerd that he would bring her to one who should help her, she regarded not then his words being overwhelmed with affliction, but som days after he coming there again she desired him for Gods sake to bring her to one, as he had said the other day. Who thereupon brought her unto Father Garret [Gerard] who instructed her in Catholick religion and reconciled her wherupon her mind was so quieted that she becam contented. But yet she could take no pleasure in the world, therfore left the court and lived as the said Father appointed order for her. At length she discovered to him how she was moved to undertake a religios state, and he very much applauded her mind and animated her therein');
INSERT INTO notes VALUES ('LA266',2,'On her conversion, see MS Chronicle p184-5: In the year 1619 the 14 of April was profest too lay sisters. The first named Mary Thursbie, daughter unto Christopher Thursbie of Buckenhal in Essex, no Catholick. This his daughter Mary went from him about 11 or 12 years of age, to serve her aunt Mrs Green who was a Catholick, yet she lived with her about 12 years before she came into the church, & then continued to live with her aunt for the space of 24 years. After which time she was wery of her service, & therefore desired her father to place her with som other Catholick, for her father loved Catholicks, tho he were non himself, being so timorous that after his daughter was a Catholick he durst not lodg her any long time in his own house, but provided her a place with the old Lady Hudleston where she staid not long by reason that the lady was so fearful that priests came seldom to the house.  & she having been at her aunts, used continually to hear mass & confer with priests liked not this dry kind of life, therfore spoke unto them to provide her of som other place. Whereupon a good priest once asked her if she had no mind to come over to be religious. She answerd she durst not think thereof, but only desired to continue a true Catholick.');
INSERT INTO notes VALUES ('LA265',1,'Gate sister at the time of her death, caused by a contagious disease caught during her gate duties.');
INSERT INTO notes VALUES ('PC128',3,'Her mother was possibly from the Lucas family of Edith Weston, Rutland, and Fenton in Beckingham, Lincs.');
INSERT INTO notes VALUES ('LA073',4,'Had been Arcaria 13 years prior to election as subprioress.');
INSERT INTO notes VALUES ('MW119',2,'Head Mistress of Day School in York');
INSERT INTO notes VALUES ('MW108',2,'Head of Day School for 10 years, then Head of Boarding School for 29 years.');
INSERT INTO notes VALUES ('MW076',2,'Taught French and was Mistress of the Boarding School.');
INSERT INTO notes VALUES ('rp104',1,'Parents supplied by I J Ironside. Martha Ironside\'s grandfather was Bishop of Bristol from 1660: she has other Church of England relatives. Nothing else known about her education at present (July 2011)');
INSERT INTO notes VALUES ('LA058',7,'Clement retired as Prioress at St Ursula\'s in 1605 due to blindness and other infirmities. In the ensuing election a Dutch candidate was preferred over the English even though she had fewer votes. A political back and forth ensued, but Clement urged the English to back down. She and Elizabeth Shirley began to work closely together to establish an all English house, but Clement could not be persuaded to serve as Prioress. (VvH)');
INSERT INTO notes VALUES ('LA203',2,'According to the Bruges Annals (p28) she lived with her brother in France and entered a Teresian convent there much against her brother\'s will. However she did not persevere in that order. (VvH)');
INSERT INTO notes VALUES ('PA061',1,'Mother\'s name appears as Ducsel in the Profession Records (image no aaw15jul120).');
INSERT INTO notes VALUES ('PA203',3,'The parents of Anne and her sisters Mary and Elizabeth are referred to in the convent diurnal. Mrs Yate seems to have been a pensioner at the convent after her husband\'s death (c. 1671). She died there in Jan 1698 and was buried before the communion grate as she had requested. The entry for November 1700 about the raising of a tombstone clearly describes her as the widow of John Yate of Lyford Esquire and the mother \'to three of our religious\'. Her son Charles Yate died in 1696 when she gave a 100 pounds as a present for a service and solemn mass performed by the nuns. Another son, John, was a canon regular of Notre-Dame du Val near Caen. He took charge of the debts owed by his mother to the convent in Feb 1700. It appears that she was Mary Browne, from a junior line of the Brownes of Montague, the Brownes of Caversham, whose arms appear in those of Yates in the family burial monument in the church of St James, West Hanney (Parochial topography of the hundred of Wanting, 1824, p. 122). Chronologically she should appear among the numerous family of George Browne of Caversham and his wife Eleanor Blount, three of whose daughters were nuns, including Elizabeth (PA028) and Winifred (PA029).');
INSERT INTO notes VALUES ('PA204',2,'The parents of Anne and her sisters Mary and Elizabeth are referred to in the convent diurnal. Mrs Yate seems to have been a pensioner at the convent after her husband\'s death (c. 1671). She died there in Jan 1698 and was buried before the communion grate as she had requested. The entry for November 1700 about the raising of a tombstone clearly describes her as the widow of John Yate of Lyford Esquire and the mother \'to three of our religious\'. Her son Charles Yate died in 1696 when she gave a 100 pounds as a present for a service and solemn mass performed by the nuns. Another son, John, was a canon regular of Notre-Dame du Val near Caen. He took charge of the debts owed by his mother to the convent in Feb 1700. It appears that she was Mary Browne, from a junior line of the Brownes of Montague, the Brownes of Caversham, whose arms appear in those of Yates in the family burial monument in the church of St James, West Hanney (Parochial topography of the hundred of Wanting, 1824, p. 122). Chronologically she should appear among the numerous family of George Browne of Caversham and his wife Eleanor Blount, three of whose daughters were nuns, including Elizabeth (PA028) and Winifred (PA029).KK-R');
INSERT INTO notes VALUES ('PA205',3,'The parents of Anne and her sisters Mary and Elizabeth are referred to in the convent diurnal. Mrs Yate seems to have been a pensioner at the convent after her husband\'s death (c. 1671). She died there in Jan 1698 and was buried before the communion grate as she had requested. The entry for November 1700 about the raising of a tombstone clearly describes her as the widow of John Yate of Lyford Esquire and the mother \'to three of our religious\'. Her son Charles Yate died in 1696 when she gave a 100 pounds as a present for a service and solemn mass performed by the nuns. Another son, John, was a canon regular of Notre-Dame du Val near Caen. He took charge of the debts owed by his mother to the convent in Feb 1700. It appears that she was Mary Browne, from a junior line of the Brownes of Montague, the Brownes of Caversham, whose arms appear in those of Yates in the family burial monument in the church of St James, West Hanney (Parochial topography of the hundred of Wanting, 1824, p. 122). Chronologically she should appear among the numerous family of George Browne of Caversham and his wife Eleanor Blount, three of whose daughters were nuns, including Elizabeth (PA028) and Winifred (PA029).');
